matonto:Cerium a owl:Class;
dcterms:title 'Cerium';
dcterms:description 'Cerium is a chemical element; it has symbol Ce and atomic number 58. It is a soft, ductile, and silvery-white metal that tarnishes when exposed to air. Cerium is the second element in the lanthanide series, and while it often shows the oxidation state of +3 characteristic of the series, it also has a stable +4 state that does not oxidize water. It is considered one of the rare-earth elements. Cerium has no known biological role in humans but is not particularly toxic, except with intense or continued exposure.'.

matonto:DoubleBond a owl:Class;
dcterms:title 'double bond';
dcterms:description 'In chemistry, a double bond is a covalent bond between two atoms involving four bonding electrons as opposed to two in a single bond. Double bonds occur most commonly between two carbon atoms, for example in alkenes. Many double bonds exist between two different elements: for example, in a carbonyl group between a carbon atom and an oxygen atom. Other common double bonds are found in azo compounds (N=N), imines (C=N), and sulfoxides (S=O). In a skeletal formula, a double bond is drawn as two parallel lines (=) between the two connected atoms; typographically, the equals sign is used for this. Double bonds were introduced in chemical notation by Russian chemist Alexander Butlerov.';
rdfs:subClassOf matonto:Cerium.

Answer:

matonto:Magnesium a owl:Class;
dcterms:title 'Magnesium';
dcterms:description 'Magnesium is a chemical element; it has symbol Mg and atomic number 12. It is a shiny gray metal having a low density, low melting point and high chemical reactivity. Like the other alkaline earth metals, it occurs naturally only in combination with other elements and almost always has an oxidation state of +2. It reacts readily with air to form a thin passivation coating of magnesium oxide that inhibits further corrosion of the metal. The free metal burns with a brilliant-white light. The metal is obtained mainly by electrolysis of magnesium salts obtained from brine. It is less dense than aluminium and is used primarily as a component in strong and lightweight alloys that contain aluminium.'.

matonto:Radon a owl:Class;
dcterms:title 'Radon';
dcterms:description 'Radon is a chemical element; it has symbol Rn and atomic number 86. It is a radioactive noble gas and is colorless and odorless. Of the three naturally occurring radon isotopes, only 222Rn has a sufficiently long half-life for it to be released from the soil and rock where it is generated. Radon isotopes are the immediate decay products of radium isotopes. The instability of 222Rn, its most stable isotope, makes radon one of the rarest elements. Radon will be present on Earth for several billion more years despite its short half-life, because it is constantly being produced as a step in the decay chains of 238U and 232Th, both of which are abundant radioactive nuclides with half-lives of at least several billion years. The decay of radon produces many other short-lived nuclides, known as "radon daughters", ending at stable isotopes of lead. 222Rn occurs in significant quantities as a step in the normal radioactive decay chain of 238U, also known as the uranium series, which slowly decays into a variety of radioactive nuclides and eventually decays into stable 206Pb. 220Rn occurs in minute quantities as an intermediate step in the decay chain of 232Th, also known as the thorium series, which eventually decays into stable 208Pb.';
rdfs:subClassOf matonto:Magnesium.

Answer:

matonto:Lead a owl:Class;
dcterms:title 'Lead';
dcterms:description 'Lead is a chemical element; it has symbol Pb and atomic number 82. It is a heavy metal that is denser than most common materials. Lead is soft and malleable, and also has a relatively low melting point. When freshly cut, lead is a shiny gray with a hint of blue. It tarnishes to a dull gray color when exposed to air. Lead has the highest atomic number of any stable element and three of its isotopes are endpoints of major nuclear decay chains of heavier elements.'.

matonto:Radiation a owl:Class;
dcterms:title 'radiation';
dcterms:description 'In physics, radiation is the emission or transmission of energy in the form of waves or particles through space or a material medium. This includes:electromagnetic radiation consisting of photons, such as radio waves, microwaves, infrared, visible light, ultraviolet, x-rays, and gamma radiation (γ)
particle radiation consisting of particles of non-zero rest energy, such as alpha radiation (α), beta radiation (β), proton radiation and neutron radiation
acoustic radiation, such as ultrasound, sound, and seismic waves, all dependent on a physical transmission medium
gravitational radiation, in the form of gravitational waves, ripples in spacetime';
rdfs:subClassOf matonto:Lead.

Answer:

