matonto:ExposureUnit a owl:Class;
dcterms:title 'exposure unit';
dcterms:description 'A contact copier is a device used to copy an image by illuminating a film negative with the image in direct contact with a photosensitive surface. The more common processes are negative, where clear areas in the original produce an opaque or hardened photosensitive surface, but positive processes are available. The light source is usually an actinic bulb internal or external to the device.'.

matonto:PolarBond a owl:Class;
dcterms:title 'polar bond';
dcterms:description ' In chemistry, polarity is a separation of electric charge leading to a molecule or its chemical groups having an electric dipole moment, with a negatively charged end and a positively charged end.';
rdfs:subClassOf matonto:ExposureUnit.

Answer:

matonto:Wavenumber a owl:Class;
dcterms:title 'wavenumber';
dcterms:description 'In the physical sciences, the wavenumber, also known as repetency, is the spatial frequency of a wave. Ordinary wavenumber is defined as the number of wave cycles divided by length; it is a physical quantity with dimension of reciprocal length, expressed in SI units of cycles per metre or reciprocal metre (m−1). Angular wavenumber, defined as the wave phase divided by time, is a quantity with dimension of angle per length and SI units of radians per metre. They are analogous to temporal frequency, respectively the ordinary frequency, defined as the number of wave cycles divided by time, and the angular frequency, defined as the phase angle divided by time.'.

matonto:Plutonium a owl:Class;
dcterms:title 'Plutonium';
dcterms:description 'Plutonium is a chemical element; it has symbol Pu and atomic number 94. It is a silvery-gray actinide metal that tarnishes when exposed to air, and forms a dull coating when oxidized. The element normally exhibits six allotropes and four oxidation states. It reacts with carbon, halogens, nitrogen, silicon, and hydrogen. When exposed to moist air, it forms oxides and hydrides that can expand the sample up to 70% in volume, which in turn flake off as a powder that is pyrophoric. It is radioactive and can accumulate in bones, which makes the handling of plutonium dangerous.';
rdfs:subClassOf matonto:Wavenumber.

Answer:

matonto:Oxygen a owl:Class;
dcterms:title 'Oxygen';
dcterms:description 'Oxygen is a chemical element; it has symbol O and atomic number 8. It is a member of the chalcogen group in the periodic table, a highly reactive nonmetal, and a potent oxidizing agent that readily forms oxides with most elements as well as with other compounds. Oxygen is the most abundant element in Earth’s crust, making up almost half of the Earth’s crust in the form of various oxides such as water, carbon dioxide, iron oxides and silicates. It is the third-most abundant element in the universe after hydrogen and helium.'.

