matonto:Polymers a owl:Class;
dcterms:title 'polymers';
dcterms:description 'A polymer is a substance or material that consists of very large molecules, or macromolecules, that are constituted by many repeating subunits derived from one or more species of monomers. Due to their broad spectrum of properties, both synthetic and natural polymers play essential and ubiquitous roles in everyday life. Polymers range from familiar synthetic plastics such as polystyrene to natural biopolymers such as DNA and proteins that are fundamental to biological structure and function. Polymers, both natural and synthetic, are created via polymerization of many small molecules, known as monomers. Their consequently large molecular mass, relative to small molecule compounds, produces unique physical properties including toughness, high elasticity, viscoelasticity, and a tendency to form amorphous and semicrystalline structures rather than crystals.';
rdfs:subClassOf matonto:CrystalSystem.

Answer:

matonto:MolarEnergy a owl:Class;
dcterms:title 'molar energy';
dcterms:description 'The joule per mole is the unit of energy per amount of substance in the International System of Units (SI), such that energy is measured in joules, and the amount of substance is measured in moles.'.

matonto:AdditionReaction a owl:Class;
dcterms:title 'addition reaction';
dcterms:description 'In organic chemistry, an addition reaction is an organic reaction in which two or more molecules combine to form a larger molecule called the adduct.';
rdfs:subClassOf matonto:MolarEnergy.

Answer:

matonto:Radiance a owl:Class;
dcterms:title 'radiance';
dcterms:description 'In radiometry, radiance is the radiant flux emitted, reflected, transmitted or received by a given surface, per unit solid angle per unit projected area. Radiance is used to characterize diffuse emission and reflection of electromagnetic radiation, and to quantify emission of neutrinos and other particles. The SI unit of radiance is the watt per steradian per square metre. It is a directional quantity: the radiance of a surface depends on the direction from which it is being observed.'.

matonto:Radiation a owl:Class;
dcterms:title 'radiation';
dcterms:description 'In physics, radiation is the emission or transmission of energy in the form of waves or particles through space or a material medium. This includes:electromagnetic radiation consisting of photons, such as radio waves, microwaves, infrared, visible light, ultraviolet, x-rays, and gamma radiation (γ)
particle radiation consisting of particles of non-zero rest energy, such as alpha radiation (α), beta radiation (β), proton radiation and neutron radiation
acoustic radiation, such as ultrasound, sound, and seismic waves, all dependent on a physical transmission medium
gravitational radiation, in the form of gravitational waves, ripples in spacetime';
rdfs:subClassOf matonto:Radiance.

Answer:

