matonto:Length a owl:Class;
dcterms:title 'length';
dcterms:description 'Length is a measure of distance. In the International System of Quantities, length is a quantity with dimension distance. In most systems of measurement a base unit for length is chosen, from which all other units are derived. In the International System of Units (SI) system, the base unit for length is the metre.'.

matonto:TransitionMetal a owl:Class;
dcterms:title 'transition metal';
dcterms:description 'In chemistry, a transition metal is a chemical element in the d-block of the periodic table, though the elements of group 12 are sometimes excluded. The lanthanide and actinide elements are called inner transition metals and are sometimes considered to be transition metals as well.';
rdfs:subClassOf matonto:Length.

