matonto:GroupElement a owl:Class;
dcterms:title 'group element';
dcterms:description 'Group 3 is the first group of transition metals in the periodic table. This group is closely related to the rare-earth elements. It contains the four elements scandium (Sc), yttrium (Y), lutetium (Lu), and lawrencium (Lr). The group is also called the scandium group or scandium family after its lightest member.'.

matonto:SpecificEnergy a owl:Class;
dcterms:title 'specific energy';
dcterms:description 'Specific energy or massic energy is energy per unit mass. It is also sometimes called gravimetric energy density, which is not to be confused with energy density, which is defined as energy per unit volume. It is used to quantify, for example, stored heat and other thermodynamic properties of substances such as specific internal energy, specific enthalpy, specific Gibbs free energy, and specific Helmholtz free energy. It may also be used for the kinetic energy or potential energy of a body. Specific energy is an intensive property, whereas energy and mass are extensive properties.';
rdfs:subClassOf matonto:GroupElement.

Answer:

matonto:OctahedralMolecularGeometry a owl:Class;
dcterms:title 'octahedral molecular geometry';
dcterms:description 'In chemistry, octahedral molecular geometry, also called square bipyramidal, describes the shape of compounds with six atoms or groups of atoms or ligands symmetrically arranged around a central atom, defining the vertices of an octahedron. The octahedron has eight faces, hence the prefix octa. The octahedron is one of the Platonic solids, although octahedral molecules typically have an atom in their centre and no bonds between the ligand atoms. A perfect octahedron belongs to the point group Oh. Examples of octahedral compounds are sulfur hexafluoride SF6 and molybdenum hexacarbonyl Mo(CO)6. The term "octahedral" is used somewhat loosely by chemists, focusing on the geometry of the bonds to the central atom and not considering differences among the ligands themselves. For example, [Co(NH3)6]3+, which is not octahedral in the mathematical sense due to the orientation of the N−H bonds, is referred to as octahedral.'.

