matonto:TrigonalPyramidalMolecularGeometry a owl:Class;
dcterms:title 'trigonal pyramidal molecular geometry';
dcterms:description 'In chemistry, a trigonal pyramid is a molecular geometry with one atom at the apex and three atoms at the corners of a trigonal base, resembling a tetrahedron (not to be confused with the tetrahedral geometry). When all three atoms at the corners are identical, the molecule belongs to point group C3v. Some molecules and ions with trigonal pyramidal geometry are the pnictogen hydrides (XH3), xenon trioxide (XeO3), the chlorate ion, ClO−3, and the sulfite ion, SO2−3. In organic chemistry, molecules which have a trigonal pyramidal geometry are sometimes described as sp3 hybridized. The AXE method for VSEPR theory states that the classification is AX3E1.'.

matonto:PartitionCoefficient a owl:Class;
dcterms:title 'partition coefficient';
dcterms:description '
In the physical sciences, a partition coefficient (P) or distribution coefficient (D) is the ratio of concentrations of a compound in a mixture of two immiscible solvents at equilibrium. This ratio is therefore a comparison of the solubilities of the solute in these two liquids. The partition coefficient generally refers to the concentration ratio of un-ionized species of compound, whereas the distribution coefficient refers to the concentration ratio of all species of the compound.';
rdfs:subClassOf matonto:TrigonalPyramidalMolecularGeometry.

Answer:

