matonto:AbsorbedDose a owl:Class;
dcterms:title 'absorbed dose';
dcterms:description 'Absorbed dose is a dose quantity which represents the specific energy deposited by ionizing radiation in living matter. Absorbed dose is used in the calculation of dose uptake in living tissue in both radiation protection, and radiology. It is also used to directly compare the effect of radiation on inanimate matter such as in radiation hardening.'.

matonto:AmideGroup a owl:Class;
dcterms:title 'amide group';
dcterms:description 'In organic chemistry, an amide, also known as an organic amide or a carboxamide, is a compound with the general formula R−C(=O)−NR′R″, where R, R’, and R″ represent any group, typically organyl groups or hydrogen atoms. The amide group is called a peptide bond when it is part of the main chain of a protein, and an isopeptide bond when it occurs in a side chain, as in asparagine and glutamine. It can be viewed as a derivative of a carboxylic acid with the hydroxyl group replaced by an amino group ; or, equivalently, an acyl (alkanoyl) group joined to an amino group.';
rdfs:subClassOf matonto:AbsorbedDose.

Answer:

matonto:Group7Element a owl:Class;
dcterms:title 'group 7 element';
dcterms:description 'Group 7, numbered by IUPAC nomenclature, is a group of elements in the periodic table. It contains manganese (Mn), technetium (Tc), rhenium (Re) and bohrium (Bh). This group lies in the d-block of the periodic table, and are hence transition metals. This group is sometimes called the manganese group or manganese family after its lightest member; however, the group itself has not acquired a trivial name because it belongs to the broader grouping of the transition metals.'.

