matonto:Name a owl:Class;
dcterms:title 'name';
dcterms:description 'A name is a term used for identification by an external observer. They can identify a class or category of things, or a single thing, either uniquely, or within a given context. The entity identified by a name is called its referent. A personal name identifies, not necessarily uniquely, a specific individual human. The name of a specific entity is sometimes called a proper name and is, when consisting of only one word, a proper noun. Other nouns are sometimes called "common names" or (obsolete) "general names". A name can be given to a person, place, or thing; for example, parents can give their child a name or a scientist can give an element a name.'.

matonto:Entropy a owl:Class;
dcterms:title 'entropy';
dcterms:description 'Entropy is a scientific concept, most commonly associated with states of disorder, randomness, or uncertainty. The term and the concept are used in diverse fields, from classical thermodynamics, where it was first recognized, to the microscopic description of nature in statistical physics, and to the principles of information theory. It has found far-ranging applications in chemistry and physics, in biological systems and their relation to life, in cosmology, economics, sociology, weather science, climate change and information systems including the transmission of information in telecommunication.';
rdfs:subClassOf matonto:Name.

Answer:

matonto:EmpiricalFormula a owl:Class;
dcterms:title 'Empirical Formula';
dcterms:description 'In chemistry, the empirical formula of a chemical compound is the simplest whole number ratio of atoms present in a compound. A simple example of this concept is that the empirical formula of sulfur monoxide, or SO, is simply SO, as is the empirical formula of disulfur dioxide, S2O2. Thus, sulfur monoxide and disulfur dioxide, both compounds of sulfur and oxygen, have the same empirical formula. However, their molecular formulas, which express the number of atoms in each molecule of a chemical compound, are not the same.'.

matonto:TrigonalPyramidalMolecularGeometry a owl:Class;
