matonto:MeltingPoint a owl:Class;
dcterms:title 'Melting Point';
dcterms:description 'The melting point of a substance is the temperature at which it changes state from solid to liquid. At the melting point the solid and liquid phase exist in equilibrium. The melting point of a substance depends on pressure and is usually specified at a standard pressure such as 1 atmosphere or 100 kPa.'.

matonto:AmountOfSubstanceConcentration a owl:Class;
dcterms:title 'amount of substance concentration';
dcterms:description 'Molar concentration (also called molarity, amount concentration or substance concentration) is the number of moles of solute per liter of solution. Specifically, It is a measure of the concentration of a chemical species, in particular, of a solute in a solution, in terms of amount of substance per unit volume of solution. In chemistry, the most commonly used unit for molarity is the number of moles per liter, having the unit symbol mol/L or mol/dm3 (1000 mol/m3) in SI units. A solution with a concentration of 1 mol/L is said to be 1 molar, commonly designated as 1 M or 1 M. Molarity is often depicted with square brackets around the substance of interest; for example, the molarity of the hydrogen ion is depicted as [H+].';
rdfs:subClassOf matonto:MeltingPoint.

