matonto:DisplacementReaction a owl:Class;
dcterms:title 'displacement reaction';
dcterms:description 'A chemical reaction is a process that leads to the chemical transformation of one set of chemical substances to another. When chemical reactions occur, the atoms are rearranged and the reaction is accompanied by an energy change as new products are generated. Classically, chemical reactions encompass changes that only involve the positions of electrons in the forming and breaking of chemical bonds between atoms, with no change to the nuclei, and can often be described by a chemical equation. Nuclear chemistry is a sub-discipline of chemistry that involves the chemical reactions of unstable and radioactive elements where both electronic and nuclear changes can occur.'.

matonto:Group16Element a owl:Class;
dcterms:title 'group 16 element';
dcterms:description 'The chalcogens are the chemical elements in group 16 of the periodic table. This group is also known as the oxygen family. Group 16 consists of the elements oxygen (O), sulfur (S), selenium (Se), tellurium (Te), and the radioactive elements polonium (Po) and livermorium (Lv). Often, oxygen is treated separately from the other chalcogens, sometimes even excluded from the scope of the term "chalcogen" altogether, due to its very different chemical behavior from sulfur, selenium, tellurium, and polonium. The word "chalcogen" is derived from a combination of the Greek word khalkos (χαλκός) principally meaning copper, and the Latinized Greek word genēs, meaning born or produced.';
rdfs:subClassOf matonto:DisplacementReaction.

Answer:

matonto:Length a owl:Class;
dcterms:title 'length';
dcterms:description 'Length is a measure of distance. In the International System of Quantities, length is a quantity with dimension distance. In most systems of measurement a base unit for length is chosen, from which all other units are derived. In the International System of Units (SI) system, the base unit for length is the metre.'.

matonto:Molybdenum a owl:Class;
dcterms:title 'Molybdenum';
dcterms:description 'Molybdenum is a chemical element; it has symbol Mo and atomic number 42. The name derived from Ancient Greek Μόλυβδος molybdos, meaning lead, since its ores were confused with lead ores. Molybdenum minerals have been known throughout history, but the element was discovered in 1778 by Carl Wilhelm Scheele. The metal was first isolated in 1781 by Peter Jacob Hjelm.';
rdfs:subClassOf matonto:Length.

