matonto:Rubidium a owl:Class;
dcterms:title 'Rubidium';
dcterms:description 'Rubidium is a chemical element; it has symbol Rb and atomic number 37. It is a very soft, whitish-grey solid in the alkali metal group, similar to potassium and caesium. Rubidium is the first alkali metal in the group to have a density higher than water. On Earth, natural rubidium comprises two isotopes: 72% is a stable isotope 85Rb, and 28% is slightly radioactive 87Rb, with a half-life of 48.8 billion years – more than three times as long as the estimated age of the universe.'.

matonto:Metalloid a owl:Class;
dcterms:title 'metalloid';
dcterms:description 'A metalloid is a chemical element which has a preponderance of properties in between, or that are a mixture of, those of metals and nonmetals. The word metalloid comes from the Latin metallum ("metal") and the Greek oeides. There is no standard definition of a metalloid and no complete agreement on which elements are metalloids. Despite the lack of specificity, the term remains in use in the literature.';
rdfs:subClassOf matonto:Rubidium.

Answer:

matonto:Period7Element a owl:Class;
dcterms:title 'period 7 element';
dcterms:description 'A period 7 element is one of the chemical elements in the seventh row of the periodic table of the chemical elements. The periodic table is laid out in rows to illustrate recurring (periodic) trends in the chemical behavior of the elements as their atomic number increases: a new row is begun when chemical behavior begins to repeat, meaning that elements with similar behavior fall into the same vertical columns. The seventh period contains 32 elements, tied for the most with period 6, beginning with francium and ending with oganesson, the heaviest element currently discovered. As a rule, period 7 elements fill their 7s shells first, then their 5f, 6d, and 7p shells in that order, but there are exceptions, such as uranium.'.

