matonto:Isomer a owl:Class;
dcterms:title 'isomer';
dcterms:description 'In chemistry, isomers are molecules or polyatomic ions with identical molecular formula – that is, the same number of atoms of each element – but distinct arrangements of atoms in space. Isomerism refers to the existence or possibility of isomers.'.

matonto:Radium a owl:Class;
dcterms:title 'Radium';
dcterms:description 'Radium is a chemical element; it has symbol Ra and atomic number 88. It is the sixth element in group 2 of the periodic table, also known as the alkaline earth metals. Pure radium is silvery-white, but it readily reacts with nitrogen (rather than oxygen) upon exposure to air, forming a black surface layer of radium nitride (Ra3N2). All isotopes of radium are radioactive, the most stable isotope being radium-226 with a half-life of 1,600 years. When radium decays, it emits ionizing radiation as a by-product, which can excite fluorescent chemicals and cause radioluminescence. For this property, it was widely used in self-luminous paints following its discovery. Of the radioactive elements that occur in quantity, radium is considered particularly toxic, and it is carcinogenic due to the radioactivity of both it and its immediate decay product radon as well as its tendency to accumulate in the bones.';
rdfs:subClassOf matonto:Isomer.

Answer:

matonto:Ununtrium a owl:Class;
dcterms:title 'Ununtrium';
dcterms:description 'Nihonium is a synthetic chemical element; it has symbol Nh and atomic number 113. It is extremely radioactive: its most stable known isotope, nihonium-286, has a half-life of about 10 seconds. In the periodic table, nihonium is a transactinide element in the p-block. It is a member of period 7 and group 13.'.

matonto:Cerium a owl:Class;
dcterms:title 'Cerium';
dcterms:description 'Cerium is a chemical element; it has symbol Ce and atomic number 58. It is a soft, ductile, and silvery-white metal that tarnishes when exposed to air. Cerium is the second element in the lanthanide series, and while it often shows the oxidation state of +3 characteristic of the series, it also has a stable +4 state that does not oxidize water. It is considered one of the rare-earth elements. Cerium has no known biological role in humans but is not particularly toxic, except with intense or continued exposure.';
rdfs:subClassOf matonto:Ununtrium.

Answer:

matonto:Cerium a owl:Class;
dcterms:title 'Cerium';
dcterms:description 'Cerium is a chemical element; it has symbol Ce and atomic number 58. It is a soft, ductile, and silvery-white metal that tarnishes when exposed to air. Cerium is the second element in the lanthanide series, and while it often shows the oxidation state of +3 characteristic of the series, it also has a stable +4 state that does not oxidize water. It is considered one of the rare-earth elements. Cerium has no known biological role in humans but is not particularly toxic, except with intense or continued exposure.'.

matonto:Uranium a owl:Class;
dcterms:title 'Uranium';
dcterms:description 'Uranium is a chemical element; it has symbol U and atomic number 92. It is a silvery-grey metal in the actinide series of the periodic table. A uranium atom has 92 protons and 92 electrons, of which 6 are valence electrons. Uranium radioactively decays, usually by emitting an alpha particle. The half-life of this decay varies between 159,200 and 4.5 billion years for different isotopes, making them useful for dating the age of the Earth. The most common isotopes in natural uranium are uranium-238 and uranium-235. Uranium has the highest atomic weight of the primordially occurring elements. Its density is about 70% higher than that of lead and slightly lower than that of gold or tungsten. It occurs naturally in low concentrations of a few parts per million in soil, rock and water, and is commercially extracted from uranium-bearing minerals such as uraninite.';
rdfs:subClassOf matonto:Cerium.

Answer:

