matonto:Permittivity a owl:Class;
dcterms:title 'permittivity';
dcterms:description 'In electromagnetism, the absolute permittivity, often simply called permittivity and denoted by the Greek letter ε (epsilon), is a measure of the electric polarizability of a dielectric material. A material with high permittivity polarizes more in response to an applied electric field than a material with low permittivity, thereby storing more energy in the material. In electrostatics, the permittivity plays an important role in determining the capacitance of a capacitor.'.

matonto:Radon a owl:Class;
dcterms:title 'Radon';
dcterms:description 'Radon is a chemical element; it has symbol Rn and atomic number 86. It is a radioactive noble gas and is colorless and odorless. Of the three naturally occurring radon isotopes, only 222Rn has a sufficiently long half-life for it to be released from the soil and rock where it is generated. Radon isotopes are the immediate decay products of radium isotopes. The instability of 222Rn, its most stable isotope, makes radon one of the rarest elements. Radon will be present on Earth for several billion more years despite its short half-life, because it is constantly being produced as a step in the decay chains of 238U and 232Th, both of which are abundant radioactive nuclides with half-lives of at least several billion years. The decay of radon produces many other short-lived nuclides, known as "radon daughters", ending at stable isotopes of lead. 222Rn occurs in significant quantities as a step in the normal radioactive decay chain of 238U, also known as the uranium series, which slowly decays into a variety of radioactive nuclides and eventually decays into stable 206Pb. 220Rn occurs in minute quantities as an intermediate step in the decay chain of 232Th, also known as the thorium series, which eventually decays into stable 208Pb.';
rdfs:subClassOf matonto:Permittivity.

Answer:

matonto:Ketone a owl:Class;
dcterms:title 'ketone';
dcterms:description 'In organic chemistry, a ketone is an organic compound with the structure R−C(=O)−R’, where R and R’ can be a variety of carbon-containing substituents. Ketones contain a carbonyl group −C(=O)−. The simplest ketone is acetone, with the formula (CH3)2CO. Many ketones are of great importance in biology and industry. Examples include many sugars (ketoses), many steroids and the solvent acetone.'.

matonto:Aldehyde a owl:Class;
dcterms:title 'aldehyde';
dcterms:description 'In organic chemistry, an aldehyde is an organic compound containing a functional group with the structure R−CH=O. The functional group itself can be referred to as an aldehyde but can also be classified as a formyl group. Aldehydes are a common motif in many chemicals important in technology and biology.';
rdfs:subClassOf matonto:Ketone.

Answer:

matonto:GroupElement a owl:Class;
dcterms:title 'group element';
dcterms:description 'Group 3 is the first group of transition metals in the periodic table. This group is closely related to the rare-earth elements. It contains the four elements scandium (Sc), yttrium (Y), lutetium (Lu), and lawrencium (Lr). The group is also called the scandium group or scandium family after its lightest member.'.

matonto:Group11Element a owl:Class;
dcterms:title 'group 11 element';
dcterms:description 'Group 11, by modern IUPAC numbering, is a group of chemical elements in the periodic table, consisting of copper (Cu), silver (Ag), gold (Au), and roentgenium (Rg), although no chemical experiments have yet been carried out to confirm that roentgenium behaves like the heavier homologue to gold. Group 11, more specifically, the first three members are also known as the coinage metals, due to their usage in minting coins—while the rise in metal prices mean that silver and gold are no longer used for circulating currency, remaining in use for bullion, copper remains a common metal in coins to date, either in the form of copper clad coinage or as part of the cupronickel alloy. They were most likely the first three elements discovered. Copper, silver, and gold all occur naturally in elemental form.';
rdfs:subClassOf matonto:GroupElement.

