matonto:Area a owl:Class;
dcterms:title 'area';
dcterms:description 'Area is the measure of a region’s size on a surface. The area of a plane region or plane area refers to the area of a shape or planar lamina, while surface area refers to the area of an open surface or the boundary of a three-dimensional object. Area can be understood as the amount of material with a given thickness that would be necessary to fashion a model of the shape, or the amount of paint necessary to cover the surface with a single coat. It is the two-dimensional analogue of the length of a curve or the volume of a solid .
Two different regions may have the same area ; by synecdoche, "area" sometimes is used to refer to the region, as in a "polygonal area".';
rdfs:subClassOf matonto:MeasuredProperty.

Answer:

matonto:Chalcogen a owl:Class;
dcterms:title 'chalcogen';
dcterms:description 'The chalcogens are the chemical elements in group 16 of the periodic table. This group is also known as the oxygen family. Group 16 consists of the elements oxygen (O), sulfur (S), selenium (Se), tellurium (Te), and the radioactive elements polonium (Po) and livermorium (Lv). Often, oxygen is treated separately from the other chalcogens, sometimes even excluded from the scope of the term "chalcogen" altogether, due to its very different chemical behavior from sulfur, selenium, tellurium, and polonium. The word "chalcogen" is derived from a combination of the Greek word khalkos (χαλκός) principally meaning copper, and the Latinized Greek word genēs, meaning born or produced.'.

