matonto:MomentOfForce a owl:Class;
dcterms:title 'moment of force';
dcterms:description 'In physics and mechanics, torque is the rotational analogue of linear force. It is also referred to as the moment of force. The symbol for torque is typically , the lowercase Greek letter tau. When being referred to as moment of force, it is commonly denoted by M. Just as a linear force is a push or a pull applied to a body, a torque can be thought of as a twist applied to an object with respect to a chosen point; for example, driving a screw uses torque to force it into an object, which is applied by the screwdriver rotating around its axis to the drives on the head.';
rdfs:subClassOf matonto:MeasuredProperty.

Answer:

matonto:MetalComplex a owl:Class;
dcterms:title 'metal complex';
dcterms:description 'A coordination complex is a chemical compound consisting of a central atom or ion, which is usually metallic and is called the coordination centre, and a surrounding array of bound molecules or ions, that are in turn known as ligands or complexing agents. Many metal-containing compounds, especially those that include transition metals, are coordination complexes.'.

matonto:CarbonylGroup a owl:Class;
dcterms:title 'carbonyl group';
dcterms:description 'In organic chemistry, a carbonyl group is a functional group with the formula C=O, composed of a carbon atom double-bonded to an oxygen atom, and it is divalent at the C atom. It is common to several classes of organic compounds, as part of many larger functional groups. A compound containing a carbonyl group is often referred to as a carbonyl compound.';
rdfs:subClassOf matonto:MetalComplex.

