matonto:Wikipedia a owl:Class;
dcterms:title 'Wikipedia';
dcterms:description 'Wikipedia is a free online encyclopedia that is written and maintained by a community of volunteers, known as Wikipedians, through open collaboration and the wiki software MediaWiki. Founded by Jimmy Wales and Larry Sanger in 2001, Wikipedia has been hosted since 2003 by the Wikimedia Foundation, an American nonprofit organization funded mainly by donations from readers. Wikipedia is the largest and most-read reference work in history.';
rdfs:subClassOf matonto:D-blockElement.

