matonto:EquivalentDose a owl:Class;
dcterms:title 'equivalent dose';
dcterms:description 'Equivalent dose is a dose quantity representing the stochastic health effects of low levels of ionizing radiation on the human body which represents the probability of radiation-induced cancer and genetic damage. It is derived from the physical quantity absorbed dose, but also takes into account the biological effectiveness of the radiation, which is dependent on the radiation type and energy. In the international system of units (SI), its unit of measure is the sievert (Sv).'.

matonto:MethylGroup a owl:Class;
dcterms:title 'methyl group';
dcterms:description 'In organic chemistry, a methyl group is an alkyl derived from methane, containing one carbon atom bonded to three hydrogen atoms, having chemical formula CH3. In formulas, the group is often abbreviated as Me. This hydrocarbon group occurs in many organic compounds. It is a very stable group in most molecules. While the methyl group is usually part of a larger molecule, bonded to the rest of the molecule by a single covalent bond, it can be found on its own in any of three forms: methanide anion, methylium cation or methyl radical. The anion has eight valence electrons, the radical seven and the cation six. All three forms are highly reactive and rarely observed.';
rdfs:subClassOf matonto:EquivalentDose.

Answer:

matonto:Uranium a owl:Class;
dcterms:title 'Uranium';
dcterms:description 'Uranium is a chemical element; it has symbol U and atomic number 92. It is a silvery-grey metal in the actinide series of the periodic table. A uranium atom has 92 protons and 92 electrons, of which 6 are valence electrons. Uranium radioactively decays, usually by emitting an alpha particle. The half-life of this decay varies between 159,200 and 4.5 billion years for different isotopes, making them useful for dating the age of the Earth. The most common isotopes in natural uranium are uranium-238 and uranium-235. Uranium has the highest atomic weight of the primordially occurring elements. Its density is about 70% higher than that of lead and slightly lower than that of gold or tungsten. It occurs naturally in low concentrations of a few parts per million in soil, rock and water, and is commercially extracted from uranium-bearing minerals such as uraninite.'.

matonto:IonicCompound a owl:Class;
dcterms:title 'ionic compound';
dcterms:description 'In chemistry, a salt or ionic compound is a chemical compound consisting of an assembly of positively charged ions (cations) and negatively charged ions (anions), which results in a compound with no net electric charge. The constituent ions are held together by electrostatic forces termed ionic bonds.';
rdfs:subClassOf matonto:Uranium.

Answer:

matonto:Inductance a owl:Class;
dcterms:title 'inductance';
dcterms:description 'Inductance is the tendency of an electrical conductor to oppose a change in the electric current flowing through it. The electric current produces a magnetic field around the conductor. The magnetic field strength depends on the magnitude of the electric current, and therefore follows any changes in the magnitude of the current. From Faraday’s law of induction, any change in magnetic field through a circuit induces an electromotive force (EMF) (voltage) in the conductors, a process known as electromagnetic induction. This induced voltage created by the changing current has the effect of opposing the change in current. This is stated by Lenz’s law, and the voltage is called back EMF.'.

