matonto:ElectricFluxDensity a owl:Class;
dcterms:title 'electric flux density';
dcterms:description '

In physics, the electric displacement field, also called electric flux density, is a vector field that appears in Maxwell’s equations. It accounts for the electromagnetic effects of polarization and that of an electric field, combining the two in an auxiliary field. It plays a major role in the physics of phenomena such as the capacitance of a material, the response of dielectrics to an electric field, how shapes can change due to electric fields in piezoelectricity or flexoelectricity as well as the creation of voltages and charge transfer due to elastic strains.'.

matonto:Strontium a owl:Class;
dcterms:title 'Strontium';
dcterms:description 'Strontium is a chemical element; it has symbol Sr and atomic number 38. An alkaline earth metal, it is a soft silver-white yellowish metallic element that is highly chemically reactive. The metal forms a dark oxide layer when it is exposed to air. Strontium has physical and chemical properties similar to those of its two vertical neighbors in the periodic table, calcium and barium. It occurs naturally mainly in the minerals celestine and strontianite, and is mostly mined from these.';
rdfs:subClassOf matonto:ElectricFluxDensity.

