matonto:Oxygen a owl:Class;
dcterms:title 'Oxygen';
dcterms:description 'Oxygen is a chemical element; it has symbol O and atomic number 8. It is a member of the chalcogen group in the periodic table, a highly reactive nonmetal, and a potent oxidizing agent that readily forms oxides with most elements as well as with other compounds. Oxygen is the most abundant element in Earth’s crust, making up almost half of the Earth’s crust in the form of various oxides such as water, carbon dioxide, iron oxides and silicates. It is the third-most abundant element in the universe after hydrogen and helium.';
