matonto:KetoneGroup a owl:Class;
dcterms:title 'ketone group';
dcterms:description 'In organic chemistry, a ketone is an organic compound with the structure R−C(=O)−R’, where R and R’ can be a variety of carbon-containing substituents. Ketones contain a carbonyl group −C(=O)−. The simplest ketone is acetone, with the formula (CH3)2CO. Many ketones are of great importance in biology and industry. Examples include many sugars (ketoses), many steroids, e.g., testosterone, and the solvent acetone.'.

matonto:MolarEntropy a owl:Class;
dcterms:title 'molar entropy';
dcterms:description 'Entropy is a scientific concept, most commonly associated with states of disorder, randomness, or uncertainty. The term and the concept are used in diverse fields, from classical thermodynamics, where it was first recognized, to the microscopic description of nature in statistical physics, and to the principles of information theory. It has found far-ranging applications in chemistry and physics, in biological systems and their relation to life, in cosmology, economics, sociology, weather science, climate change and information systems including the transmission of information in telecommunication.';
rdfs:subClassOf matonto:KetoneGroup.

Answer:

matonto:Osmium a owl:Class;
dcterms:title 'Osmium';
dcterms:description 'Osmium is a chemical element; it has symbol Os and atomic number 76. It is a hard, brittle, bluish-white transition metal in the platinum group that is found as a trace element in alloys, mostly in platinum ores. Osmium is the densest naturally occurring element. When experimentally measured using X-ray crystallography, it has a density of 22.59 g/cm3. Manufacturers use its alloys with platinum, iridium, and other platinum-group metals to make fountain pen nib tipping, electrical contacts, and in other applications that require extreme durability and hardness.'.

matonto:FlexuralModulus a owl:Class;
dcterms:title 'flexural modulus';
dcterms:description 'In mechanics, the flexural modulus, bending modulus, or modulus of rigidity is an intensive property that is computed as the ratio of stress to strain in flexural deformation, or the tendency for a material to resist bending. It is determined from the slope of a stress-strain curve produced by a flexural test, and uses units of force per area. The flexural modulus defined using the 2-point (cantilever) and 3-point bend tests assumes a linear stress strain response.';
rdfs:subClassOf matonto:Osmium.

Answer:

matonto:Radon a owl:Class;
dcterms:title 'Radon';
dcterms:description 'Radon is a chemical element; it has symbol Rn and atomic number 86. It is a radioactive noble gas and is colorless and odorless. Of the three naturally occurring radon isotopes, only 222Rn has a sufficiently long half-life for it to be released from the soil and rock where it is generated. Radon isotopes are the immediate decay products of radium isotopes. The instability of 222Rn, its most stable isotope, makes radon one of the rarest elements. Radon will be present on Earth for several billion more years despite its short half-life, because it is constantly being produced as a step in the decay chains of 238U and 232Th, both of which are abundant radioactive nuclides with half-lives of at least several billion years. The decay of radon produces many other short-lived nuclides, known as "radon daughters", ending at stable isotopes of lead. 222Rn occurs in significant quantities as a step in the normal radioactive decay chain of 238U, also known as the uranium series, which slowly decays into a variety of radioactive nuclides and eventually decays into stable 206Pb. 220Rn occurs in minute quantities as an intermediate step in the decay chain of 232Th, also known as the thorium series, which eventually decays into stable 208Pb.'.

matonto:ThermalExpansion a owl:Class;
dcterms:title 'Thermal Expansion';
dcterms:description 'Thermal expansion is the tendency of matter to increase in length, area, or volume, changing its size and density, in response to an increase in temperature .
Substances usually contract with decreasing temperature, with rare exceptions within limited temperature ranges.';
rdfs:subClassOf matonto:Radon.

