matonto:Wavenumber a owl:Class;
dcterms:title 'wavenumber';
dcterms:description 'In the physical sciences, the wavenumber, also known as repetency, is the spatial frequency of a wave. Ordinary wavenumber is defined as the number of wave cycles divided by length; it is a physical quantity with dimension of reciprocal length, expressed in SI units of cycles per metre or reciprocal metre (m−1). Angular wavenumber, defined as the wave phase divided by time, is a quantity with dimension of angle per length and SI units of radians per metre. They are analogous to temporal frequency, respectively the ordinary frequency, defined as the number of wave cycles divided by time, and the angular frequency, defined as the phase angle divided by time.'.

