matonto:Period7Element a owl:Class;
dcterms:title 'period 7 element';
dcterms:description 'A period 7 element is one of the chemical elements in the seventh row of the periodic table of the chemical elements. The periodic table is laid out in rows to illustrate recurring (periodic) trends in the chemical behavior of the elements as their atomic number increases: a new row is begun when chemical behavior begins to repeat, meaning that elements with similar behavior fall into the same vertical columns. The seventh period contains 32 elements, tied for the most with period 6, beginning with francium and ending with oganesson, the heaviest element currently discovered. As a rule, period 7 elements fill their 7s shells first, then their 5f, 6d, and 7p shells in that order, but there are exceptions, such as uranium.'.

matonto:ThiolGroup a owl:Class;
dcterms:title 'thiol group';
dcterms:description 'In organic chemistry, a thiol, or thiol derivative, is any organosulfur compound of the form R−SH, where R represents an alkyl or other organic substituent. The −SH functional group itself is referred to as either a thiol group or a sulfhydryl group, or a sulfanyl group. Thiols are the sulfur analogue of alcohols, and the word is a blend of "thio-" with "alcohol".';
rdfs:subClassOf matonto:Period7Element.

Answer:

matonto:ThermalConduction a owl:Class;
dcterms:title 'thermal conduction';
dcterms:description 'Thermal conduction is the diffusion of thermal energy (heat) within one material or between materials in contact. The higher temperature object has molecules with more kinetic energy; collisions between molecules distributes this kinetic energy until an object has the same kinetic energy throughout. Thermal conductivity, frequently represented by k, is a property that relates the rate of heat loss per unit area of a material to its rate of change of temperature. Essentially, it is a value that accounts for any property of the material that could change the way it conducts heat. Heat spontaneously flows along a temperature gradient. For example, heat is conducted from the hotplate of an electric stove to the bottom of a saucepan in contact with it. In the absence of an opposing external driving energy source, within a body or between bodies, temperature differences decay over time, and thermal equilibrium is approached, temperature becoming more uniform.'.

matonto:Group15Element a owl:Class;
