matonto:Rubidium a owl:Class;
dcterms:title 'Rubidium';
dcterms:description 'Rubidium is a chemical element; it has symbol Rb and atomic number 37. It is a very soft, whitish-grey solid in the alkali metal group, similar to potassium and caesium. Rubidium is the first alkali metal in the group to have a density higher than water. On Earth, natural rubidium comprises two isotopes: 72% is a stable isotope 85Rb, and 28% is slightly radioactive 87Rb, with a half-life of 48.8 billion years – more than three times as long as the estimated age of the universe.'.

matonto:Tin a owl:Class;
dcterms:title 'Tin';
dcterms:description 'Tin is a chemical element; it has symbol Sn and atomic number 50. A silvery-colored metal, tin is soft enough to be cut with little force, and a bar of tin can be bent by hand with little effort. When bent, the so-called "tin cry" can be heard as a result of twinning in tin crystals.';
