matonto:HydrogenAtom a owl:Class;
dcterms:title 'Hydrogen Atom';
dcterms:description 'A hydrogen atom is an atom of the chemical element hydrogen. The electrically neutral hydrogen atom contains a single positively charged proton in the nucleus, and a single negatively charged electron bound to the nucleus by the Coulomb force. Atomic hydrogen constitutes about 75% of the baryonic mass of the universe.';
