matonto:Bromine a owl:Class;
dcterms:title 'Bromine';
dcterms:description 'Bromine is a chemical element; it has symbol Br and atomic number 35. It is a volatile red-brown liquid at room temperature that evaporates readily to form a similarly coloured vapour. Its properties are intermediate between those of chlorine and iodine. Isolated independently by two chemists, Carl Jacob Löwig and Antoine Jérôme Balard, its name was derived from Ancient Greek  βρῶμος (bromos) ’stench’, referring to its sharp and pungent smell.';
