matonto:RadiantIntensity a owl:Class;
dcterms:title 'radiant intensity';
dcterms:description 'In radiometry, radiant intensity is the radiant flux emitted, reflected, transmitted or received, per unit solid angle, and spectral intensity is the radiant intensity per unit frequency or wavelength, depending on whether the spectrum is taken as a function of frequency or of wavelength. These are directional quantities. The SI unit of radiant intensity is the watt per steradian, while that of spectral intensity in frequency is the watt per steradian per hertz and that of spectral intensity in wavelength is the watt per steradian per metre —commonly the watt per steradian per nanometre. Radiant intensity is distinct from irradiance and radiant exitance, which are often called intensity in branches of physics other than radiometry. In radio-frequency engineering, radiant intensity is sometimes called radiation intensity.';
rdfs:subClassOf matonto:EnergyUnit.

Answer:

matonto:Volume a owl:Class;
dcterms:title 'volume';
dcterms:description 'Volume is a measure of regions in three-dimensional space. It is often quantified numerically using SI derived units or by various imperial or US customary units. The definition of length and height (cubed) is interrelated with volume. The volume of a container is generally understood to be the capacity of the container; i.e., the amount of fluid that the container could hold, rather than the amount of space the container itself displaces. 
By metonymy, the term "volume" sometimes is used to refer to the corresponding region.'.

matonto:Calcium a owl:Class;
dcterms:title 'Calcium';
dcterms:description 'Calcium is a chemical element; it has symbol Ca and atomic number 20. As an alkaline earth metal, calcium is a reactive metal that forms a dark oxide-nitride layer when exposed to air. Its physical and chemical properties are most similar to its heavier homologues strontium and barium. It is the fifth most abundant element in Earth’s crust, and the third most abundant metal, after iron and aluminium. The most common calcium compound on Earth is calcium carbonate, found in limestone and the fossilised remnants of early sea life; gypsum, anhydrite, fluorite, and apatite are also sources of calcium. The name derives from Latin calx "lime", which was obtained from heating limestone.';
rdfs:subClassOf matonto:Volume.

Answer:

