matonto:Ruthenium a owl:Class;
dcterms:title 'Ruthenium';
dcterms:description 'Ruthenium is a chemical element; it has symbol Ru and atomic number 44. It is a rare transition metal belonging to the platinum group of the periodic table. Like the other metals of the platinum group, ruthenium is unreactive to most chemicals. Karl Ernst Claus, a Russian scientist of Baltic-German ancestry, discovered the element in 1844 at Kazan State University and named it in honor of Russia. Ruthenium is usually found as a minor component of platinum ores; the annual production has risen from about 19 tonnes in 2009 to some 35.5 tonnes in 2017. Most ruthenium produced is used in wear-resistant electrical contacts and thick-film resistors. A minor application for ruthenium is in platinum alloys and as a chemical catalyst. A new application of ruthenium is as the capping layer for extreme ultraviolet photomasks. Ruthenium is generally found in ores with the other platinum group metals in the Ural Mountains and in North and South America. Small but commercially important quantities are also found in pentlandite extracted from Sudbury, Ontario, and in pyroxenite deposits in South Africa.';
rdfs:subClassOf matonto:MaterialCategory.

Answer:

matonto:CarbonAllotrope a owl:Class;
dcterms:title 'carbon allotrope';
dcterms:description 'Carbon is capable of forming many allotropes due to its valency (tetravalent). Well-known forms of carbon include diamond and graphite. In recent decades, many more allotropes have been discovered and researched, including ball shapes such as buckminsterfullerene and sheets such as graphene. Larger-scale structures of carbon include nanotubes, nanobuds and nanoribbons. Other unusual forms of carbon exist at very high temperatures or extreme pressures. Around 500 hypothetical 3‑periodic allotropes of carbon are known at the present time, according to the Samara Carbon Allotrope Database (SACADA).'.

matonto:Fullerene a owl:Class;
dcterms:title 'fullerene';
dcterms:description 'A fullerene is an allotrope of carbon whose molecules consist of carbon atoms connected by single and double bonds so as to form a closed or partially closed mesh, with fused rings of five to six atoms. The molecules may have hollow sphere- and ellipsoid-like forms, tubes, or other shapes.';
rdfs:subClassOf matonto:CarbonAllotrope.

Answer:

matonto:Entropy a owl:Class;
dcterms:title 'entropy';
dcterms:description 'Entropy is a scientific concept, most commonly associated with states of disorder, randomness, or uncertainty. The term and the concept are used in diverse fields, from classical thermodynamics, where it was first recognized, to the microscopic description of nature in statistical physics, and to the principles of information theory. It has found far-ranging applications in chemistry and physics, in biological systems and their relation to life, in cosmology, economics, sociology, weather science, climate change and information systems including the transmission of information in telecommunication.'.

matonto:Gold a owl:Class;
dcterms:title 'Gold';
dcterms:description 'Gold is a chemical element; it has chemical symbol Au and atomic number 79. In its pure form, it is a bright, slightly orange-yellow, dense, soft, malleable, and ductile metal. Chemically, gold is a transition metal, a group 11 element, and one of the noble metals. It is one of the least reactive chemical elements, being the second-lowest in the reactivity series. It is solid under standard conditions.';
rdfs:subClassOf matonto:Entropy.

Answer:

matonto:Aldehyde a owl:Class;
dcterms:title 'aldehyde';
dcterms:description 'In organic chemistry, an aldehyde is an organic compound containing a functional group with the structure R−CH=O. The functional group itself can be referred to as an aldehyde but can also be classified as a formyl group. Aldehydes are a common motif in many chemicals important in technology and biology.'.

matonto:SolidPhase a owl:Class;
dcterms:title 'solid phase';
dcterms:description 'In the physical sciences, a phase is a region of material that is chemically uniform, physically distinct, and (often) mechanically separable. In a system consisting of ice and water in a glass jar, the ice cubes are one phase, the water is a second phase, and the humid air is a third phase over the ice and water. The glass of the jar is a different material, in its own separate phase.';
rdfs:subClassOf matonto:Aldehyde.

Answer:

matonto:SingleDisplacementReaction a owl:Class;
dcterms:title 'single displacement reaction';
dcterms:description 'A single-displacement reaction, also known as single replacement reaction or exchange reaction, is an archaic concept in chemistry. It describes the stoichiometry of some chemical reactions in which one element or ligand is replaced by an atom or group.'.

matonto:MomentOfForce a owl:Class;
dcterms:title 'moment of force';
dcterms:description 'In physics and mechanics, torque is the rotational analogue of linear force. It is also referred to as the moment of force. The symbol for torque is typically , the lowercase Greek letter tau. When being referred to as moment of force, it is commonly denoted by M. Just as a linear force is a push or a pull applied to a body, a torque can be thought of as a twist applied to an object with respect to a chosen point; for example, driving a screw uses torque to force it into an object, which is applied by the screwdriver rotating around its axis to the drives on the head.';
rdfs:subClassOf matonto:SingleDisplacementReaction.

Answer:

