matonto:Force a owl:Class;
dcterms:title 'force';
dcterms:description 'In physics, a force is an influence that can cause an object to change its velocity unless counterbalanced by other forces. In mechanics, force makes ideas like ’pushing’ or ’pulling’ mathematically precise. Because the magnitude and direction of a force are both important, force is a vector quantity. The SI unit of force is the newton (N), and force is often represented by the symbol F.'.

matonto:Inductance a owl:Class;
dcterms:title 'inductance';
dcterms:description 'Inductance is the tendency of an electrical conductor to oppose a change in the electric current flowing through it. The electric current produces a magnetic field around the conductor. The magnetic field strength depends on the magnitude of the electric current, and therefore follows any changes in the magnitude of the current. From Faraday’s law of induction, any change in magnetic field through a circuit induces an electromotive force (EMF) (voltage) in the conductors, a process known as electromagnetic induction. This induced voltage created by the changing current has the effect of opposing the change in current. This is stated by Lenz’s law, and the voltage is called back EMF.';
rdfs:subClassOf matonto:Force.

