matonto:Hydrophobicity a owl:Class;
dcterms:title 'hydrophobicity';
dcterms:description 'In chemistry, hydrophobicity is the chemical property of a molecule that is seemingly repelled from a mass of water. In contrast, hydrophiles are attracted to water.'.

matonto:Capacitance a owl:Class;
dcterms:title 'capacitance';
dcterms:description 'Capacitance is the ability of an object to store electric charge. It is measured by the change in charge in response to a difference in electric potential, expressed as the ratio of those quantities. Commonly recognized are two closely related notions of capacitance: self capacitance and mutual capacitance. An object that can be electrically charged exhibits self capacitance, for which the electric potential is measured between the object and ground. Mutual capacitance is measured between two components, and is particularly important in the operation of the capacitor, an elementary linear electronic component designed to add capacitance to an electric circuit.';
rdfs:subClassOf matonto:Hydrophobicity.

