matonto:CarbonylGroup a owl:Class;
dcterms:title 'carbonyl group';
dcterms:description 'In organic chemistry, a carbonyl group is a functional group with the formula C=O, composed of a carbon atom double-bonded to an oxygen atom, and it is divalent at the C atom. It is common to several classes of organic compounds, as part of many larger functional groups. A compound containing a carbonyl group is often referred to as a carbonyl compound.'.

matonto:Wavenumber a owl:Class;
dcterms:title 'wavenumber';
dcterms:description 'In the physical sciences, the wavenumber, also known as repetency, is the spatial frequency of a wave. Ordinary wavenumber is defined as the number of wave cycles divided by length; it is a physical quantity with dimension of reciprocal length, expressed in SI units of cycles per metre or reciprocal metre (m−1). Angular wavenumber, defined as the wave phase divided by time, is a quantity with dimension of angle per length and SI units of radians per metre. They are analogous to temporal frequency, respectively the ordinary frequency, defined as the number of wave cycles divided by time, and the angular frequency, defined as the phase angle divided by time.';
rdfs:subClassOf matonto:CarbonylGroup.

Answer:

matonto:Dipole-dipoleInteraction a owl:Class;
dcterms:title 'dipole-dipole interaction';
dcterms:description 'An intermolecular force is the force that mediates interaction between molecules, including the electromagnetic forces of attraction
or repulsion which act between atoms and other types of neighbouring particles. Intermolecular forces are weak relative to intramolecular forces – the forces which hold a molecule together. For example, the covalent bond, involving sharing electron pairs between atoms, is much stronger than the forces present between neighboring molecules. Both sets of forces are essential parts of force fields frequently used in molecular mechanics.'.

matonto:Precipitate a owl:Class;
dcterms:title 'precipitate';
dcterms:description 'In an aqueous solution, precipitation is the "sedimentation of a solid material from a liquid solution". The solid formed is called the precipitate. In case of an inorganic chemical reaction leading to precipitation, the chemical reagent causing the solid to form is called the precipitant.';
rdfs:subClassOf matonto:Dipole-dipoleInteraction.

