matonto:MolarMass a owl:Class;
dcterms:title 'molar mass';
dcterms:description 'In chemistry, the molar mass of a chemical substance is defined as the ratio between the mass and the amount of substance of any sample of the substance: . The molar mass is a bulk, not molecular, property of a substance. The molar mass is an average of many instances of the element or compound, which often vary in mass due to the presence of isotopes. Most commonly, the molar mass is computed from the standard atomic weights and is thus a terrestrial average and a function of the relative abundance of the isotopes of the constituent atoms on Earth.'.

matonto:Hardness a owl:Class;
dcterms:title 'Hardness';
dcterms:description 'In materials science, hardness is a measure of the resistance to localized plastic deformation, such as an indentation or a scratch (linear), induced mechanically either by pressing or abrasion. In general, different materials differ in their hardness; for example hard metals such as titanium and beryllium are harder than soft metals such as sodium and metallic tin, or wood and common plastics. Macroscopic hardness is generally characterized by strong intermolecular bonds, but the behavior of solid materials under force is complex; therefore, hardness can be measured in different ways, such as scratch hardness, indentation hardness, and rebound hardness. Hardness is dependent on ductility, elastic stiffness, plasticity, strain, strength, toughness, viscoelasticity, and viscosity. Common examples of hard matter are ceramics, concrete, certain metals, and superhard materials, which can be contrasted with soft matter.';
rdfs:subClassOf matonto:MolarMass.

Answer:

matonto:MomentOfForce a owl:Class;
dcterms:title 'moment of force';
dcterms:description 'In physics and mechanics, torque is the rotational analogue of linear force. It is also referred to as the moment of force. The symbol for torque is typically , the lowercase Greek letter tau. When being referred to as moment of force, it is commonly denoted by M. Just as a linear force is a push or a pull applied to a body, a torque can be thought of as a twist applied to an object with respect to a chosen point; for example, driving a screw uses torque to force it into an object, which is applied by the screwdriver rotating around its axis to the drives on the head.'.

matonto:ElectricConduction a owl:Class;
dcterms:title 'electric conduction';
dcterms:description 'An electric current is a flow of charged particles, such as electrons or ions, moving through an electrical conductor or space. It is defined as the net rate of flow of electric charge through a surface. The moving particles are called charge carriers, which may be one of several types of particles, depending on the conductor. In electric circuits the charge carriers are often electrons moving through a wire. In semiconductors they can be electrons or holes. In an electrolyte the charge carriers are ions, while in plasma, an ionized gas, they are ions and electrons.';
rdfs:subClassOf matonto:MomentOfForce.

Answer:

