dcterms:description 'In physics, radiation is the emission or transmission of energy in the form of waves or particles through space or a material medium. This includes:electromagnetic radiation consisting of photons, such as radio waves, microwaves, infrared, visible light, ultraviolet, x-rays, and gamma radiation (γ)
particle radiation consisting of particles of non-zero rest energy, such as alpha radiation (α), beta radiation (β), proton radiation and neutron radiation
acoustic radiation, such as ultrasound, sound, and seismic waves, all dependent on a physical transmission medium
gravitational radiation, in the form of gravitational waves, ripples in spacetime'.

matonto:ElectricCurrent a owl:Class;
dcterms:title 'electric current';
dcterms:description 'An electric current is a flow of charged particles, such as electrons or ions, moving through an electrical conductor or space. It is defined as the net rate of flow of electric charge through a surface. The moving particles are called charge carriers, which may be one of several types of particles, depending on the conductor. In electric circuits the charge carriers are often electrons moving through a wire. In semiconductors they can be electrons or holes. In an electrolyte the charge carriers are ions, while in plasma, an ionized gas, they are ions and electrons.';
rdfs:subClassOf matonto:Radiation.

Answer:

matonto:MomentOfForce a owl:Class;
dcterms:title 'moment of force';
dcterms:description 'In physics and mechanics, torque is the rotational analogue of linear force. It is also referred to as the moment of force. The symbol for torque is typically , the lowercase Greek letter tau. When being referred to as moment of force, it is commonly denoted by M. Just as a linear force is a push or a pull applied to a body, a torque can be thought of as a twist applied to an object with respect to a chosen point; for example, driving a screw uses torque to force it into an object, which is applied by the screwdriver rotating around its axis to the drives on the head.'.

matonto:Promethium a owl:Class;
dcterms:title 'Promethium';
dcterms:description 'Promethium is a chemical element; it has symbol Pm and atomic number 61. All of its isotopes are radioactive; it is extremely rare, with only about 500–600 grams naturally occurring in the Earth’s crust at any given time. Promethium is one of the only two radioactive elements that are both preceded and followed in the periodic table by elements with stable forms, the other being technetium. Chemically, promethium is a lanthanide. Promethium shows only one stable oxidation state of +3.';
rdfs:subClassOf matonto:MomentOfForce.

Answer:

