dcterms:title 'group 15 element';
dcterms:description 'The pnictogens are the chemical elements in group 15 of the periodic table. This group is also known as the nitrogen group or nitrogen family. Group 15 consists of the elements nitrogen (N), phosphorus (P), arsenic (As), antimony (Sb), bismuth (Bi), and moscovium (Mc).';
