matonto:FlexuralModulus a owl:Class;
dcterms:title 'flexural modulus';
dcterms:description 'In mechanics, the flexural modulus, bending modulus, or modulus of rigidity is an intensive property that is computed as the ratio of stress to strain in flexural deformation, or the tendency for a material to resist bending. It is determined from the slope of a stress-strain curve produced by a flexural test, and uses units of force per area. The flexural modulus defined using the 2-point (cantilever) and 3-point bend tests assumes a linear stress strain response.'.

matonto:Homocyclic a owl:Class;
dcterms:title 'homocyclic';
dcterms:description 'In chemistry, a ring is an ambiguous term referring either to a simple cycle of atoms and bonds in a molecule or to a connected set of atoms and bonds in which every atom and bond is a member of a cycle. A ring system that is a simple cycle is called a monocycle or simple ring, and one that is not a simple cycle is called a polycycle or polycyclic ring system. A simple ring contains the same number of sigma bonds as atoms, and a polycyclic ring system contains more sigma bonds than atoms.';
rdfs:subClassOf matonto:FlexuralModulus.

Answer:

matonto:Concentration a owl:Class;
dcterms:title 'Concentration';
dcterms:description 'In chemistry, concentration is the abundance of a constituent divided by the total volume of a mixture. Several types of mathematical description can be distinguished: mass concentration, molar concentration, number concentration, and volume concentration. The concentration can refer to any kind of chemical mixture, but most frequently refers to solutes and solvents in solutions. The molar (amount) concentration has variants, such as normal concentration and osmotic concentration. Dilution is reduction of concentration, e.g. by adding solvent to a solution. The verb to concentrate means to increase concentration, the opposite of dilute.'.

matonto:ChemicalSubstance a owl:Class;
dcterms:title 'chemical substance';
dcterms:description 'A chemical substance is a unique form of matter with constant chemical composition and characteristic properties. Chemical substances may take the form of a single element or chemical compounds. If two or more chemical substances can be combined without reacting, they may form a chemical mixture. If a mixture is separated to isolate one chemical substance to a desired degree, the resulting substance is said to be chemically pure.';
rdfs:subClassOf matonto:Concentration.

