matonto:GaucheConformation a owl:Class;
dcterms:title 'gauche conformation';
dcterms:description 'In chemistry, rotamers are chemical species that differ from one another primarily due to rotations about one or more single bonds. Various arrangements of atoms in a molecule that differ by rotation about single bonds can also be referred to as conformations. Conformers/rotamers differ little in their energies, so they are almost never separable in a practical sense. Rotations about single bonds are subject to small energy barriers. When the time scale for interconversion is long enough for isolation of individual rotamers, the species are termed atropisomers. The ring-flip of substituted cyclohexanes constitutes a common form of conformers.'.

matonto:PartitionCoefficient a owl:Class;
dcterms:title 'partition coefficient';
dcterms:description '
In the physical sciences, a partition coefficient (P) or distribution coefficient (D) is the ratio of concentrations of a compound in a mixture of two immiscible solvents at equilibrium. This ratio is therefore a comparison of the solubilities of the solute in these two liquids. The partition coefficient generally refers to the concentration ratio of un-ionized species of compound, whereas the distribution coefficient refers to the concentration ratio of all species of the compound.';
rdfs:subClassOf matonto:GaucheConformation.

