matonto:MagneticFlux a owl:Class;
dcterms:title 'magnetic flux';
dcterms:description 'In physics, specifically electromagnetism, the magnetic flux through a surface is the surface integral of the normal component of the magnetic field B over that surface. It is usually denoted Φ or ΦB. The SI unit of magnetic flux is the weber, and the CGS unit is the maxwell. Magnetic flux is usually measured with a fluxmeter, which contains measuring coils, and it calculates the magnetic flux from the change of voltage on the coils.'.

matonto:FractureToughness a owl:Class;
dcterms:title 'fracture toughness';
dcterms:description 'In materials science, fracture toughness is the critical stress intensity factor of a sharp crack where propagation of the crack suddenly becomes rapid and unlimited. It is a material property that quantifies its ability to resist crack propagation and failure under applied stress. A component’s thickness affects the constraint conditions at the tip of a crack with thin components having plane stress conditions, leading to ductile behavior and thick components having plane strain conditions, where the constraint increases, leading to brittle failure. Plane strain conditions give the lowest fracture toughness value which is a material property. The critical value of stress intensity factor in mode I loading measured under plane strain conditions is known as the plane strain fracture toughness, denoted . When a test fails to meet the thickness and other test requirements that are in place to ensure plane strain conditions, the fracture toughness value produced is given the designation .';
rdfs:subClassOf matonto:MagneticFlux.

Answer:

matonto:HelmholtzFreeEnergy a owl:Class;
dcterms:title 'Helmholtz free energy';
dcterms:description 'In thermodynamics, the Helmholtz free energy is a thermodynamic potential that measures the useful work obtainable from a closed thermodynamic system at a constant temperature (isothermal). The change in the Helmholtz energy during a process is equal to the maximum amount of work that the system can perform in a thermodynamic process in which temperature is held constant. At constant temperature, the Helmholtz free energy is minimized at equilibrium.'.

