dcterms:title 'bond';
dcterms:description ''.

matonto:DoubleBond a owl:Class;
dcterms:title 'double bond';
dcterms:description 'In chemistry, a double bond is a covalent bond between two atoms involving four bonding electrons as opposed to two in a single bond. Double bonds occur most commonly between two carbon atoms, for example in alkenes. Many double bonds exist between two different elements: for example, in a carbonyl group between a carbon atom and an oxygen atom. Other common double bonds are found in azo compounds (N=N), imines (C=N), and sulfoxides (S=O). In a skeletal formula, a double bond is drawn as two parallel lines (=) between the two connected atoms; typographically, the equals sign is used for this. Double bonds were introduced in chemical notation by Russian chemist Alexander Butlerov.';
rdfs:subClassOf matonto:Bond.

Answer:

matonto:PureSubstance a owl:Class;
dcterms:title 'pure substance';
dcterms:description 'A chemical substance is a unique form of matter with constant chemical composition and characteristic properties. Chemical substances may take the form of a single element or chemical compounds. If two or more chemical substances can be combined without reacting, they may form a chemical mixture. If a mixture is separated to isolate one chemical substance to a desired degree, the resulting substance is said to be chemically pure.'.

matonto:Length a owl:Class;
dcterms:title 'length';
dcterms:description 'Length is a measure of distance. In the International System of Quantities, length is a quantity with dimension distance. In most systems of measurement a base unit for length is chosen, from which all other units are derived. In the International System of Units (SI) system, the base unit for length is the metre.';
rdfs:subClassOf matonto:PureSubstance.

Answer:

matonto:ElectricCurrentDensity a owl:Class;
dcterms:title 'electric current density';
dcterms:description 'In electromagnetism, current density is the amount of charge per unit time that flows through a unit area of a chosen cross section. The current density vector is defined as a vector whose magnitude is the electric current per cross-sectional area at a given point in space, its direction being that of the motion of the positive charges at this point. In SI base units, the electric current density is measured in amperes per square metre.'.

matonto:Lithium a owl:Class;
dcterms:title 'Lithium';
dcterms:description 'Lithium is a chemical element; it has symbol Li and atomic number 3. It is a soft, silvery-white alkali metal. Under standard conditions, it is the least dense metal and the least dense solid element. Like all alkali metals, lithium is highly reactive and flammable, and must be stored in vacuum, inert atmosphere, or inert liquid such as purified kerosene or mineral oil. It exhibits a metallic luster. It corrodes quickly in air to a dull silvery gray, then black tarnish. It does not occur freely in nature, but occurs mainly as pegmatitic minerals, which were once the main source of lithium. Due to its solubility as an ion, it is present in ocean water and is commonly obtained from brines. Lithium metal is isolated electrolytically from a mixture of lithium chloride and potassium chloride.';
rdfs:subClassOf matonto:ElectricCurrentDensity.

Answer:

matonto:MagneticFlux a owl:Class;
dcterms:title 'magnetic flux';
dcterms:description 'In physics, specifically electromagnetism, the magnetic flux through a surface is the surface integral of the normal component of the magnetic field B over that surface. It is usually denoted Φ or ΦB. The SI unit of magnetic flux is the weber, and the CGS unit is the maxwell. Magnetic flux is usually measured with a fluxmeter, which contains measuring coils, and it calculates the magnetic flux from the change of voltage on the coils.'.

matonto:EnergyUnit a owl:Class;
dcterms:title 'energy unit';
dcterms:description '';
rdfs:subClassOf matonto:MagneticFlux.

Answer:

matonto:Atom a owl:Class;
dcterms:title 'atom';
dcterms:description 'Atoms are the basic particles of the chemical elements. An atom consists of a nucleus of protons and generally neutrons, surrounded by an electromagnetically bound swarm of electrons. The chemical elements are distinguished from each other by the number of protons that are in their atoms. For example, any atom that contains 11 protons is sodium, and any atom that contains 29 protons is copper. Atoms with the same number of protons but a different number of neutrons are called isotopes of the same element.'.

