matonto:Period5Element a owl:Class;
dcterms:title 'period 5 element';
dcterms:description 'A period 5 element is one of the chemical elements in the fifth row of the periodic table of the chemical elements. The periodic table is laid out in rows to illustrate recurring (periodic) trends in the chemical behaviour of the elements as their atomic number increases: a new row is begun when chemical behaviour begins to repeat, meaning that elements with similar behaviour fall into the same vertical columns. The fifth period contains 18 elements, beginning with rubidium and ending with xenon. As a rule, period 5 elements fill their 5s shells first, then their 4d, and 5p shells, in that order; however, there are exceptions, such as rhodium.'.

matonto:FlexuralModulus a owl:Class;
dcterms:title 'flexural modulus';
dcterms:description 'In mechanics, the flexural modulus, bending modulus, or modulus of rigidity is an intensive property that is computed as the ratio of stress to strain in flexural deformation, or the tendency for a material to resist bending. It is determined from the slope of a stress-strain curve produced by a flexural test, and uses units of force per area. The flexural modulus defined using the 2-point (cantilever) and 3-point bend tests assumes a linear stress strain response.';
rdfs:subClassOf matonto:Period5Element.

Answer:

matonto:MolecularMass a owl:Class;
dcterms:title 'molecular mass';
dcterms:description 'The molecular mass is the mass of a given molecule. Units of daltons (Da) are often used. Different molecules of the same compound may have different molecular masses because they contain different isotopes of an element. The derived quantity relative molecular mass is the unitless ratio of the mass of a molecule to the atomic mass constant.'.

matonto:CatalyzedReaction a owl:Class;
dcterms:title 'catalyzed reaction';
dcterms:description '';
rdfs:subClassOf matonto:MolecularMass.

Answer:

matonto:MolarMass a owl:Class;
dcterms:title 'molar mass';
dcterms:description 'In chemistry, the molar mass of a chemical substance is defined as the ratio between the mass and the amount of substance of any sample of the substance: . The molar mass is a bulk, not molecular, property of a substance. The molar mass is an average of many instances of the element or compound, which often vary in mass due to the presence of isotopes. Most commonly, the molar mass is computed from the standard atomic weights and is thus a terrestrial average and a function of the relative abundance of the isotopes of the constituent atoms on Earth.'.

matonto:InorganicReaction a owl:Class;
dcterms:title 'inorganic reaction';
dcterms:description 'A chemical reaction is a process that leads to the chemical transformation of one set of chemical substances to another. When chemical reactions occur, the atoms are rearranged and the reaction is accompanied by an energy change as new products are generated. Classically, chemical reactions encompass changes that only involve the positions of electrons in the forming and breaking of chemical bonds between atoms, with no change to the nuclei, and can often be described by a chemical equation. Nuclear chemistry is a sub-discipline of chemistry that involves the chemical reactions of unstable and radioactive elements where both electronic and nuclear changes can occur.';
rdfs:subClassOf matonto:MolarMass.

Answer:

matonto:MeltingPoint a owl:Class;
dcterms:title 'Melting Point';
dcterms:description 'The melting point of a substance is the temperature at which it changes state from solid to liquid. At the melting point the solid and liquid phase exist in equilibrium. The melting point of a substance depends on pressure and is usually specified at a standard pressure such as 1 atmosphere or 100 kPa.'.

matonto:OrganicCompound a owl:Class;
dcterms:title 'organic compound';
dcterms:description 'Some chemical authorities define an organic compound as a chemical compound that contains a carbon–hydrogen or carbon–carbon bond; others consider an organic compound to be any chemical compound that contains carbon. For example, carbon-containing compounds such as alkanes and its derivatives are universally considered organic, but many others are sometimes considered inorganic, such as certain compounds of carbon with nitrogen and oxygen.';
rdfs:subClassOf matonto:MeltingPoint.

Answer:

