dcterms:title 'Ununnilium';
dcterms:description 'Darmstadtium is a synthetic chemical element; it has symbol Ds and atomic number 110. It is extremely radioactive: the most stable known isotope, darmstadtium-281, has a half-life of approximately 14 seconds. Darmstadtium was first created in November 1994 by the GSI Helmholtz Centre for Heavy Ion Research in the city of Darmstadt, Germany, after which it was named.'.

matonto:Diastereomer a owl:Class;
dcterms:title 'diastereomer';
dcterms:description 'In stereochemistry, diastereomers are a type of stereoisomer. Diastereomers are defined as non-mirror image, non-identical stereoisomers. Hence, they occur when two or more stereoisomers of a compound have different configurations at one or more of the equivalent (related) stereocenters and are not mirror images of each other. 
When two diastereoisomers differ from each other at only one stereocenter, they are epimers. Each stereocenter gives rise to two different configurations and thus typically increases the number of stereoisomers by a factor of two.';
rdfs:subClassOf matonto:Ununnilium.

Answer:

matonto:AlkaliMetal a owl:Class;
dcterms:title 'alkali metal';
dcterms:description 'The alkali metals consist of the chemical elements lithium (Li), sodium (Na), potassium (K), rubidium (Rb), caesium (Cs), and francium (Fr). Together with hydrogen they constitute group 1, which lies in the s-block of the periodic table. All alkali metals have their outermost electron in an s-orbital: this shared electron configuration results in their having very similar characteristic properties. Indeed, the alkali metals provide the best example of group trends in properties in the periodic table, with elements exhibiting well-characterised homologous behaviour. This family of elements is also known as the lithium family after its leading element.'.

matonto:FlexuralModulus a owl:Class;
dcterms:title 'flexural modulus';
dcterms:description 'In mechanics, the flexural modulus, bending modulus, or modulus of rigidity is an intensive property that is computed as the ratio of stress to strain in flexural deformation, or the tendency for a material to resist bending. It is determined from the slope of a stress-strain curve produced by a flexural test, and uses units of force per area. The flexural modulus defined using the 2-point (cantilever) and 3-point bend tests assumes a linear stress strain response.';
rdfs:subClassOf matonto:AlkaliMetal.

Answer:

matonto:WeibullModulus a owl:Class;
dcterms:title 'weibull modulus';
dcterms:description 'The Weibull modulus is a dimensionless parameter of the Weibull distribution. It represents the width of a probability density function (PDF) in which a higher modulus is a characteristic of a narrower distribution of values. Use case examples include biological and brittle material failure analysis, where modulus is used to describe the variability of failure strength for materials.'.

matonto:Group7Element a owl:Class;
dcterms:title 'group 7 element';
dcterms:description 'Group 7, numbered by IUPAC nomenclature, is a group of elements in the periodic table. It contains manganese (Mn), technetium (Tc), rhenium (Re) and bohrium (Bh). This group lies in the d-block of the periodic table, and are hence transition metals. This group is sometimes called the manganese group or manganese family after its lightest member; however, the group itself has not acquired a trivial name because it belongs to the broader grouping of the transition metals.';
