matonto:Homocyclic a owl:Class;
dcterms:title 'homocyclic';
dcterms:description 'In chemistry, a ring is an ambiguous term referring either to a simple cycle of atoms and bonds in a molecule or to a connected set of atoms and bonds in which every atom and bond is a member of a cycle. A ring system that is a simple cycle is called a monocycle or simple ring, and one that is not a simple cycle is called a polycycle or polycyclic ring system. A simple ring contains the same number of sigma bonds as atoms, and a polycyclic ring system contains more sigma bonds than atoms.'.

matonto:Imine a owl:Class;
dcterms:title 'imine';
dcterms:description 'In organic chemistry, an imine is a functional group or organic compound containing a carbon–nitrogen double bond. The nitrogen atom can be attached to a hydrogen or an organic group (R). The carbon atom has two additional single bonds. Imines are common in synthetic and naturally occurring compounds and they participate in many reactions.';
rdfs:subClassOf matonto:Homocyclic.

Answer:

matonto:CovalentBond a owl:Class;
dcterms:title 'covalent bond';
dcterms:description 'A covalent bond is a chemical bond that involves the sharing of electrons to form electron pairs between atoms. These electron pairs are known as shared pairs or bonding pairs. The stable balance of attractive and repulsive forces between atoms, when they share electrons, is known as covalent bonding. For many molecules, the sharing of electrons allows each atom to attain the equivalent of a full valence shell, corresponding to a stable electronic configuration. In organic chemistry, covalent bonding is much more common than ionic bonding.'.

matonto:SurfaceTension a owl:Class;
dcterms:title 'surface tension';
dcterms:description 'Surface tension is the tendency of liquid surfaces at rest to shrink into the minimum surface area possible. Surface tension is what allows objects with a higher density than water such as razor blades and insects to float on a water surface without becoming even partly submerged.';
rdfs:subClassOf matonto:CovalentBond.

