dcterms:title 'density';
dcterms:description 'Density is the ratio of a substance’s mass to its volume. The symbol most often used for density is ρ, although the Latin letter D can also be used: 

where ρ is the density, m is the mass, and V is the volume. In some cases, density is loosely defined as its weight per unit volume, although this is scientifically inaccurate – this quantity is more specifically called specific weight.'.

matonto:Halogen a owl:Class;
dcterms:title 'halogen';
dcterms:description 'The halogens are a group in the periodic table consisting of six chemically related elements: fluorine (F), chlorine (Cl), bromine (Br), iodine (I), and the radioactive elements astatine (At) and tennessine (Ts), though some authors would exclude tennessine as its chemistry is unknown and is theoretically expected to be more like that of gallium. In the modern IUPAC nomenclature, this group is known as group 17.';
