matonto:Magnesium a owl:Class;
dcterms:title 'Magnesium';
dcterms:description 'Magnesium is a chemical element; it has symbol Mg and atomic number 12. It is a shiny gray metal having a low density, low melting point and high chemical reactivity. Like the other alkaline earth metals, it occurs naturally only in combination with other elements and almost always has an oxidation state of +2. It reacts readily with air to form a thin passivation coating of magnesium oxide that inhibits further corrosion of the metal. The free metal burns with a brilliant-white light. The metal is obtained mainly by electrolysis of magnesium salts obtained from brine. It is less dense than aluminium and is used primarily as a component in strong and lightweight alloys that contain aluminium.';
rdfs:subClassOf matonto:Element.

Answer:

matonto:Chaoite a owl:Class;
dcterms:title 'chaoite';
dcterms:description 'Chaoite, or white carbon, is a mineral described as an allotrope of carbon whose existence is disputed. It was discovered in shock-fused graphite gneiss from the Ries crater in Bavaria. It has been described as slightly harder than graphite, with a reflection colour of grey to white. From its electron diffraction pattern, the mineral has been considered to have a carbyne structure, the linear acetylenic carbon allotrope of carbon. A later report has called this identification, and the very existence of carbyne phases, into question, arguing that the new reflections in the diffraction pattern are due to clay impurities.'.

matonto:Isomerization a owl:Class;
dcterms:title 'isomerization';
dcterms:description 'In chemistry, isomerization or isomerisation is the process in which a molecule, polyatomic ion or molecular fragment is transformed into an isomer with a different chemical structure. Enolization is an example of isomerization, as is tautomerization.';
rdfs:subClassOf matonto:Chaoite.

