matonto:Magnesium a owl:Class;
dcterms:title 'Magnesium';
dcterms:description 'Magnesium is a chemical element; it has symbol Mg and atomic number 12. It is a shiny gray metal having a low density, low melting point and high chemical reactivity. Like the other alkaline earth metals, it occurs naturally only in combination with other elements and almost always has an oxidation state of +2. It reacts readily with air to form a thin passivation coating of magnesium oxide that inhibits further corrosion of the metal. The free metal burns with a brilliant-white light. The metal is obtained mainly by electrolysis of magnesium salts obtained from brine. It is less dense than aluminium and is used primarily as a component in strong and lightweight alloys that contain aluminium.'.

matonto:Group1Element a owl:Class;
dcterms:title 'group 1 element';
dcterms:description 'The alkali metals consist of the chemical elements lithium (Li), sodium (Na), potassium (K), rubidium (Rb), caesium (Cs), and francium (Fr). Together with hydrogen they constitute group 1, which lies in the s-block of the periodic table. All alkali metals have their outermost electron in an s-orbital: this shared electron configuration results in their having very similar characteristic properties. Indeed, the alkali metals provide the best example of group trends in properties in the periodic table, with elements exhibiting well-characterised homologous behaviour. This family of elements is also known as the lithium family after its leading element.';
rdfs:subClassOf matonto:Magnesium.

Answer:

matonto:Period7Element a owl:Class;
dcterms:title 'period 7 element';
dcterms:description 'A period 7 element is one of the chemical elements in the seventh row of the periodic table of the chemical elements. The periodic table is laid out in rows to illustrate recurring (periodic) trends in the chemical behavior of the elements as their atomic number increases: a new row is begun when chemical behavior begins to repeat, meaning that elements with similar behavior fall into the same vertical columns. The seventh period contains 32 elements, tied for the most with period 6, beginning with francium and ending with oganesson, the heaviest element currently discovered. As a rule, period 7 elements fill their 7s shells first, then their 5f, 6d, and 7p shells in that order, but there are exceptions, such as uranium.'.

matonto:TrigonalPyramidalMolecularGeometry a owl:Class;
dcterms:title 'trigonal pyramidal molecular geometry';
dcterms:description 'In chemistry, a trigonal pyramid is a molecular geometry with one atom at the apex and three atoms at the corners of a trigonal base, resembling a tetrahedron (not to be confused with the tetrahedral geometry). When all three atoms at the corners are identical, the molecule belongs to point group C3v. Some molecules and ions with trigonal pyramidal geometry are the pnictogen hydrides (XH3), xenon trioxide (XeO3), the chlorate ion, ClO−3, and the sulfite ion, SO2−3. In organic chemistry, molecules which have a trigonal pyramidal geometry are sometimes described as sp3 hybridized. The AXE method for VSEPR theory states that the classification is AX3E1.';
rdfs:subClassOf matonto:Period7Element.

Answer:

matonto:Group11Element a owl:Class;
dcterms:title 'group 11 element';
dcterms:description 'Group 11, by modern IUPAC numbering, is a group of chemical elements in the periodic table, consisting of copper (Cu), silver (Ag), gold (Au), and roentgenium (Rg), although no chemical experiments have yet been carried out to confirm that roentgenium behaves like the heavier homologue to gold. Group 11, more specifically, the first three members are also known as the coinage metals, due to their usage in minting coins—while the rise in metal prices mean that silver and gold are no longer used for circulating currency, remaining in use for bullion, copper remains a common metal in coins to date, either in the form of copper clad coinage or as part of the cupronickel alloy. They were most likely the first three elements discovered. Copper, silver, and gold all occur naturally in elemental form.'.

matonto:Period2Element a owl:Class;
dcterms:title 'period 2 element';
dcterms:description 'A period 2 element is one of the chemical elements in the second row of the periodic table of the chemical elements. The periodic table is laid out in rows to illustrate recurring (periodic) trends in the chemical behavior of the elements as their atomic number increases; a new row is started when chemical behavior begins to repeat, creating columns of elements with similar properties.';
rdfs:subClassOf matonto:Group11Element.

