matonto:PartitionCoefficient a owl:Class;
dcterms:title 'partition coefficient';
dcterms:description '
In the physical sciences, a partition coefficient (P) or distribution coefficient (D) is the ratio of concentrations of a compound in a mixture of two immiscible solvents at equilibrium. This ratio is therefore a comparison of the solubilities of the solute in these two liquids. The partition coefficient generally refers to the concentration ratio of un-ionized species of compound, whereas the distribution coefficient refers to the concentration ratio of all species of the compound.'.

matonto:Tin a owl:Class;
dcterms:title 'Tin';
dcterms:description 'Tin is a chemical element; it has symbol Sn and atomic number 50. A silvery-colored metal, tin is soft enough to be cut with little force, and a bar of tin can be bent by hand with little effort. When bent, the so-called "tin cry" can be heard as a result of twinning in tin crystals.';
rdfs:subClassOf matonto:PartitionCoefficient.

Answer:

matonto:Group11Element a owl:Class;
dcterms:title 'group 11 element';
dcterms:description 'Group 11, by modern IUPAC numbering, is a group of chemical elements in the periodic table, consisting of copper (Cu), silver (Ag), gold (Au), and roentgenium (Rg), although no chemical experiments have yet been carried out to confirm that roentgenium behaves like the heavier homologue to gold. Group 11, more specifically, the first three members are also known as the coinage metals, due to their usage in minting coins—while the rise in metal prices mean that silver and gold are no longer used for circulating currency, remaining in use for bullion, copper remains a common metal in coins to date, either in the form of copper clad coinage or as part of the cupronickel alloy. They were most likely the first three elements discovered. Copper, silver, and gold all occur naturally in elemental form.'.

