matonto:Energy a owl:Class;
dcterms:title 'energy';
dcterms:description 'Energy is the quantitative property that is transferred to a body or to a physical system, recognizable in the performance of work and in the form of heat and light. Energy is a conserved quantity—the law of conservation of energy states that energy can be converted in form, but not created or destroyed. The unit of measurement for energy in the International System of Units (SI) is the joule (J).'.

matonto:InternalEnergy a owl:Class;
dcterms:title 'internal energy';
dcterms:description 'The internal energy of a thermodynamic system is the energy of the system as a state function, measured as the quantity of energy necessary to bring the system from its standard internal state to its present internal state of interest, accounting for the gains and losses of energy due to changes in its internal state, including such quantities as magnetization. It excludes the kinetic energy of motion of the system as a whole and the potential energy of position of the system as a whole, with respect to its surroundings and external force fields. It includes the thermal energy, i.e., the constituent particles’ kinetic energies of motion relative to the motion of the system as a whole. Without a thermodynamic process, the internal energy of an isolated system cannot change, as expressed in the law of conservation of energy, a foundation of the first law of thermodynamics. The notion has been introduced to describe the systems characterized by temperature variations, temperature being added to the set of state parameters, the position variables known in mechanics, in a similar way to potential energy of the conservative fields of force, gravitational and electrostatic. Its author is Rudolf Clausius. Without transfer of matter, internal energy changes equal the algebraic sum of the heat transferred and the work done. In systems without temperature changes, internal energy changes equal the work done by/on the system.';
rdfs:subClassOf matonto:Energy.

Answer:

matonto:Continuant a owl:Class;
dcterms:title 'continuant';
dcterms:description 'In phonetics, a continuant is a speech sound produced without a complete closure in the oral cavity. By one definition, continuant is a distinctive feature that refers to any sound produced with an incomplete closure of the vocal tract, thus encompassing all sounds except nasals, plosives and affricates.
By another definition, it refers exclusively to consonantal sounds produced with an incomplete closure of the oral cavity, prototypically approximants and fricatives, but sometimes also trills.'.

matonto:ChemicalSubstance a owl:Class;
dcterms:title 'chemical substance';
dcterms:description 'A chemical substance is a unique form of matter with constant chemical composition and characteristic properties. Chemical substances may take the form of a single element or chemical compounds. If two or more chemical substances can be combined without reacting, they may form a chemical mixture. If a mixture is separated to isolate one chemical substance to a desired degree, the resulting substance is said to be chemically pure.';
rdfs:subClassOf matonto:Continuant.

Answer:

matonto:AbsorbedDoseRate a owl:Class;
dcterms:title 'absorbed dose rate';
dcterms:description 'Absorbed dose is a dose quantity which represents the specific energy deposited by ionizing radiation in living matter. Absorbed dose is used in the calculation of dose uptake in living tissue in both radiation protection, and radiology. It is also used to directly compare the effect of radiation on inanimate matter such as in radiation hardening.'.

