matonto:Osmium a owl:Class;
dcterms:title 'Osmium';
dcterms:description 'Osmium is a chemical element; it has symbol Os and atomic number 76. It is a hard, brittle, bluish-white transition metal in the platinum group that is found as a trace element in alloys, mostly in platinum ores. Osmium is the densest naturally occurring element. When experimentally measured using X-ray crystallography, it has a density of 22.59 g/cm3. Manufacturers use its alloys with platinum, iridium, and other platinum-group metals to make fountain pen nib tipping, electrical contacts, and in other applications that require extreme durability and hardness.'.

matonto:FractureToughness a owl:Class;
dcterms:title 'fracture toughness';
dcterms:description 'In materials science, fracture toughness is the critical stress intensity factor of a sharp crack where propagation of the crack suddenly becomes rapid and unlimited. It is a material property that quantifies its ability to resist crack propagation and failure under applied stress. A component’s thickness affects the constraint conditions at the tip of a crack with thin components having plane stress conditions, leading to ductile behavior and thick components having plane strain conditions, where the constraint increases, leading to brittle failure. Plane strain conditions give the lowest fracture toughness value which is a material property. The critical value of stress intensity factor in mode I loading measured under plane strain conditions is known as the plane strain fracture toughness, denoted . When a test fails to meet the thickness and other test requirements that are in place to ensure plane strain conditions, the fracture toughness value produced is given the designation .';
rdfs:subClassOf matonto:Osmium.

Answer:

