matonto:Energy a owl:Class;
dcterms:title 'energy';
dcterms:description 'Energy is the quantitative property that is transferred to a body or to a physical system, recognizable in the performance of work and in the form of heat and light. Energy is a conserved quantity—the law of conservation of energy states that energy can be converted in form, but not created or destroyed. The unit of measurement for energy in the International System of Units (SI) is the joule (J).'.

matonto:Phosphorus a owl:Class;
dcterms:title 'Phosphorus';
dcterms:description 'Phosphorus is a chemical element; it has symbol P and atomic number 15. All elemental forms of phosphorus are highly reactive and are therefore never found in nature. They can nevertheless be prepared artificially, the two most common allotropes being white phosphorus and red phosphorus. With 31P as its only stable isotope, phosphorus has an occurrence in Earth’s crust of about 0.1%, generally as phosphate rock. A member of the pnictogen family, phosphorus readily forms a wide variety of organic and inorganic compounds, with as its main oxidation states +5, +3 and −3.';
rdfs:subClassOf matonto:Energy.

Answer:

matonto:Promethium a owl:Class;
dcterms:title 'Promethium';
dcterms:description 'Promethium is a chemical element; it has symbol Pm and atomic number 61. All of its isotopes are radioactive; it is extremely rare, with only about 500–600 grams naturally occurring in the Earth’s crust at any given time. Promethium is one of the only two radioactive elements that are both preceded and followed in the periodic table by elements with stable forms, the other being technetium. Chemically, promethium is a lanthanide. Promethium shows only one stable oxidation state of +3.'.

matonto:GroupElement a owl:Class;
dcterms:title 'group element';
dcterms:description 'Group 3 is the first group of transition metals in the periodic table. This group is closely related to the rare-earth elements. It contains the four elements scandium (Sc), yttrium (Y), lutetium (Lu), and lawrencium (Lr). The group is also called the scandium group or scandium family after its lightest member.';
rdfs:subClassOf matonto:Promethium.

Answer:

matonto:Molality a owl:Class;
dcterms:title 'molality';
dcterms:description 'In chemistry, molality is a measure of the amount of solute in a solution relative to a given mass of solvent. This contrasts with the definition of molarity which is based on a given volume of solution.'.

matonto:Permittivity a owl:Class;
dcterms:title 'permittivity';
dcterms:description 'In electromagnetism, the absolute permittivity, often simply called permittivity and denoted by the Greek letter ε (epsilon), is a measure of the electric polarizability of a dielectric material. A material with high permittivity polarizes more in response to an applied electric field than a material with low permittivity, thereby storing more energy in the material. In electrostatics, the permittivity plays an important role in determining the capacitance of a capacitor.';
rdfs:subClassOf matonto:Molality.

Answer:

matonto:Aromaticity a owl:Class;
dcterms:title 'aromaticity';
dcterms:description 'In organic chemistry, aromaticity is a chemical property describing the way in which a conjugated ring of unsaturated bonds, lone pairs, or empty orbitals exhibits a stabilization stronger than would be expected from conjugation alone. The earliest use of the term was in an article by August Wilhelm Hofmann in 1855. There is no general relationship between aromaticity as a chemical property and the olfactory properties of such compounds.'.

