matonto:Sodium a owl:Class;
dcterms:title 'Sodium';
dcterms:description 'Sodium is a chemical element; it has symbol Na and atomic number 11. It is a soft, silvery-white, highly reactive metal. Sodium is an alkali metal, being in group 1 of the periodic table. Its only stable isotope is 23Na. The free metal does not occur in nature and must be prepared from compounds. Sodium is the sixth most abundant element in the Earth’s crust and exists in numerous minerals such as feldspars, sodalite, and halite (NaCl). Many salts of sodium are highly water-soluble: sodium ions have been leached by the action of water from the Earth’s minerals over eons, and thus sodium and chlorine are the most common dissolved elements by weight in the oceans.'.

matonto:NobleGas a owl:Class;
dcterms:title 'noble gas';
dcterms:description 'The noble gases are the members of group 18 of the periodic table: helium (He), neon (Ne), argon (Ar), krypton (Kr), xenon (Xe), radon (Rn) and, in some cases, oganesson (Og). Under standard conditions, the first six of these elements are odorless, colorless, monatomic gases with very low chemical reactivity and cryogenic boiling points. The properties of oganesson are uncertain.';
rdfs:subClassOf matonto:Sodium.

Answer:

matonto:CarbonAllotrope a owl:Class;
dcterms:title 'carbon allotrope';
dcterms:description 'Carbon is capable of forming many allotropes due to its valency (tetravalent). Well-known forms of carbon include diamond and graphite. In recent decades, many more allotropes have been discovered and researched, including ball shapes such as buckminsterfullerene and sheets such as graphene. Larger-scale structures of carbon include nanotubes, nanobuds and nanoribbons. Other unusual forms of carbon exist at very high temperatures or extreme pressures. Around 500 hypothetical 3‑periodic allotropes of carbon are known at the present time, according to the Samara Carbon Allotrope Database (SACADA).'.

matonto:Chalcogen a owl:Class;
dcterms:title 'chalcogen';
dcterms:description 'The chalcogens are the chemical elements in group 16 of the periodic table. This group is also known as the oxygen family. Group 16 consists of the elements oxygen (O), sulfur (S), selenium (Se), tellurium (Te), and the radioactive elements polonium (Po) and livermorium (Lv). Often, oxygen is treated separately from the other chalcogens, sometimes even excluded from the scope of the term "chalcogen" altogether, due to its very different chemical behavior from sulfur, selenium, tellurium, and polonium. The word "chalcogen" is derived from a combination of the Greek word khalkos (χαλκός) principally meaning copper, and the Latinized Greek word genēs, meaning born or produced.';
rdfs:subClassOf matonto:CarbonAllotrope.

