matonto:Selenium a owl:Class;
dcterms:title 'Selenium';
dcterms:description 'Selenium is a chemical element; it has symbol Se and atomic number 34. It has various physical appearances, including a brick-red powder, a vitreous black solid, and a grey metallic-looking form. It seldom occurs in this elemental state or as pure ore compounds in Earth’s crust. Selenium was discovered in 1817 by Jöns Jacob Berzelius, who noted the similarity of the new element to the previously discovered tellurium.';
rdfs:subClassOf matonto:Element.

