matonto:Aromaticity a owl:Class;
dcterms:title 'aromaticity';
dcterms:description 'In organic chemistry, aromaticity is a chemical property describing the way in which a conjugated ring of unsaturated bonds, lone pairs, or empty orbitals exhibits a stabilization stronger than would be expected from conjugation alone. The earliest use of the term was in an article by August Wilhelm Hofmann in 1855. There is no general relationship between aromaticity as a chemical property and the olfactory properties of such compounds.'.

matonto:FreeRadicalAddition a owl:Class;
dcterms:title 'free radical addition';
dcterms:description 'In organic chemistry, free-radical addition is an addition reaction which involves free radicals. These reactions can happen due to the free radicals having an unpaired electron in their valence shell, making them highly reactive. Radical additions are known for a variety of unsaturated substrates, both olefinic or aromatic and with or without heteroatoms.';
rdfs:subClassOf matonto:Aromaticity.

Answer:

matonto:Ph a owl:Class;
dcterms:title 'pH';
dcterms:description 'In chemistry, pH, also referred to as acidity or basicity, historically denotes "potential of hydrogen". It is a logarithmic scale used to specify the acidity or basicity of aqueous solutions. Acidic solutions are measured to have lower pH values than basic or alkaline solutions.'.

matonto:SingleDisplacementReaction a owl:Class;
dcterms:title 'single displacement reaction';
dcterms:description 'A single-displacement reaction, also known as single replacement reaction or exchange reaction, is an archaic concept in chemistry. It describes the stoichiometry of some chemical reactions in which one element or ligand is replaced by an atom or group.';
rdfs:subClassOf matonto:Ph.

