matonto:Continuant a owl:Class;
dcterms:title 'continuant';
dcterms:description 'In phonetics, a continuant is a speech sound produced without a complete closure in the oral cavity. By one definition, continuant is a distinctive feature that refers to any sound produced with an incomplete closure of the vocal tract, thus encompassing all sounds except nasals, plosives and affricates.
By another definition, it refers exclusively to consonantal sounds produced with an incomplete closure of the oral cavity, prototypically approximants and fricatives, but sometimes also trills.'.

