matonto:OrganicCompound a owl:Class;
dcterms:title 'organic compound';
dcterms:description 'Some chemical authorities define an organic compound as a chemical compound that contains a carbon–hydrogen or carbon–carbon bond; others consider an organic compound to be any chemical compound that contains carbon. For example, carbon-containing compounds such as alkanes and its derivatives are universally considered organic, but many others are sometimes considered inorganic, such as certain compounds of carbon with nitrogen and oxygen.'.

matonto:CarbonylCompound a owl:Class;
dcterms:title 'carbonyl compound';
dcterms:description 'In organic chemistry, a carbonyl group is a functional group with the formula C=O, composed of a carbon atom double-bonded to an oxygen atom, and it is divalent at the C atom. It is common to several classes of organic compounds, as part of many larger functional groups. A compound containing a carbonyl group is often referred to as a carbonyl compound.';
rdfs:subClassOf matonto:OrganicCompound.

