matonto:Radon a owl:Class;
dcterms:title 'Radon';
dcterms:description 'Radon is a chemical element; it has symbol Rn and atomic number 86. It is a radioactive noble gas and is colorless and odorless. Of the three naturally occurring radon isotopes, only 222Rn has a sufficiently long half-life for it to be released from the soil and rock where it is generated. Radon isotopes are the immediate decay products of radium isotopes. The instability of 222Rn, its most stable isotope, makes radon one of the rarest elements. Radon will be present on Earth for several billion more years despite its short half-life, because it is constantly being produced as a step in the decay chains of 238U and 232Th, both of which are abundant radioactive nuclides with half-lives of at least several billion years. The decay of radon produces many other short-lived nuclides, known as "radon daughters", ending at stable isotopes of lead. 222Rn occurs in significant quantities as a step in the normal radioactive decay chain of 238U, also known as the uranium series, which slowly decays into a variety of radioactive nuclides and eventually decays into stable 206Pb. 220Rn occurs in minute quantities as an intermediate step in the decay chain of 232Th, also known as the thorium series, which eventually decays into stable 208Pb.';
rdfs:subClassOf matonto:Element.

Answer:

matonto:IonicBond a owl:Class;
dcterms:title 'ionic bond';
dcterms:description 'Ionic bonding is a type of chemical bonding that involves the electrostatic attraction between oppositely charged ions, or between two atoms with sharply different electronegativities, and is the primary interaction occurring in ionic compounds. It is one of the main types of bonding, along with covalent bonding and metallic bonding. Ions are atoms with an electrostatic charge. Atoms that gain electrons make negatively charged ions. Atoms that lose electrons make positively charged ions. This transfer of electrons is known as electrovalence in contrast to covalence. In the simplest case, the cation is a metal atom and the anion is a nonmetal atom, but these ions can be more complex, e.g. polyatomic ions like NH+4 or SO2−4. In simpler words, an ionic bond results from the transfer of electrons from a metal to a non-metal to obtain a full valence shell for both atoms.'.

matonto:CatalyticActivity a owl:Class;
dcterms:title 'catalytic activity';
dcterms:description 'Catalysis is the increase in rate of a chemical reaction due to an added substance known as a catalyst. Catalysts are not consumed by the reaction and remain unchanged after it. If the reaction is rapid and the catalyst recycles quickly, very small amounts of catalyst often suffice; mixing, surface area, and temperature are important factors in reaction rate. Catalysts generally react with one or more reactants to form intermediates that subsequently give the final reaction product, in the process of regenerating the catalyst.';
rdfs:subClassOf matonto:IonicBond.

Answer:

matonto:AngularAcceleration a owl:Class;
dcterms:title 'angular acceleration';
dcterms:description 'In physics, angular acceleration is the time rate of change of angular velocity. Following the two types of angular velocity, spin angular velocity and orbital angular velocity, the respective types of angular acceleration are: spin angular acceleration, involving a rigid body about an axis of rotation intersecting the body’s centroid; and orbital angular acceleration, involving a point particle and an external axis.'.

matonto:MetalComplex a owl:Class;
dcterms:title 'metal complex';
dcterms:description 'A coordination complex is a chemical compound consisting of a central atom or ion, which is usually metallic and is called the coordination centre, and a surrounding array of bound molecules or ions, that are in turn known as ligands or complexing agents. Many metal-containing compounds, especially those that include transition metals, are coordination complexes.';
rdfs:subClassOf matonto:AngularAcceleration.

Answer:

matonto:SolidPhase a owl:Class;
dcterms:title 'solid phase';
dcterms:description 'In the physical sciences, a phase is a region of material that is chemically uniform, physically distinct, and (often) mechanically separable. In a system consisting of ice and water in a glass jar, the ice cubes are one phase, the water is a second phase, and the humid air is a third phase over the ice and water. The glass of the jar is a different material, in its own separate phase.'.

