matonto:Germanium a owl:Class;
dcterms:title 'Germanium';
dcterms:description 'Germanium is a chemical element; it has symbol Ge and atomic number 32. It is lustrous, hard-brittle, grayish-white and similar in appearance to silicon. It is a metalloid or a nonmetal in the carbon group that is chemically similar to silicon. Like silicon, germanium naturally reacts and forms complexes with oxygen in nature.'.

matonto:Sulfur a owl:Class;
dcterms:title 'Sulfur';
dcterms:description 'Sulfur (American spelling and the preferred IUPAC name) or sulphur (Commonwealth spelling) is a chemical element; it has symbol S and atomic number 16. It is abundant, multivalent and nonmetallic. Under normal conditions, sulfur atoms form cyclic octatomic molecules with the chemical formula S8. Elemental sulfur is a bright yellow, crystalline solid at room temperature.';
