matonto:InternalEnergy a owl:Class;
dcterms:title 'internal energy';
dcterms:description 'The internal energy of a thermodynamic system is the energy of the system as a state function, measured as the quantity of energy necessary to bring the system from its standard internal state to its present internal state of interest, accounting for the gains and losses of energy due to changes in its internal state, including such quantities as magnetization. It excludes the kinetic energy of motion of the system as a whole and the potential energy of position of the system as a whole, with respect to its surroundings and external force fields. It includes the thermal energy, i.e., the constituent particles’ kinetic energies of motion relative to the motion of the system as a whole. Without a thermodynamic process, the internal energy of an isolated system cannot change, as expressed in the law of conservation of energy, a foundation of the first law of thermodynamics. The notion has been introduced to describe the systems characterized by temperature variations, temperature being added to the set of state parameters, the position variables known in mechanics, in a similar way to potential energy of the conservative fields of force, gravitational and electrostatic. Its author is Rudolf Clausius. Without transfer of matter, internal energy changes equal the algebraic sum of the heat transferred and the work done. In systems without temperature changes, internal energy changes equal the work done by/on the system.'.

matonto:Enthalpy a owl:Class;
dcterms:title 'enthalpy';
dcterms:description 'Enthalpy is the sum of a thermodynamic system’s internal energy and the product of its pressure and volume. It is a state function in thermodynamics used in many measurements in chemical, biological, and physical systems at a constant external pressure, which is conveniently provided by the large ambient atmosphere. The pressure–volume term expresses the work  that was done against constant external pressure  to establish the system’s physical dimensions from  to some final volume , i.e. to make room for it by displacing its surroundings.
The pressure-volume term is very small for solids and liquids at common conditions, and fairly small for gases. Therefore, enthalpy is a stand-in for energy in chemical systems; bond, lattice, solvation, and other chemical "energies" are actually enthalpy differences. As a state function, enthalpy depends only on the final configuration of internal energy, pressure, and volume, not on the path taken to achieve it.';
rdfs:subClassOf matonto:InternalEnergy.

Answer:

matonto:SpecificEnergy a owl:Class;
dcterms:title 'specific energy';
dcterms:description 'Specific energy or massic energy is energy per unit mass. It is also sometimes called gravimetric energy density, which is not to be confused with energy density, which is defined as energy per unit volume. It is used to quantify, for example, stored heat and other thermodynamic properties of substances such as specific internal energy, specific enthalpy, specific Gibbs free energy, and specific Helmholtz free energy. It may also be used for the kinetic energy or potential energy of a body. Specific energy is an intensive property, whereas energy and mass are extensive properties.'.

