matonto:ElectricResistance a owl:Class;
dcterms:title 'electric resistance';
dcterms:description 'The electrical resistance of an object is a measure of its opposition to the flow of electric current. Its reciprocal quantity is electrical conductance, measuring the ease with which an electric current passes. Electrical resistance shares some conceptual parallels with mechanical friction. The SI unit of electrical resistance is the ohm, while electrical conductance is measured in siemens (S).'.

matonto:Material a owl:Class;
dcterms:title 'material';
dcterms:description 'A material is a substance or mixture of substances that constitutes an object. Materials can be pure or impure, living or non-living matter. Materials can be classified on the basis of their physical and chemical properties, or on their geological origin or biological function. Materials science is the study of materials, their properties and their applications.';
rdfs:subClassOf matonto:ElectricResistance.

