matonto:FractureToughness a owl:Class;
dcterms:title 'fracture toughness';
dcterms:description 'In materials science, fracture toughness is the critical stress intensity factor of a sharp crack where propagation of the crack suddenly becomes rapid and unlimited. It is a material property that quantifies its ability to resist crack propagation and failure under applied stress. A component’s thickness affects the constraint conditions at the tip of a crack with thin components having plane stress conditions, leading to ductile behavior and thick components having plane strain conditions, where the constraint increases, leading to brittle failure. Plane strain conditions give the lowest fracture toughness value which is a material property. The critical value of stress intensity factor in mode I loading measured under plane strain conditions is known as the plane strain fracture toughness, denoted . When a test fails to meet the thickness and other test requirements that are in place to ensure plane strain conditions, the fracture toughness value produced is given the designation .'.

matonto:IonicBond a owl:Class;
dcterms:title 'ionic bond';
dcterms:description 'Ionic bonding is a type of chemical bonding that involves the electrostatic attraction between oppositely charged ions, or between two atoms with sharply different electronegativities, and is the primary interaction occurring in ionic compounds. It is one of the main types of bonding, along with covalent bonding and metallic bonding. Ions are atoms with an electrostatic charge. Atoms that gain electrons make negatively charged ions. Atoms that lose electrons make positively charged ions. This transfer of electrons is known as electrovalence in contrast to covalence. In the simplest case, the cation is a metal atom and the anion is a nonmetal atom, but these ions can be more complex, e.g. polyatomic ions like NH+4 or SO2−4. In simpler words, an ionic bond results from the transfer of electrons from a metal to a non-metal to obtain a full valence shell for both atoms.';
rdfs:subClassOf matonto:FractureToughness.

Answer:

matonto:Material a owl:Class;
dcterms:title 'material';
dcterms:description 'A material is a substance or mixture of substances that constitutes an object. Materials can be pure or impure, living or non-living matter. Materials can be classified on the basis of their physical and chemical properties, or on their geological origin or biological function. Materials science is the study of materials, their properties and their applications.'.

matonto:Enthalpy a owl:Class;
dcterms:title 'enthalpy';
dcterms:description 'Enthalpy is the sum of a thermodynamic system’s internal energy and the product of its pressure and volume. It is a state function in thermodynamics used in many measurements in chemical, biological, and physical systems at a constant external pressure, which is conveniently provided by the large ambient atmosphere. The pressure–volume term expresses the work  that was done against constant external pressure  to establish the system’s physical dimensions from  to some final volume , i.e. to make room for it by displacing its surroundings.
The pressure-volume term is very small for solids and liquids at common conditions, and fairly small for gases. Therefore, enthalpy is a stand-in for energy in chemical systems; bond, lattice, solvation, and other chemical "energies" are actually enthalpy differences. As a state function, enthalpy depends only on the final configuration of internal energy, pressure, and volume, not on the path taken to achieve it.';
rdfs:subClassOf matonto:Material.

Answer:

