matonto:Lithium a owl:Class;
dcterms:title 'Lithium';
dcterms:description 'Lithium is a chemical element; it has symbol Li and atomic number 3. It is a soft, silvery-white alkali metal. Under standard conditions, it is the least dense metal and the least dense solid element. Like all alkali metals, lithium is highly reactive and flammable, and must be stored in vacuum, inert atmosphere, or inert liquid such as purified kerosene or mineral oil. It exhibits a metallic luster. It corrodes quickly in air to a dull silvery gray, then black tarnish. It does not occur freely in nature, but occurs mainly as pegmatitic minerals, which were once the main source of lithium. Due to its solubility as an ion, it is present in ocean water and is commonly obtained from brines. Lithium metal is isolated electrolytically from a mixture of lithium chloride and potassium chloride.'.

matonto:AcylChloride a owl:Class;
dcterms:title 'acyl chloride';
dcterms:description 'In organic chemistry, an acyl chloride is an organic compound with the functional group −C(=O)Cl. Their formula is usually written R−COCl, where R is a side chain. They are reactive derivatives of carboxylic acids. A specific example of an acyl chloride is acetyl chloride, CH3COCl. Acyl chlorides are the most important subset of acyl halides.';
rdfs:subClassOf matonto:Lithium.

Answer:

matonto:ElectricResistance a owl:Class;
dcterms:title 'electric resistance';
dcterms:description 'The electrical resistance of an object is a measure of its opposition to the flow of electric current. Its reciprocal quantity is electrical conductance, measuring the ease with which an electric current passes. Electrical resistance shares some conceptual parallels with mechanical friction. The SI unit of electrical resistance is the ohm, while electrical conductance is measured in siemens (S).'.

matonto:BandGap a owl:Class;
dcterms:title 'band gap';
dcterms:description 'In solid-state physics and solid-state chemistry, a band gap, also called a bandgap or energy gap, is an energy range in a solid where no electronic states exist. In graphs of the electronic band structure of solids, the band gap refers to the energy difference between the top of the valence band and the bottom of the conduction band in insulators and semiconductors. It is the energy required to promote an electron from the valence band to the conduction band. The resulting conduction-band electron are free to move within the crystal lattice and serve as charge carriers to conduct electric current. It is closely related to the HOMO/LUMO gap in chemistry. If the valence band is completely full and the conduction band is completely empty, then electrons cannot move within the solid because there are no available states. If the electrons are not free to move within the crystal lattice, then there is no generated current due to no net charge carrier mobility. However, if some electrons transfer from the valence band to the conduction band, then current can flow. Therefore, the band gap is a major factor determining the electrical conductivity of a solid. Substances having large band gaps are generally insulators, those with small band gaps are semiconductors, and conductors either have very small band gaps or none, because the valence and conduction bands overlap to form a continuous band.';
rdfs:subClassOf matonto:ElectricResistance.

Answer:

