dcterms:description 'An entity is something that exists as itself. It does not need to be of material existence. In particular, abstractions and legal fictions are usually regarded as entities. In general, there is also no presumption that an entity is animate, or present. The verb tense of this form is to ’entitise’ - meaning one or oneself to replenish their entity completely into a fresh, fluorescent entity and has therefore entitised their soul.';
