matonto:Radium a owl:Class;
dcterms:title 'Radium';
dcterms:description 'Radium is a chemical element; it has symbol Ra and atomic number 88. It is the sixth element in group 2 of the periodic table, also known as the alkaline earth metals. Pure radium is silvery-white, but it readily reacts with nitrogen (rather than oxygen) upon exposure to air, forming a black surface layer of radium nitride (Ra3N2). All isotopes of radium are radioactive, the most stable isotope being radium-226 with a half-life of 1,600 years. When radium decays, it emits ionizing radiation as a by-product, which can excite fluorescent chemicals and cause radioluminescence. For this property, it was widely used in self-luminous paints following its discovery. Of the radioactive elements that occur in quantity, radium is considered particularly toxic, and it is carcinogenic due to the radioactivity of both it and its immediate decay product radon as well as its tendency to accumulate in the bones.'.

matonto:ThermalExpansion a owl:Class;
dcterms:title 'Thermal Expansion';
dcterms:description 'Thermal expansion is the tendency of matter to increase in length, area, or volume, changing its size and density, in response to an increase in temperature .
Substances usually contract with decreasing temperature, with rare exceptions within limited temperature ranges.';
rdfs:subClassOf matonto:Radium.

