matonto:Period1Element a owl:Class;
dcterms:title 'period 1 element';
dcterms:description 'A period 1 element is one of the chemical elements in the first row of the periodic table of the chemical elements. The periodic table is laid out in rows to illustrate periodic (recurring) trends in the chemical behaviour of the elements as their atomic number increases: a new row is begun when chemical behaviour begins to repeat, meaning that analog elements fall into the same vertical columns. The first period contains fewer elements than any other row in the table, with only two: hydrogen and helium. This situation can be explained by modern theories of atomic structure. In a quantum mechanical description of atomic structure, this period corresponds to the filling of the 1s orbital. Period 1 elements obey the duet rule in that they need two electrons to complete their valence shell.'.

matonto:Permittivity a owl:Class;
dcterms:title 'permittivity';
dcterms:description 'In electromagnetism, the absolute permittivity, often simply called permittivity and denoted by the Greek letter ε (epsilon), is a measure of the electric polarizability of a dielectric material. A material with high permittivity polarizes more in response to an applied electric field than a material with low permittivity, thereby storing more energy in the material. In electrostatics, the permittivity plays an important role in determining the capacitance of a capacitor.';
rdfs:subClassOf matonto:Period1Element.

Answer:

