matonto:NobleGas a owl:Class;
dcterms:title 'noble gas';
dcterms:description 'The noble gases are the members of group 18 of the periodic table: helium (He), neon (Ne), argon (Ar), krypton (Kr), xenon (Xe), radon (Rn) and, in some cases, oganesson (Og). Under standard conditions, the first six of these elements are odorless, colorless, monatomic gases with very low chemical reactivity and cryogenic boiling points. The properties of oganesson are uncertain.'.

matonto:Glasses a owl:Class;
dcterms:title 'glasses';
dcterms:description 'Glasses, also known as eyeglasses, spectacles, or colloquially as specs, are vision eyewear with clear or tinted lenses mounted in a frame that holds them in front of a person’s eyes, typically utilizing a bridge over the nose and hinged arms, known as temples or temple pieces, that rest over the ears for support.';
rdfs:subClassOf matonto:NobleGas.

Answer:

matonto:Acceleration a owl:Class;
dcterms:title 'acceleration';
dcterms:description 'In mechanics, acceleration is the rate of change of the velocity of an object with respect to time. Acceleration is one of several components of kinematics, the study of motion. Accelerations are vector quantities. The orientation of an object’s acceleration is given by the orientation of the net force acting on that object. The magnitude of an object’s acceleration, as described by Newton’s second law, is the combined effect of two causes:the net balance of all external forces acting onto that object — magnitude is directly proportional to this net resulting force;
that object’s mass, depending on the materials out of which it is made — magnitude is inversely proportional to the object’s mass.'.

matonto:Gadolinium a owl:Class;
dcterms:title 'Gadolinium';
dcterms:description 'Gadolinium is a chemical element; it has symbol Gd and atomic number 64. It is a silvery-white metal when oxidation is removed. Gadolinium is a malleable and ductile rare-earth element. It reacts with atmospheric oxygen or moisture slowly to form a black coating. Gadolinium below its Curie point of 20 °C (68 °F) is ferromagnetic, with an attraction to a magnetic field higher than that of nickel. Above this temperature it is the most paramagnetic element. It is found in nature only in an oxidized form. When separated, it usually has impurities of the other rare earths because of their similar chemical properties.';
rdfs:subClassOf matonto:Acceleration.

Answer:

matonto:Radiance a owl:Class;
dcterms:title 'radiance';
dcterms:description 'In radiometry, radiance is the radiant flux emitted, reflected, transmitted or received by a given surface, per unit solid angle per unit projected area. Radiance is used to characterize diffuse emission and reflection of electromagnetic radiation, and to quantify emission of neutrinos and other particles. The SI unit of radiance is the watt per steradian per square metre. It is a directional quantity: the radiance of a surface depends on the direction from which it is being observed.'.

