matonto:Aromatic a owl:Class;
dcterms:title 'aromatic';
dcterms:description 'In organic chemistry, aromaticity is a chemical property describing the way in which a conjugated ring of unsaturated bonds, lone pairs, or empty orbitals exhibits a stabilization stronger than would be expected from conjugation alone. The earliest use of the term was in an article by August Wilhelm Hofmann in 1855. There is no general relationship between aromaticity as a chemical property and the olfactory properties of such compounds.'.

matonto:Diastereomer a owl:Class;
dcterms:title 'diastereomer';
dcterms:description 'In stereochemistry, diastereomers are a type of stereoisomer. Diastereomers are defined as non-mirror image, non-identical stereoisomers. Hence, they occur when two or more stereoisomers of a compound have different configurations at one or more of the equivalent (related) stereocenters and are not mirror images of each other. 
When two diastereoisomers differ from each other at only one stereocenter, they are epimers. Each stereocenter gives rise to two different configurations and thus typically increases the number of stereoisomers by a factor of two.';
rdfs:subClassOf matonto:Aromatic.

Answer:

matonto:Period6Element a owl:Class;
dcterms:title 'period 6 element';
dcterms:description 'A period 6 element is one of the chemical elements in the sixth row (or period) of the periodic table of the chemical elements, including the lanthanides. The periodic table is laid out in rows to illustrate recurring (periodic) trends in the chemical behaviour of the elements as their atomic number increases: a new row is begun when chemical behaviour begins to repeat, meaning that elements with similar behaviour fall into the same vertical columns. The sixth period contains 32 elements, tied for the most with period 7, beginning with caesium and ending with radon. Lead is currently the last stable element; all subsequent elements are radioactive. For bismuth, however, its only primordial isotope, 209Bi, has a half-life of more than 1019 years, over a billion times longer than the current age of the universe. As a rule, period 6 elements fill their 6s shells first, then their 4f, 5d, and 6p shells, in that order; however, there are exceptions, such as gold.'.

matonto:Californium a owl:Class;
dcterms:title 'Californium';
dcterms:description 'Californium is a synthetic chemical element; it has symbol Cf and atomic number 98. It was first synthesized in 1950 at Lawrence Berkeley National Laboratory by bombarding curium with alpha particles. It is an actinide element, the sixth transuranium element to be synthesized, and has the second-highest atomic mass of all elements that have been produced in amounts large enough to see with the naked eye. It was named after the university and the U.S. state of California.';
rdfs:subClassOf matonto:Period6Element.

Answer:

matonto:AbsorbedDoseRate a owl:Class;
dcterms:title 'absorbed dose rate';
dcterms:description 'Absorbed dose is a dose quantity which represents the specific energy deposited by ionizing radiation in living matter. Absorbed dose is used in the calculation of dose uptake in living tissue in both radiation protection, and radiology. It is also used to directly compare the effect of radiation on inanimate matter such as in radiation hardening.'.

matonto:Group4Element a owl:Class;
dcterms:title 'group 4 element';
dcterms:description 'Group 4 is the second group of transition metals in the periodic table. It contains only the four elements titanium (Ti), zirconium (Zr), hafnium (Hf), and rutherfordium (Rf). The group is also called the titanium group or titanium family after its lightest member.';
rdfs:subClassOf matonto:AbsorbedDoseRate.

Answer:

matonto:AngularAcceleration a owl:Class;
dcterms:title 'angular acceleration';
dcterms:description 'In physics, angular acceleration is the time rate of change of angular velocity. Following the two types of angular velocity, spin angular velocity and orbital angular velocity, the respective types of angular acceleration are: spin angular acceleration, involving a rigid body about an axis of rotation intersecting the body’s centroid; and orbital angular acceleration, involving a point particle and an external axis.'.

matonto:Concentration a owl:Class;
dcterms:title 'Concentration';
dcterms:description 'In chemistry, concentration is the abundance of a constituent divided by the total volume of a mixture. Several types of mathematical description can be distinguished: mass concentration, molar concentration, number concentration, and volume concentration. The concentration can refer to any kind of chemical mixture, but most frequently refers to solutes and solvents in solutions. The molar (amount) concentration has variants, such as normal concentration and osmotic concentration. Dilution is reduction of concentration, e.g. by adding solvent to a solution. The verb to concentrate means to increase concentration, the opposite of dilute.';
rdfs:subClassOf matonto:AngularAcceleration.

Answer:

matonto:PowerUnit a owl:Class;
dcterms:title 'power unit';
dcterms:description 'In electricity generation, a generator, also called an electric generator, electrical generator, and electromagnetic generator is an electromechanical device that converts mechanical energy to electrical energy for use in an external circuit. In most generators which are rotating machines, a source of kinetic power rotates the generator’s shaft, and the generator produces an electric current at its output terminals which flows through an external circuit, powering electrical loads. Sources of mechanical energy used to drive generators include steam turbines, gas turbines, water turbines, internal combustion engines, wind turbines and even hand cranks. Generators produce nearly all of the electric power for worldwide electric power grids. The first electromagnetic generator, the Faraday disk, was invented in 1831 by British scientist Michael Faraday.'.

matonto:AmideGroup a owl:Class;
dcterms:title 'amide group';
dcterms:description 'In organic chemistry, an amide, also known as an organic amide or a carboxamide, is a compound with the general formula R−C(=O)−NR′R″, where R, R’, and R″ represent any group, typically organyl groups or hydrogen atoms. The amide group is called a peptide bond when it is part of the main chain of a protein, and an isopeptide bond when it occurs in a side chain, as in asparagine and glutamine. It can be viewed as a derivative of a carboxylic acid with the hydroxyl group replaced by an amino group ; or, equivalently, an acyl (alkanoyl) group joined to an amino group.';
rdfs:subClassOf matonto:PowerUnit.

Answer:

matonto:SynthesisReaction a owl:Class;
dcterms:title 'synthesis reaction';
dcterms:description 'Chemical synthesis is the artificial execution of chemical reactions to obtain one or several products. This occurs by physical and chemical manipulations usually involving one or more reactions. In modern laboratory uses, the process is reproducible and reliable.'.

