matonto:KetoneGroup a owl:Class;
dcterms:title 'ketone group';
dcterms:description 'In organic chemistry, a ketone is an organic compound with the structure R−C(=O)−R’, where R and R’ can be a variety of carbon-containing substituents. Ketones contain a carbonyl group −C(=O)−. The simplest ketone is acetone, with the formula (CH3)2CO. Many ketones are of great importance in biology and industry. Examples include many sugars (ketoses), many steroids, e.g., testosterone, and the solvent acetone.'.

matonto:Density a owl:Class;
dcterms:title 'density';
dcterms:description 'Density is the ratio of a substance’s mass to its volume. The symbol most often used for density is ρ, although the Latin letter D can also be used: 

where ρ is the density, m is the mass, and V is the volume. In some cases, density is loosely defined as its weight per unit volume, although this is scientifically inaccurate – this quantity is more specifically called specific weight.';
