matonto:Frequency a owl:Class;
dcterms:title 'frequency';
dcterms:description 'Frequency, most often measured in hertz, is the number of occurrences of a repeating event per unit of time. It is also occasionally referred to as temporal frequency for clarity and to distinguish it from spatial frequency. Ordinary frequency is related to angular frequency by a factor of 2π.'.

matonto:Sodium a owl:Class;
dcterms:title 'Sodium';
dcterms:description 'Sodium is a chemical element; it has symbol Na and atomic number 11. It is a soft, silvery-white, highly reactive metal. Sodium is an alkali metal, being in group 1 of the periodic table. Its only stable isotope is 23Na. The free metal does not occur in nature and must be prepared from compounds. Sodium is the sixth most abundant element in the Earth’s crust and exists in numerous minerals such as feldspars, sodalite, and halite (NaCl). Many salts of sodium are highly water-soluble: sodium ions have been leached by the action of water from the Earth’s minerals over eons, and thus sodium and chlorine are the most common dissolved elements by weight in the oceans.';
rdfs:subClassOf matonto:Frequency.

Answer:

matonto:Hafnium a owl:Class;
dcterms:title 'Hafnium';
dcterms:description 'Hafnium is a chemical element; it has symbol Hf and atomic number 72. A lustrous, silvery gray, tetravalent transition metal, hafnium chemically resembles zirconium and is found in many zirconium minerals. Its existence was predicted by Dmitri Mendeleev in 1869, though it was not identified until 1922, by Dirk Coster and George de Hevesy. Hafnium is named after Hafnia, the Latin name for Copenhagen, where it was discovered.'.

matonto:CatalyticActivity a owl:Class;
dcterms:title 'catalytic activity';
dcterms:description 'Catalysis is the increase in rate of a chemical reaction due to an added substance known as a catalyst. Catalysts are not consumed by the reaction and remain unchanged after it. If the reaction is rapid and the catalyst recycles quickly, very small amounts of catalyst often suffice; mixing, surface area, and temperature are important factors in reaction rate. Catalysts generally react with one or more reactants to form intermediates that subsequently give the final reaction product, in the process of regenerating the catalyst.';
rdfs:subClassOf matonto:Hafnium.

Answer:

matonto:Plutonium a owl:Class;
dcterms:title 'Plutonium';
dcterms:description 'Plutonium is a chemical element; it has symbol Pu and atomic number 94. It is a silvery-gray actinide metal that tarnishes when exposed to air, and forms a dull coating when oxidized. The element normally exhibits six allotropes and four oxidation states. It reacts with carbon, halogens, nitrogen, silicon, and hydrogen. When exposed to moist air, it forms oxides and hydrides that can expand the sample up to 70% in volume, which in turn flake off as a powder that is pyrophoric. It is radioactive and can accumulate in bones, which makes the handling of plutonium dangerous.'.

matonto:Darmstadtium a owl:Class;
dcterms:title 'Darmstadtium';
dcterms:description 'Darmstadtium is a synthetic chemical element; it has symbol Ds and atomic number 110. It is extremely radioactive: the most stable known isotope, darmstadtium-281, has a half-life of approximately 14 seconds. Darmstadtium was first created in November 1994 by the GSI Helmholtz Centre for Heavy Ion Research in the city of Darmstadt, Germany, after which it was named.';
rdfs:subClassOf matonto:Plutonium.

Answer:

matonto:Aryl a owl:Class;
dcterms:title 'aryl';
