dcterms:description 'In thermodynamics, the Helmholtz free energy is a thermodynamic potential that measures the useful work obtainable from a closed thermodynamic system at a constant temperature (isothermal). The change in the Helmholtz energy during a process is equal to the maximum amount of work that the system can perform in a thermodynamic process in which temperature is held constant. At constant temperature, the Helmholtz free energy is minimized at equilibrium.';
rdfs:subClassOf matonto:ExaScaledUnit.

Answer:

matonto:Aromaticity a owl:Class;
dcterms:title 'aromaticity';
dcterms:description 'In organic chemistry, aromaticity is a chemical property describing the way in which a conjugated ring of unsaturated bonds, lone pairs, or empty orbitals exhibits a stabilization stronger than would be expected from conjugation alone. The earliest use of the term was in an article by August Wilhelm Hofmann in 1855. There is no general relationship between aromaticity as a chemical property and the olfactory properties of such compounds.'.

matonto:SpecificEnergy a owl:Class;
dcterms:title 'specific energy';
dcterms:description 'Specific energy or massic energy is energy per unit mass. It is also sometimes called gravimetric energy density, which is not to be confused with energy density, which is defined as energy per unit volume. It is used to quantify, for example, stored heat and other thermodynamic properties of substances such as specific internal energy, specific enthalpy, specific Gibbs free energy, and specific Helmholtz free energy. It may also be used for the kinetic energy or potential energy of a body. Specific energy is an intensive property, whereas energy and mass are extensive properties.';
rdfs:subClassOf matonto:Aromaticity.

Answer:

matonto:Molecule a owl:Class;
dcterms:title 'molecule';
dcterms:description 'A molecule is a group of two or more atoms that are held together by attractive forces known as chemical bonds; depending on context, the term may or may not include ions that satisfy this criterion. In quantum physics, organic chemistry, and biochemistry, the distinction from ions is dropped and molecule is often used when referring to polyatomic ions.'.

matonto:Hydrophobicity a owl:Class;
dcterms:title 'hydrophobicity';
dcterms:description 'In chemistry, hydrophobicity is the chemical property of a molecule that is seemingly repelled from a mass of water. In contrast, hydrophiles are attracted to water.';
rdfs:subClassOf matonto:Molecule.

