matonto:Darmstadtium a owl:Class;
dcterms:title 'Darmstadtium';
dcterms:description 'Darmstadtium is a synthetic chemical element; it has symbol Ds and atomic number 110. It is extremely radioactive: the most stable known isotope, darmstadtium-281, has a half-life of approximately 14 seconds. Darmstadtium was first created in November 1994 by the GSI Helmholtz Centre for Heavy Ion Research in the city of Darmstadt, Germany, after which it was named.'.

matonto:SolidPhase a owl:Class;
dcterms:title 'solid phase';
dcterms:description 'In the physical sciences, a phase is a region of material that is chemically uniform, physically distinct, and (often) mechanically separable. In a system consisting of ice and water in a glass jar, the ice cubes are one phase, the water is a second phase, and the humid air is a third phase over the ice and water. The glass of the jar is a different material, in its own separate phase.';
rdfs:subClassOf matonto:Darmstadtium.

Answer:

matonto:Isomer a owl:Class;
dcterms:title 'isomer';
dcterms:description 'In chemistry, isomers are molecules or polyatomic ions with identical molecular formula – that is, the same number of atoms of each element – but distinct arrangements of atoms in space. Isomerism refers to the existence or possibility of isomers.'.

matonto:SurfaceTension a owl:Class;
dcterms:title 'surface tension';
dcterms:description 'Surface tension is the tendency of liquid surfaces at rest to shrink into the minimum surface area possible. Surface tension is what allows objects with a higher density than water such as razor blades and insects to float on a water surface without becoming even partly submerged.';
rdfs:subClassOf matonto:Isomer.

Answer:

matonto:HydrogenBond a owl:Class;
dcterms:title 'hydrogen bond';
dcterms:description 'In chemistry, a hydrogen bond (H-bond) is a specific type of molecular interaction that exhibits partial covalent character and cannot be described as a purely electrostatic force. It occurs when a hydrogen (H) atom, covalently bonded to a more electronegative donor atom or group (Dn), interacts with another electronegative atom bearing a lone pair of electrons—the hydrogen bond acceptor (Ac). Unlike simple dipole–dipole interactions, hydrogen bonding arises from charge transfer, orbital interactions, and quantum mechanical delocalization, making it a resonance-assisted interaction rather than a mere electrostatic attraction.'.

matonto:Mass a owl:Class;
dcterms:title 'mass';
dcterms:description 'Mass is an intrinsic property of a body. It was traditionally believed to be related to the quantity of matter in a body, until the discovery of the atom and particle physics. It was found that different atoms and different elementary particles, theoretically with the same amount of matter, have nonetheless different masses. Mass in modern physics has multiple definitions which are conceptually distinct, but physically equivalent. Mass can be experimentally defined as a measure of the body’s inertia, meaning the resistance to acceleration when a net force is applied. The object’s mass also determines the strength of its gravitational attraction to other bodies.';
rdfs:subClassOf matonto:HydrogenBond.

Answer:

