matonto:Scandium a owl:Class;
dcterms:title 'Scandium';
dcterms:description 'Scandium is a chemical element; it has symbol Sc and atomic number 21. It is a silvery-white metallic d-block element. Historically, it has been classified as a rare-earth element, together with yttrium and the lanthanides. It was discovered in 1879 by spectral analysis of the minerals euxenite and gadolinite from Scandinavia.'.

matonto:SpecificEntropy a owl:Class;
dcterms:title 'specific entropy';
dcterms:description 'Entropy is a scientific concept, most commonly associated with states of disorder, randomness, or uncertainty. The term and the concept are used in diverse fields, from classical thermodynamics, where it was first recognized, to the microscopic description of nature in statistical physics, and to the principles of information theory. It has found far-ranging applications in chemistry and physics, in biological systems and their relation to life, in cosmology, economics, sociology, weather science, climate change and information systems including the transmission of information in telecommunication.';
rdfs:subClassOf matonto:Scandium.

Answer:

matonto:Ion a owl:Class;
dcterms:title 'Ion';
dcterms:description 'An ion is an atom or molecule with a net electrical charge. The charge of an electron is considered to be negative by convention and this charge is equal and opposite to the charge of a proton, which is considered to be positive by convention. The net charge of an ion is not zero because its total number of electrons is unequal to its total number of protons.'.

