matonto:PlaneAngle a owl:Class;
dcterms:title 'plane angle';
dcterms:description 'In Euclidean geometry, an angle can refer to a number of concepts relating to the intersection of two straight lines at a point. Formally, an angle is a figure lying in a plane formed by two rays, called the sides of the angle, sharing a common endpoint, called the vertex of the angle. More generally angles are also formed wherever two lines, rays or line segments come together, such as at the corners of triangles and other polygons. An angle can be considered as the region of the plane bounded by the sides. Angles can also be formed by the intersection of two planes or by two intersecting curves, in which case the rays lying tangent to each curve at the point of intersection define the angle.'.

matonto:InorganicReaction a owl:Class;
dcterms:title 'inorganic reaction';
dcterms:description 'A chemical reaction is a process that leads to the chemical transformation of one set of chemical substances to another. When chemical reactions occur, the atoms are rearranged and the reaction is accompanied by an energy change as new products are generated. Classically, chemical reactions encompass changes that only involve the positions of electrons in the forming and breaking of chemical bonds between atoms, with no change to the nuclei, and can often be described by a chemical equation. Nuclear chemistry is a sub-discipline of chemistry that involves the chemical reactions of unstable and radioactive elements where both electronic and nuclear changes can occur.';
