matonto:MolarMass a owl:Class;
dcterms:title 'molar mass';
dcterms:description 'In chemistry, the molar mass of a chemical substance is defined as the ratio between the mass and the amount of substance of any sample of the substance: . The molar mass is a bulk, not molecular, property of a substance. The molar mass is an average of many instances of the element or compound, which often vary in mass due to the presence of isotopes. Most commonly, the molar mass is computed from the standard atomic weights and is thus a terrestrial average and a function of the relative abundance of the isotopes of the constituent atoms on Earth.';
rdfs:subClassOf matonto:MeasuredProperty.

Answer:

matonto:Amine a owl:Class;
dcterms:title 'amine';
dcterms:description 'In chemistry, amines are organic compounds made up of carbon and nitrogen bond. Amines are formed when one or more hydrogen atoms in ammonia are replaced by alkyl or aryl groups. The nitrogen atom in an amine possesses a lone pair of electrons. Amines can also exist as hetero cyclic compounds. Aniline is the simplest aromatic amine, consisting of a benzene ring bonded to an amino group.'.

matonto:RedoxReaction a owl:Class;
dcterms:title 'redox reaction';
dcterms:description 'Redox is a type of chemical reaction in which the oxidation states of the reactants change. Oxidation is the loss of electrons or an increase in the oxidation state, while reduction is the gain of electrons or a decrease in the oxidation state. The oxidation and reduction processes occur simultaneously in the chemical reaction.';
rdfs:subClassOf matonto:Amine.

Answer:

matonto:Atom a owl:Class;
dcterms:title 'atom';
dcterms:description 'Atoms are the basic particles of the chemical elements. An atom consists of a nucleus of protons and generally neutrons, surrounded by an electromagnetically bound swarm of electrons. The chemical elements are distinguished from each other by the number of protons that are in their atoms. For example, any atom that contains 11 protons is sodium, and any atom that contains 29 protons is copper. Atoms with the same number of protons but a different number of neutrons are called isotopes of the same element.'.

matonto:UnunniliumAtom a owl:Class;
dcterms:title 'Ununnilium Atom';
dcterms:description '';
rdfs:subClassOf matonto:Atom.

Answer:

matonto:SolidAngle a owl:Class;
dcterms:title 'solid angle';
dcterms:description 'In geometry, a solid angle is a measure of the amount of the field of view from some particular point that a given object covers. That is, it is a measure of how large the object appears to an observer looking from that point.
The point from which the object is viewed is called the apex of the solid angle, and the object is said to subtend its solid angle at that point.'.

