matonto:HeliumAtom a owl:Class;
dcterms:title 'Helium Atom';
dcterms:description 'A helium atom is an atom of the chemical element helium. Helium is composed of two electrons bound by the electromagnetic force to a nucleus containing two protons along with two neutrons, depending on the isotope, held together by the strong force. Unlike for hydrogen, a closed-form solution to the Schrödinger equation for the helium atom has not been found. However, various approximations, such as the Hartree–Fock method, can be used to estimate the ground state energy and wavefunction of the atom.'.

matonto:Molecule a owl:Class;
dcterms:title 'molecule';
dcterms:description 'A molecule is a group of two or more atoms that are held together by attractive forces known as chemical bonds; depending on context, the term may or may not include ions that satisfy this criterion. In quantum physics, organic chemistry, and biochemistry, the distinction from ions is dropped and molecule is often used when referring to polyatomic ions.';
rdfs:subClassOf matonto:HeliumAtom.

Answer:

matonto:Aromatic a owl:Class;
dcterms:title 'aromatic';
dcterms:description 'In organic chemistry, aromaticity is a chemical property describing the way in which a conjugated ring of unsaturated bonds, lone pairs, or empty orbitals exhibits a stabilization stronger than would be expected from conjugation alone. The earliest use of the term was in an article by August Wilhelm Hofmann in 1855. There is no general relationship between aromaticity as a chemical property and the olfactory properties of such compounds.'.

matonto:AbsorbedDoseRate a owl:Class;
dcterms:title 'absorbed dose rate';
dcterms:description 'Absorbed dose is a dose quantity which represents the specific energy deposited by ionizing radiation in living matter. Absorbed dose is used in the calculation of dose uptake in living tissue in both radiation protection, and radiology. It is also used to directly compare the effect of radiation on inanimate matter such as in radiation hardening.';
rdfs:subClassOf matonto:Aromatic.

Answer:

