matonto:SurfaceTension a owl:Class;
dcterms:title 'surface tension';
dcterms:description 'Surface tension is the tendency of liquid surfaces at rest to shrink into the minimum surface area possible. Surface tension is what allows objects with a higher density than water such as razor blades and insects to float on a water surface without becoming even partly submerged.';
rdfs:subClassOf matonto:MeasuredProperty.

