matonto:MagneticFlux a owl:Class;
dcterms:title 'magnetic flux';
dcterms:description 'In physics, specifically electromagnetism, the magnetic flux through a surface is the surface integral of the normal component of the magnetic field B over that surface. It is usually denoted Φ or ΦB. The SI unit of magnetic flux is the weber, and the CGS unit is the maxwell. Magnetic flux is usually measured with a fluxmeter, which contains measuring coils, and it calculates the magnetic flux from the change of voltage on the coils.'.

matonto:HydrogenBond a owl:Class;
dcterms:title 'hydrogen bond';
dcterms:description 'In chemistry, a hydrogen bond (H-bond) is a specific type of molecular interaction that exhibits partial covalent character and cannot be described as a purely electrostatic force. It occurs when a hydrogen (H) atom, covalently bonded to a more electronegative donor atom or group (Dn), interacts with another electronegative atom bearing a lone pair of electrons—the hydrogen bond acceptor (Ac). Unlike simple dipole–dipole interactions, hydrogen bonding arises from charge transfer, orbital interactions, and quantum mechanical delocalization, making it a resonance-assisted interaction rather than a mere electrostatic attraction.';
rdfs:subClassOf matonto:MagneticFlux.

Answer:

matonto:PureSubstance a owl:Class;
dcterms:title 'pure substance';
dcterms:description 'A chemical substance is a unique form of matter with constant chemical composition and characteristic properties. Chemical substances may take the form of a single element or chemical compounds. If two or more chemical substances can be combined without reacting, they may form a chemical mixture. If a mixture is separated to isolate one chemical substance to a desired degree, the resulting substance is said to be chemically pure.'.

matonto:PolarBond a owl:Class;
dcterms:title 'polar bond';
dcterms:description ' In chemistry, polarity is a separation of electric charge leading to a molecule or its chemical groups having an electric dipole moment, with a negatively charged end and a positively charged end.';
rdfs:subClassOf matonto:PureSubstance.

