matonto:Group7Element a owl:Class;
dcterms:title 'group 7 element';
dcterms:description 'Group 7, numbered by IUPAC nomenclature, is a group of elements in the periodic table. It contains manganese (Mn), technetium (Tc), rhenium (Re) and bohrium (Bh). This group lies in the d-block of the periodic table, and are hence transition metals. This group is sometimes called the manganese group or manganese family after its lightest member; however, the group itself has not acquired a trivial name because it belongs to the broader grouping of the transition metals.'.

matonto:Acid-baseReaction a owl:Class;
dcterms:title 'acid-base reaction';
dcterms:description 'In chemistry, an acid–base reaction is a chemical reaction that occurs between an acid and a base. It can be used to determine pH via titration. Several theoretical frameworks provide alternative conceptions of the reaction mechanisms and their application in solving related problems; these are called the acid–base theories, for example, Brønsted–Lowry acid–base theory.';
rdfs:subClassOf matonto:Group7Element.

Answer:

matonto:ElectricCurrentDensity a owl:Class;
dcterms:title 'electric current density';
dcterms:description 'In electromagnetism, current density is the amount of charge per unit time that flows through a unit area of a chosen cross section. The current density vector is defined as a vector whose magnitude is the electric current per cross-sectional area at a given point in space, its direction being that of the motion of the positive charges at this point. In SI base units, the electric current density is measured in amperes per square metre.'.

matonto:AreaDensity a owl:Class;
dcterms:title 'area density';
dcterms:description 'The area density of a two-dimensional object is calculated as the mass per unit area. The SI derived unit is the "kilogram per square metre" (kg·m−2).';
rdfs:subClassOf matonto:ElectricCurrentDensity.

