matonto:SolidPhase a owl:Class;
dcterms:title 'solid phase';
dcterms:description 'In the physical sciences, a phase is a region of material that is chemically uniform, physically distinct, and (often) mechanically separable. In a system consisting of ice and water in a glass jar, the ice cubes are one phase, the water is a second phase, and the humid air is a third phase over the ice and water. The glass of the jar is a different material, in its own separate phase.'.

matonto:SolidAngle a owl:Class;
dcterms:title 'solid angle';
dcterms:description 'In geometry, a solid angle is a measure of the amount of the field of view from some particular point that a given object covers. That is, it is a measure of how large the object appears to an observer looking from that point.
The point from which the object is viewed is called the apex of the solid angle, and the object is said to subtend its solid angle at that point.';
rdfs:subClassOf matonto:SolidPhase.

