matonto:Chaoite a owl:Class;
dcterms:title 'chaoite';
dcterms:description 'Chaoite, or white carbon, is a mineral described as an allotrope of carbon whose existence is disputed. It was discovered in shock-fused graphite gneiss from the Ries crater in Bavaria. It has been described as slightly harder than graphite, with a reflection colour of grey to white. From its electron diffraction pattern, the mineral has been considered to have a carbyne structure, the linear acetylenic carbon allotrope of carbon. A later report has called this identification, and the very existence of carbyne phases, into question, arguing that the new reflections in the diffraction pattern are due to clay impurities.'.

matonto:CarbonAllotrope a owl:Class;
dcterms:title 'carbon allotrope';
dcterms:description 'Carbon is capable of forming many allotropes due to its valency (tetravalent). Well-known forms of carbon include diamond and graphite. In recent decades, many more allotropes have been discovered and researched, including ball shapes such as buckminsterfullerene and sheets such as graphene. Larger-scale structures of carbon include nanotubes, nanobuds and nanoribbons. Other unusual forms of carbon exist at very high temperatures or extreme pressures. Around 500 hypothetical 3‑periodic allotropes of carbon are known at the present time, according to the Samara Carbon Allotrope Database (SACADA).';
rdfs:subClassOf matonto:Chaoite.

Answer:

matonto:MagneticFieldStrength a owl:Class;
dcterms:title 'magnetic field strength';
dcterms:description 'A magnetic field is a physical field that describes the magnetic influence on moving electric charges, electric currents, and magnetic materials. A moving charge in a magnetic field experiences a force perpendicular to its own velocity and to the magnetic field. A permanent magnet’s magnetic field pulls on ferromagnetic materials such as iron, and attracts or repels other magnets. In addition, a nonuniform magnetic field exerts minuscule forces on "nonmagnetic" materials by three other magnetic effects: paramagnetism, diamagnetism, and antiferromagnetism, although these forces are usually so small they can only be detected by laboratory equipment. Magnetic fields surround magnetized materials, electric currents, and electric fields varying in time. Since both strength and direction of a magnetic field may vary with location, it is described mathematically by a function assigning a vector to each point of space, called a vector field.'.

