matonto:InorganicReaction a owl:Class;
dcterms:title 'inorganic reaction';
dcterms:description 'A chemical reaction is a process that leads to the chemical transformation of one set of chemical substances to another. When chemical reactions occur, the atoms are rearranged and the reaction is accompanied by an energy change as new products are generated. Classically, chemical reactions encompass changes that only involve the positions of electrons in the forming and breaking of chemical bonds between atoms, with no change to the nuclei, and can often be described by a chemical equation. Nuclear chemistry is a sub-discipline of chemistry that involves the chemical reactions of unstable and radioactive elements where both electronic and nuclear changes can occur.'.

matonto:MolecularMass a owl:Class;
dcterms:title 'molecular mass';
dcterms:description 'The molecular mass is the mass of a given molecule. Units of daltons (Da) are often used. Different molecules of the same compound may have different molecular masses because they contain different isotopes of an element. The derived quantity relative molecular mass is the unitless ratio of the mass of a molecule to the atomic mass constant.';
rdfs:subClassOf matonto:InorganicReaction.

Answer:

matonto:AbsorbedDose a owl:Class;
dcterms:title 'absorbed dose';
dcterms:description 'Absorbed dose is a dose quantity which represents the specific energy deposited by ionizing radiation in living matter. Absorbed dose is used in the calculation of dose uptake in living tissue in both radiation protection, and radiology. It is also used to directly compare the effect of radiation on inanimate matter such as in radiation hardening.'.

matonto:Group14Element a owl:Class;
dcterms:title 'group 14 element';
dcterms:description 'The carbon group is a periodic table group consisting of carbon (C), silicon (Si), germanium (Ge), tin (Sn), lead (Pb), and flerovium (Fl). It lies within the p-block.';
rdfs:subClassOf matonto:AbsorbedDose.

Answer:

matonto:Aromaticity a owl:Class;
dcterms:title 'aromaticity';
dcterms:description 'In organic chemistry, aromaticity is a chemical property describing the way in which a conjugated ring of unsaturated bonds, lone pairs, or empty orbitals exhibits a stabilization stronger than would be expected from conjugation alone. The earliest use of the term was in an article by August Wilhelm Hofmann in 1855. There is no general relationship between aromaticity as a chemical property and the olfactory properties of such compounds.'.

matonto:Germanium a owl:Class;
dcterms:title 'Germanium';
dcterms:description 'Germanium is a chemical element; it has symbol Ge and atomic number 32. It is lustrous, hard-brittle, grayish-white and similar in appearance to silicon. It is a metalloid or a nonmetal in the carbon group that is chemically similar to silicon. Like silicon, germanium naturally reacts and forms complexes with oxygen in nature.';
rdfs:subClassOf matonto:Aromaticity.

