matonto:FlexuralStrength a owl:Class;
dcterms:title 'flexural strength';
dcterms:description 'Flexural strength, also known as modulus of rupture, or bend strength, or transverse rupture strength is a material property, defined as the stress in a material just before it yields in a flexure test. The transverse bending test is most frequently employed, in which a specimen having either a circular or rectangular cross-section is bent until fracture or yielding using a three-point flexural test technique. The flexural strength represents the highest stress experienced within the material at its moment of yield. It is measured in terms of stress, here given the symbol .'.

