matonto:Enthalpy a owl:Class;
dcterms:title 'enthalpy';
dcterms:description 'Enthalpy is the sum of a thermodynamic system’s internal energy and the product of its pressure and volume. It is a state function in thermodynamics used in many measurements in chemical, biological, and physical systems at a constant external pressure, which is conveniently provided by the large ambient atmosphere. The pressure–volume term expresses the work  that was done against constant external pressure  to establish the system’s physical dimensions from  to some final volume , i.e. to make room for it by displacing its surroundings.
The pressure-volume term is very small for solids and liquids at common conditions, and fairly small for gases. Therefore, enthalpy is a stand-in for energy in chemical systems; bond, lattice, solvation, and other chemical "energies" are actually enthalpy differences. As a state function, enthalpy depends only on the final configuration of internal energy, pressure, and volume, not on the path taken to achieve it.'.

matonto:PureSubstance a owl:Class;
dcterms:title 'pure substance';
dcterms:description 'A chemical substance is a unique form of matter with constant chemical composition and characteristic properties. Chemical substances may take the form of a single element or chemical compounds. If two or more chemical substances can be combined without reacting, they may form a chemical mixture. If a mixture is separated to isolate one chemical substance to a desired degree, the resulting substance is said to be chemically pure.';
rdfs:subClassOf matonto:Enthalpy.

Answer:

matonto:Frequency a owl:Class;
dcterms:title 'frequency';
dcterms:description 'Frequency, most often measured in hertz, is the number of occurrences of a repeating event per unit of time. It is also occasionally referred to as temporal frequency for clarity and to distinguish it from spatial frequency. Ordinary frequency is related to angular frequency by a factor of 2π.'.

matonto:MolarEntropy a owl:Class;
dcterms:title 'molar entropy';
dcterms:description 'Entropy is a scientific concept, most commonly associated with states of disorder, randomness, or uncertainty. The term and the concept are used in diverse fields, from classical thermodynamics, where it was first recognized, to the microscopic description of nature in statistical physics, and to the principles of information theory. It has found far-ranging applications in chemistry and physics, in biological systems and their relation to life, in cosmology, economics, sociology, weather science, climate change and information systems including the transmission of information in telecommunication.';
rdfs:subClassOf matonto:Frequency.

Answer:

matonto:Molecule a owl:Class;
dcterms:title 'molecule';
dcterms:description 'A molecule is a group of two or more atoms that are held together by attractive forces known as chemical bonds; depending on context, the term may or may not include ions that satisfy this criterion. In quantum physics, organic chemistry, and biochemistry, the distinction from ions is dropped and molecule is often used when referring to polyatomic ions.'.

