matonto:Length a owl:Class;
dcterms:title 'length';
dcterms:description 'Length is a measure of distance. In the International System of Quantities, length is a quantity with dimension distance. In most systems of measurement a base unit for length is chosen, from which all other units are derived. In the International System of Units (SI) system, the base unit for length is the metre.'.

matonto:Radiation a owl:Class;
dcterms:title 'radiation';
dcterms:description 'In physics, radiation is the emission or transmission of energy in the form of waves or particles through space or a material medium. This includes:electromagnetic radiation consisting of photons, such as radio waves, microwaves, infrared, visible light, ultraviolet, x-rays, and gamma radiation (γ)
particle radiation consisting of particles of non-zero rest energy, such as alpha radiation (α), beta radiation (β), proton radiation and neutron radiation
acoustic radiation, such as ultrasound, sound, and seismic waves, all dependent on a physical transmission medium
gravitational radiation, in the form of gravitational waves, ripples in spacetime';
rdfs:subClassOf matonto:Length.

Answer:

matonto:Cadmium a owl:Class;
dcterms:title 'Cadmium';
dcterms:description 'Cadmium is a chemical element; it has symbol Cd and atomic number 48. This soft, silvery-white metal is chemically similar to the two other stable metals in group 12, zinc and mercury. Like zinc, it demonstrates oxidation state +2 in most of its compounds, and like mercury, it has a lower melting point than the transition metals in groups 3 through 11. Cadmium and its congeners in group 12 are often not considered transition metals, in that they do not have partly filled d or f electron shells in the elemental or common oxidation states. The average concentration of cadmium in Earth’s crust is between 0.1 and 0.5 parts per million (ppm). It was discovered in 1817 simultaneously by Stromeyer and Hermann, both in Germany, as an impurity in zinc carbonate.'.

