matonto:Hafnium a owl:Class;
dcterms:title 'Hafnium';
dcterms:description 'Hafnium is a chemical element; it has symbol Hf and atomic number 72. A lustrous, silvery gray, tetravalent transition metal, hafnium chemically resembles zirconium and is found in many zirconium minerals. Its existence was predicted by Dmitri Mendeleev in 1869, though it was not identified until 1922, by Dirk Coster and George de Hevesy. Hafnium is named after Hafnia, the Latin name for Copenhagen, where it was discovered.';
rdfs:subClassOf matonto:YtterbiumAtom.

Answer:

matonto:Vanadium a owl:Class;
dcterms:title 'Vanadium';
dcterms:description 'Vanadium is a chemical element; it has symbol V and atomic number 23. It is a hard, silvery-grey, malleable transition metal. The elemental metal is rarely found in nature, but once isolated artificially, the formation of an oxide layer (passivation) somewhat stabilizes the free metal against further oxidation.'.

matonto:Boron a owl:Class;
dcterms:title 'Boron';
dcterms:description 'Boron is a chemical element; it has symbol B and atomic number 5. In its crystalline form it is a brittle, dark, lustrous metalloid; in its amorphous form it is a brown powder. As the lightest element of the boron group it has three valence electrons for forming covalent bonds, resulting in many compounds such as boric acid, the mineral sodium borate, and the ultra-hard crystals of boron carbide and boron nitride.';
rdfs:subClassOf matonto:Vanadium.

Answer:

matonto:HydrogenAtom a owl:Class;
dcterms:title 'Hydrogen Atom';
dcterms:description 'A hydrogen atom is an atom of the chemical element hydrogen. The electrically neutral hydrogen atom contains a single positively charged proton in the nucleus, and a single negatively charged electron bound to the nucleus by the Coulomb force. Atomic hydrogen constitutes about 75% of the baryonic mass of the universe.'.

matonto:Ununoctium a owl:Class;
dcterms:title 'Ununoctium';
dcterms:description 'Oganesson is a synthetic chemical element; it has symbol Og and atomic number 118. It was first synthesized in 2002 at the Joint Institute for Nuclear Research (JINR) in Dubna, near Moscow, Russia, by a joint team of Russian and American scientists. In December 2015, it was recognized as one of four new elements by the Joint Working Party of the international scientific bodies IUPAC and IUPAP. It was formally named on 28 November 2016. The name honors the nuclear physicist Yuri Oganessian, who played a leading role in the discovery of the heaviest elements in the periodic table.';
rdfs:subClassOf matonto:HydrogenAtom.

