matonto:AngularAcceleration a owl:Class;
dcterms:title 'angular acceleration';
dcterms:description 'In physics, angular acceleration is the time rate of change of angular velocity. Following the two types of angular velocity, spin angular velocity and orbital angular velocity, the respective types of angular acceleration are: spin angular acceleration, involving a rigid body about an axis of rotation intersecting the body’s centroid; and orbital angular acceleration, involving a point particle and an external axis.'.

matonto:FreeRadicalAddition a owl:Class;
dcterms:title 'free radical addition';
dcterms:description 'In organic chemistry, free-radical addition is an addition reaction which involves free radicals. These reactions can happen due to the free radicals having an unpaired electron in their valence shell, making them highly reactive. Radical additions are known for a variety of unsaturated substrates, both olefinic or aromatic and with or without heteroatoms.';
