matonto:ChemicalSubstance a owl:Class;
dcterms:title 'chemical substance';
dcterms:description 'A chemical substance is a unique form of matter with constant chemical composition and characteristic properties. Chemical substances may take the form of a single element or chemical compounds. If two or more chemical substances can be combined without reacting, they may form a chemical mixture. If a mixture is separated to isolate one chemical substance to a desired degree, the resulting substance is said to be chemically pure.'.

matonto:SynthesisReaction a owl:Class;
dcterms:title 'synthesis reaction';
dcterms:description 'Chemical synthesis is the artificial execution of chemical reactions to obtain one or several products. This occurs by physical and chemical manipulations usually involving one or more reactions. In modern laboratory uses, the process is reproducible and reliable.';
rdfs:subClassOf matonto:ChemicalSubstance.

Answer:

matonto:Material a owl:Class;
dcterms:title 'material';
dcterms:description 'A material is a substance or mixture of substances that constitutes an object. Materials can be pure or impure, living or non-living matter. Materials can be classified on the basis of their physical and chemical properties, or on their geological origin or biological function. Materials science is the study of materials, their properties and their applications.'.

