matonto:NobleGas a owl:Class;
dcterms:title 'noble gas';
dcterms:description 'The noble gases are the members of group 18 of the periodic table: helium (He), neon (Ne), argon (Ar), krypton (Kr), xenon (Xe), radon (Rn) and, in some cases, oganesson (Og). Under standard conditions, the first six of these elements are odorless, colorless, monatomic gases with very low chemical reactivity and cryogenic boiling points. The properties of oganesson are uncertain.';
rdfs:subClassOf matonto:ElectricFluxDensityUnit.

Answer:

matonto:Isomer a owl:Class;
dcterms:title 'isomer';
dcterms:description 'In chemistry, isomers are molecules or polyatomic ions with identical molecular formula – that is, the same number of atoms of each element – but distinct arrangements of atoms in space. Isomerism refers to the existence or possibility of isomers.'.

matonto:Atom a owl:Class;
dcterms:title 'atom';
dcterms:description 'Atoms are the basic particles of the chemical elements. An atom consists of a nucleus of protons and generally neutrons, surrounded by an electromagnetically bound swarm of electrons. The chemical elements are distinguished from each other by the number of protons that are in their atoms. For example, any atom that contains 11 protons is sodium, and any atom that contains 29 protons is copper. Atoms with the same number of protons but a different number of neutrons are called isotopes of the same element.';
rdfs:subClassOf matonto:Isomer.

Answer:

matonto:Mixture a owl:Class;
dcterms:title 'mixture';
dcterms:description '
In chemistry, a mixture is a material made up of two or more different chemical substances which can be separated by physical method. It is an impure substance made up of 2 or more elements or compounds mechanically mixed together in any proportion. A mixture is the physical combination of two or more substances in which the identities are retained and are mixed in the form of solutions, suspensions or colloids.'.

matonto:FreeRadicalAddition a owl:Class;
dcterms:title 'free radical addition';
dcterms:description 'In organic chemistry, free-radical addition is an addition reaction which involves free radicals. These reactions can happen due to the free radicals having an unpaired electron in their valence shell, making them highly reactive. Radical additions are known for a variety of unsaturated substrates, both olefinic or aromatic and with or without heteroatoms.';
rdfs:subClassOf matonto:Mixture.

