matonto:Diastereomer a owl:Class;
dcterms:title 'diastereomer';
dcterms:description 'In stereochemistry, diastereomers are a type of stereoisomer. Diastereomers are defined as non-mirror image, non-identical stereoisomers. Hence, they occur when two or more stereoisomers of a compound have different configurations at one or more of the equivalent (related) stereocenters and are not mirror images of each other. 
When two diastereoisomers differ from each other at only one stereocenter, they are epimers. Each stereocenter gives rise to two different configurations and thus typically increases the number of stereoisomers by a factor of two.'.

matonto:Molecule a owl:Class;
dcterms:title 'molecule';
dcterms:description 'A molecule is a group of two or more atoms that are held together by attractive forces known as chemical bonds; depending on context, the term may or may not include ions that satisfy this criterion. In quantum physics, organic chemistry, and biochemistry, the distinction from ions is dropped and molecule is often used when referring to polyatomic ions.';
