matonto:Period5Element a owl:Class;
dcterms:title 'period 5 element';
dcterms:description 'A period 5 element is one of the chemical elements in the fifth row of the periodic table of the chemical elements. The periodic table is laid out in rows to illustrate recurring (periodic) trends in the chemical behaviour of the elements as their atomic number increases: a new row is begun when chemical behaviour begins to repeat, meaning that elements with similar behaviour fall into the same vertical columns. The fifth period contains 18 elements, beginning with rubidium and ending with xenon. As a rule, period 5 elements fill their 5s shells first, then their 4d, and 5p shells, in that order; however, there are exceptions, such as rhodium.'.

matonto:SpecificEntropy a owl:Class;
dcterms:title 'specific entropy';
dcterms:description 'Entropy is a scientific concept, most commonly associated with states of disorder, randomness, or uncertainty. The term and the concept are used in diverse fields, from classical thermodynamics, where it was first recognized, to the microscopic description of nature in statistical physics, and to the principles of information theory. It has found far-ranging applications in chemistry and physics, in biological systems and their relation to life, in cosmology, economics, sociology, weather science, climate change and information systems including the transmission of information in telecommunication.';
rdfs:subClassOf matonto:Period5Element.

Answer:

matonto:Californium a owl:Class;
dcterms:title 'Californium';
dcterms:description 'Californium is a synthetic chemical element; it has symbol Cf and atomic number 98. It was first synthesized in 1950 at Lawrence Berkeley National Laboratory by bombarding curium with alpha particles. It is an actinide element, the sixth transuranium element to be synthesized, and has the second-highest atomic mass of all elements that have been produced in amounts large enough to see with the naked eye. It was named after the university and the U.S. state of California.'.

matonto:Group16Element a owl:Class;
dcterms:title 'group 16 element';
dcterms:description 'The chalcogens are the chemical elements in group 16 of the periodic table. This group is also known as the oxygen family. Group 16 consists of the elements oxygen (O), sulfur (S), selenium (Se), tellurium (Te), and the radioactive elements polonium (Po) and livermorium (Lv). Often, oxygen is treated separately from the other chalcogens, sometimes even excluded from the scope of the term "chalcogen" altogether, due to its very different chemical behavior from sulfur, selenium, tellurium, and polonium. The word "chalcogen" is derived from a combination of the Greek word khalkos (χαλκός) principally meaning copper, and the Latinized Greek word genēs, meaning born or produced.';
rdfs:subClassOf matonto:Californium.

Answer:

