matonto:Imine a owl:Class;
dcterms:title 'imine';
dcterms:description 'In organic chemistry, an imine is a functional group or organic compound containing a carbon–nitrogen double bond. The nitrogen atom can be attached to a hydrogen or an organic group (R). The carbon atom has two additional single bonds. Imines are common in synthetic and naturally occurring compounds and they participate in many reactions.';
