matonto:RedoxReaction a owl:Class;
dcterms:title 'redox reaction';
dcterms:description 'Redox is a type of chemical reaction in which the oxidation states of the reactants change. Oxidation is the loss of electrons or an increase in the oxidation state, while reduction is the gain of electrons or a decrease in the oxidation state. The oxidation and reduction processes occur simultaneously in the chemical reaction.'.

matonto:FlexuralStrength a owl:Class;
dcterms:title 'flexural strength';
dcterms:description 'Flexural strength, also known as modulus of rupture, or bend strength, or transverse rupture strength is a material property, defined as the stress in a material just before it yields in a flexure test. The transverse bending test is most frequently employed, in which a specimen having either a circular or rectangular cross-section is bent until fracture or yielding using a three-point flexural test technique. The flexural strength represents the highest stress experienced within the material at its moment of yield. It is measured in terms of stress, here given the symbol .';
rdfs:subClassOf matonto:RedoxReaction.

Answer:

matonto:Scandium a owl:Class;
dcterms:title 'Scandium';
dcterms:description 'Scandium is a chemical element; it has symbol Sc and atomic number 21. It is a silvery-white metallic d-block element. Historically, it has been classified as a rare-earth element, together with yttrium and the lanthanides. It was discovered in 1879 by spectral analysis of the minerals euxenite and gadolinite from Scandinavia.'.

matonto:Catalyst a owl:Class;
dcterms:title 'catalyst';
dcterms:description 'Catalysis is the increase in rate of a chemical reaction due to an added substance known as a catalyst. Catalysts are not consumed by the reaction and remain unchanged after it. If the reaction is rapid and the catalyst recycles quickly, very small amounts of catalyst often suffice; mixing, surface area, and temperature are important factors in reaction rate. Catalysts generally react with one or more reactants to form intermediates that subsequently give the final reaction product, in the process of regenerating the catalyst.';
rdfs:subClassOf matonto:Scandium.

