matonto:Halogen a owl:Class;
dcterms:title 'halogen';
dcterms:description 'The halogens are a group in the periodic table consisting of six chemically related elements: fluorine (F), chlorine (Cl), bromine (Br), iodine (I), and the radioactive elements astatine (At) and tennessine (Ts), though some authors would exclude tennessine as its chemistry is unknown and is theoretically expected to be more like that of gallium. In the modern IUPAC nomenclature, this group is known as group 17.'.

matonto:Period4Element a owl:Class;
dcterms:title 'period 4 element';
dcterms:description 'A period 4 element is one of the chemical elements in the fourth row of the periodic table of the chemical elements. The periodic table is laid out in rows to illustrate recurring (periodic) trends in the chemical behaviour of the elements as their atomic number increases: a new row is begun when chemical behaviour begins to repeat, meaning that elements with similar behaviour fall into the same vertical columns. The fourth period contains 18 elements beginning with potassium and ending with krypton – one element for each of the eighteen groups. It sees the first appearance of d-block in the table.';
rdfs:subClassOf matonto:Halogen.

