matonto:Strontium a owl:Class;
dcterms:title 'Strontium';
dcterms:description 'Strontium is a chemical element; it has symbol Sr and atomic number 38. An alkaline earth metal, it is a soft silver-white yellowish metallic element that is highly chemically reactive. The metal forms a dark oxide layer when it is exposed to air. Strontium has physical and chemical properties similar to those of its two vertical neighbors in the periodic table, calcium and barium. It occurs naturally mainly in the minerals celestine and strontianite, and is mostly mined from these.';
rdfs:subClassOf matonto:Element.

Answer:

matonto:Ruthenium a owl:Class;
dcterms:title 'Ruthenium';
dcterms:description 'Ruthenium is a chemical element; it has symbol Ru and atomic number 44. It is a rare transition metal belonging to the platinum group of the periodic table. Like the other metals of the platinum group, ruthenium is unreactive to most chemicals. Karl Ernst Claus, a Russian scientist of Baltic-German ancestry, discovered the element in 1844 at Kazan State University and named it in honor of Russia. Ruthenium is usually found as a minor component of platinum ores; the annual production has risen from about 19 tonnes in 2009 to some 35.5 tonnes in 2017. Most ruthenium produced is used in wear-resistant electrical contacts and thick-film resistors. A minor application for ruthenium is in platinum alloys and as a chemical catalyst. A new application of ruthenium is as the capping layer for extreme ultraviolet photomasks. Ruthenium is generally found in ores with the other platinum group metals in the Ural Mountains and in North and South America. Small but commercially important quantities are also found in pentlandite extracted from Sudbury, Ontario, and in pyroxenite deposits in South Africa.'.

matonto:CovalentBond a owl:Class;
dcterms:title 'covalent bond';
dcterms:description 'A covalent bond is a chemical bond that involves the sharing of electrons to form electron pairs between atoms. These electron pairs are known as shared pairs or bonding pairs. The stable balance of attractive and repulsive forces between atoms, when they share electrons, is known as covalent bonding. For many molecules, the sharing of electrons allows each atom to attain the equivalent of a full valence shell, corresponding to a stable electronic configuration. In organic chemistry, covalent bonding is much more common than ionic bonding.';
rdfs:subClassOf matonto:Ruthenium.

