matonto:Metalloid a owl:Class;
dcterms:title 'metalloid';
dcterms:description 'A metalloid is a chemical element which has a preponderance of properties in between, or that are a mixture of, those of metals and nonmetals. The word metalloid comes from the Latin metallum ("metal") and the Greek oeides. There is no standard definition of a metalloid and no complete agreement on which elements are metalloids. Despite the lack of specificity, the term remains in use in the literature.'.

