matonto:Count a owl:Class;
dcterms:title 'count';
dcterms:description 'Count is a historical title of nobility in certain European countries, varying in relative status, generally of middling rank in the hierarchy of nobility. Especially in earlier medieval periods the term often implied not only a certain status, but also that the count had specific responsibilities or offices. The etymologically related English term "county" denoted the territories associated with some countships, but not all.';
rdfs:subClassOf matonto:MeasuredProperty.

