matonto:ThermalConduction a owl:Class;
dcterms:title 'thermal conduction';
dcterms:description 'Thermal conduction is the diffusion of thermal energy (heat) within one material or between materials in contact. The higher temperature object has molecules with more kinetic energy; collisions between molecules distributes this kinetic energy until an object has the same kinetic energy throughout. Thermal conductivity, frequently represented by k, is a property that relates the rate of heat loss per unit area of a material to its rate of change of temperature. Essentially, it is a value that accounts for any property of the material that could change the way it conducts heat. Heat spontaneously flows along a temperature gradient. For example, heat is conducted from the hotplate of an electric stove to the bottom of a saucepan in contact with it. In the absence of an opposing external driving energy source, within a body or between bodies, temperature differences decay over time, and thermal equilibrium is approached, temperature becoming more uniform.'.

matonto:PureSubstance a owl:Class;
dcterms:title 'pure substance';
dcterms:description 'A chemical substance is a unique form of matter with constant chemical composition and characteristic properties. Chemical substances may take the form of a single element or chemical compounds. If two or more chemical substances can be combined without reacting, they may form a chemical mixture. If a mixture is separated to isolate one chemical substance to a desired degree, the resulting substance is said to be chemically pure.';
rdfs:subClassOf matonto:ThermalConduction.

Answer:

matonto:Conformer a owl:Class;
dcterms:title 'conformer';
dcterms:description 'A conformer is a clear acrylic shell fitted after an enucleation of the eye if the final artificial eye is not available at the time of surgery, to hold the shape of the eye socket and allow the eyelids to blink over the shell without rubbing the suture line.
The conformer shell holds the shape ready for the artificial eye, and is worn for six to eight weeks after surgery.
Some ocularists will make a temporary artificial eye which can be worn as the conformer shell.'.

matonto:GaucheConformation a owl:Class;
dcterms:title 'gauche conformation';
dcterms:description 'In chemistry, rotamers are chemical species that differ from one another primarily due to rotations about one or more single bonds. Various arrangements of atoms in a molecule that differ by rotation about single bonds can also be referred to as conformations. Conformers/rotamers differ little in their energies, so they are almost never separable in a practical sense. Rotations about single bonds are subject to small energy barriers. When the time scale for interconversion is long enough for isolation of individual rotamers, the species are termed atropisomers. The ring-flip of substituted cyclohexanes constitutes a common form of conformers.';
rdfs:subClassOf matonto:Conformer.

