matonto:OxidizingAgent a owl:Class;
dcterms:title 'oxidizing agent';
dcterms:description 'An oxidizing agent is a substance in a redox chemical reaction that gains or "accepts"/"receives" an electron from a reducing agent. In other words, an oxidizer is any substance that oxidizes another substance. The oxidation state, which describes the degree of loss of electrons, of the oxidizer decreases while that of the reductant increases; this is expressed by saying that oxidizers "undergo reduction" and "are reduced" while reducers "undergo oxidation" and "are oxidized".
Common oxidizing agents are oxygen, hydrogen peroxide, and the halogens.'.

matonto:Ketone a owl:Class;
dcterms:title 'ketone';
dcterms:description 'In organic chemistry, a ketone is an organic compound with the structure R−C(=O)−R’, where R and R’ can be a variety of carbon-containing substituents. Ketones contain a carbonyl group −C(=O)−. The simplest ketone is acetone, with the formula (CH3)2CO. Many ketones are of great importance in biology and industry. Examples include many sugars (ketoses), many steroids and the solvent acetone.';
rdfs:subClassOf matonto:OxidizingAgent.

