matonto:Entity a owl:Class;
dcterms:title 'entity';
dcterms:description 'An entity is something that exists as itself. It does not need to be of material existence. In particular, abstractions and legal fictions are usually regarded as entities. In general, there is also no presumption that an entity is animate, or present. The verb tense of this form is to ’entitise’ - meaning one or oneself to replenish their entity completely into a fresh, fluorescent entity and has therefore entitised their soul.'.

matonto:SpecificHeat a owl:Class;
dcterms:title 'specific heat';
dcterms:description 'In thermodynamics, the specific heat capacity of a substance is the amount of heat that must be added to one unit of mass of the substance in order to cause an increase of one unit in temperature. It is also referred to as massic heat capacity or as the specific heat. More formally it is the heat capacity of a sample of the substance divided by the mass of the sample. The SI unit of specific heat capacity is joule per kelvin per kilogram, J⋅kg−1⋅K−1. For example, the heat required to raise the temperature of 1 kg of water by 1 K is 4184 joules, so the specific heat capacity of water is 4184 J⋅kg−1⋅K−1.';
rdfs:subClassOf matonto:Entity.

Answer:

matonto:Promethium a owl:Class;
dcterms:title 'Promethium';
dcterms:description 'Promethium is a chemical element; it has symbol Pm and atomic number 61. All of its isotopes are radioactive; it is extremely rare, with only about 500–600 grams naturally occurring in the Earth’s crust at any given time. Promethium is one of the only two radioactive elements that are both preceded and followed in the periodic table by elements with stable forms, the other being technetium. Chemically, promethium is a lanthanide. Promethium shows only one stable oxidation state of +3.'.

