matonto:PowerUnit a owl:Class;
dcterms:title 'power unit';
dcterms:description 'In electricity generation, a generator, also called an electric generator, electrical generator, and electromagnetic generator is an electromechanical device that converts mechanical energy to electrical energy for use in an external circuit. In most generators which are rotating machines, a source of kinetic power rotates the generator’s shaft, and the generator produces an electric current at its output terminals which flows through an external circuit, powering electrical loads. Sources of mechanical energy used to drive generators include steam turbines, gas turbines, water turbines, internal combustion engines, wind turbines and even hand cranks. Generators produce nearly all of the electric power for worldwide electric power grids. The first electromagnetic generator, the Faraday disk, was invented in 1831 by British scientist Michael Faraday.'.

matonto:Hardness a owl:Class;
dcterms:title 'Hardness';
dcterms:description 'In materials science, hardness is a measure of the resistance to localized plastic deformation, such as an indentation or a scratch (linear), induced mechanically either by pressing or abrasion. In general, different materials differ in their hardness; for example hard metals such as titanium and beryllium are harder than soft metals such as sodium and metallic tin, or wood and common plastics. Macroscopic hardness is generally characterized by strong intermolecular bonds, but the behavior of solid materials under force is complex; therefore, hardness can be measured in different ways, such as scratch hardness, indentation hardness, and rebound hardness. Hardness is dependent on ductility, elastic stiffness, plasticity, strain, strength, toughness, viscoelasticity, and viscosity. Common examples of hard matter are ceramics, concrete, certain metals, and superhard materials, which can be contrasted with soft matter.';
rdfs:subClassOf matonto:PowerUnit.

Answer:

matonto:Radium a owl:Class;
dcterms:title 'Radium';
dcterms:description 'Radium is a chemical element; it has symbol Ra and atomic number 88. It is the sixth element in group 2 of the periodic table, also known as the alkaline earth metals. Pure radium is silvery-white, but it readily reacts with nitrogen (rather than oxygen) upon exposure to air, forming a black surface layer of radium nitride (Ra3N2). All isotopes of radium are radioactive, the most stable isotope being radium-226 with a half-life of 1,600 years. When radium decays, it emits ionizing radiation as a by-product, which can excite fluorescent chemicals and cause radioluminescence. For this property, it was widely used in self-luminous paints following its discovery. Of the radioactive elements that occur in quantity, radium is considered particularly toxic, and it is carcinogenic due to the radioactivity of both it and its immediate decay product radon as well as its tendency to accumulate in the bones.'.

matonto:Radical a owl:Class;
dcterms:title 'radical';
dcterms:description '';
rdfs:subClassOf matonto:Radium.

Answer:

matonto:Holmium a owl:Class;
dcterms:title 'Holmium';
dcterms:description 'Holmium is a chemical element; it has symbol Ho and atomic number 67. It is a rare-earth element and the eleventh member of the lanthanide series. It is a relatively soft, silvery, fairly corrosion-resistant and malleable metal. Like many other lanthanides, holmium is too reactive to be found in native form, as pure holmium slowly forms a yellowish oxide coating when exposed to air. When isolated, holmium is relatively stable in dry air at room temperature. However, it reacts with water and corrodes readily, and also burns in air when heated.'.

matonto:ThermalExpansion a owl:Class;
dcterms:title 'Thermal Expansion';
dcterms:description 'Thermal expansion is the tendency of matter to increase in length, area, or volume, changing its size and density, in response to an increase in temperature .
Substances usually contract with decreasing temperature, with rare exceptions within limited temperature ranges.';
rdfs:subClassOf matonto:Holmium.

