matonto:Radiation a owl:Class;
dcterms:title 'radiation';
dcterms:description 'In physics, radiation is the emission or transmission of energy in the form of waves or particles through space or a material medium. This includes:electromagnetic radiation consisting of photons, such as radio waves, microwaves, infrared, visible light, ultraviolet, x-rays, and gamma radiation (γ)
particle radiation consisting of particles of non-zero rest energy, such as alpha radiation (α), beta radiation (β), proton radiation and neutron radiation
acoustic radiation, such as ultrasound, sound, and seismic waves, all dependent on a physical transmission medium
gravitational radiation, in the form of gravitational waves, ripples in spacetime';
rdfs:subClassOf matonto:ChemicalReactionPathway.

Answer:

matonto:Osmium a owl:Class;
dcterms:title 'Osmium';
dcterms:description 'Osmium is a chemical element; it has symbol Os and atomic number 76. It is a hard, brittle, bluish-white transition metal in the platinum group that is found as a trace element in alloys, mostly in platinum ores. Osmium is the densest naturally occurring element. When experimentally measured using X-ray crystallography, it has a density of 22.59 g/cm3. Manufacturers use its alloys with platinum, iridium, and other platinum-group metals to make fountain pen nib tipping, electrical contacts, and in other applications that require extreme durability and hardness.'.

matonto:Tin a owl:Class;
dcterms:title 'Tin';
dcterms:description 'Tin is a chemical element; it has symbol Sn and atomic number 50. A silvery-colored metal, tin is soft enough to be cut with little force, and a bar of tin can be bent by hand with little effort. When bent, the so-called "tin cry" can be heard as a result of twinning in tin crystals.';
rdfs:subClassOf matonto:Osmium.

Answer:

matonto:Isomerization a owl:Class;
dcterms:title 'isomerization';
dcterms:description 'In chemistry, isomerization or isomerisation is the process in which a molecule, polyatomic ion or molecular fragment is transformed into an isomer with a different chemical structure. Enolization is an example of isomerization, as is tautomerization.'.

matonto:Catalyst a owl:Class;
dcterms:title 'catalyst';
dcterms:description 'Catalysis is the increase in rate of a chemical reaction due to an added substance known as a catalyst. Catalysts are not consumed by the reaction and remain unchanged after it. If the reaction is rapid and the catalyst recycles quickly, very small amounts of catalyst often suffice; mixing, surface area, and temperature are important factors in reaction rate. Catalysts generally react with one or more reactants to form intermediates that subsequently give the final reaction product, in the process of regenerating the catalyst.';
rdfs:subClassOf matonto:Isomerization.

Answer:

matonto:LuminousFlux a owl:Class;
dcterms:title 'luminous flux';
dcterms:description 'In photometry, luminous flux or luminous power is the measure of the perceived power of light. It differs from radiant flux, the measure of the total power of electromagnetic radiation, in that luminous flux is adjusted to reflect the varying sensitivity of the human eye to different wavelengths of light.'.

