matonto:Mass a owl:Class;
dcterms:title 'mass';
dcterms:description 'Mass is an intrinsic property of a body. It was traditionally believed to be related to the quantity of matter in a body, until the discovery of the atom and particle physics. It was found that different atoms and different elementary particles, theoretically with the same amount of matter, have nonetheless different masses. Mass in modern physics has multiple definitions which are conceptually distinct, but physically equivalent. Mass can be experimentally defined as a measure of the body’s inertia, meaning the resistance to acceleration when a net force is applied. The object’s mass also determines the strength of its gravitational attraction to other bodies.'.

matonto:Angle a owl:Class;
dcterms:title 'angle';
dcterms:description 'In Euclidean geometry, an angle can refer to a number of concepts relating to the intersection of two straight lines at a point. Formally, an angle is a figure lying in a plane formed by two rays, called the sides of the angle, sharing a common endpoint, called the vertex of the angle. More generally angles are also formed wherever two lines, rays or line segments come together, such as at the corners of triangles and other polygons. An angle can be considered as the region of the plane bounded by the sides. Angles can also be formed by the intersection of two planes or by two intersecting curves, in which case the rays lying tangent to each curve at the point of intersection define the angle.';
rdfs:subClassOf matonto:Mass.

Answer:

