matonto:Iron a owl:Class;
dcterms:title 'Iron';
dcterms:description 'Iron is a chemical element; it has symbol Fe and atomic number 26. It is a metal that belongs to the first transition series and group 8 of the periodic table. It is, by mass, the most common element on Earth, forming much of Earth’s outer and inner core. It is the fourth most abundant element in the Earth’s crust, being mainly deposited by meteorites in its metallic state.'.

