dcterms:title 'aldehyde';
dcterms:description 'In organic chemistry, an aldehyde is an organic compound containing a functional group with the structure R−CH=O. The functional group itself can be referred to as an aldehyde but can also be classified as a formyl group. Aldehydes are a common motif in many chemicals important in technology and biology.';
