matonto:Silver a owl:Class;
dcterms:title 'Silver';
dcterms:description 'Silver is a chemical element; it has symbol Ag and atomic number 47. A soft, whitish-gray, lustrous transition metal, it exhibits the highest electrical conductivity, thermal conductivity, and reflectivity of any metal. Silver is found in the Earth’s crust in the pure, free elemental form, as an alloy with gold and other metals, and in minerals such as argentite and chlorargyrite. Most silver is produced as a byproduct of copper, gold, lead, and zinc refining.'.

matonto:Angle a owl:Class;
dcterms:title 'angle';
dcterms:description 'In Euclidean geometry, an angle can refer to a number of concepts relating to the intersection of two straight lines at a point. Formally, an angle is a figure lying in a plane formed by two rays, called the sides of the angle, sharing a common endpoint, called the vertex of the angle. More generally angles are also formed wherever two lines, rays or line segments come together, such as at the corners of triangles and other polygons. An angle can be considered as the region of the plane bounded by the sides. Angles can also be formed by the intersection of two planes or by two intersecting curves, in which case the rays lying tangent to each curve at the point of intersection define the angle.';
rdfs:subClassOf matonto:Silver.

Answer:

matonto:LuminousIntensity a owl:Class;
dcterms:title 'luminous intensity';
dcterms:description 'In photometry, luminous intensity is a measure of the wavelength-weighted power emitted by a light source in a particular direction per unit solid angle, based on the luminosity function, a standardized model of the sensitivity of the human eye. The SI unit of luminous intensity is the candela (cd), an SI base unit.'.

matonto:NonMetal a owl:Class;
dcterms:title 'non metal';
dcterms:description 'In the context of the periodic table, a nonmetal is a chemical element that mostly lacks distinctive metallic properties. They range from colorless gases like hydrogen to shiny crystals like iodine. Physically, they are usually lighter than elements that form metals and are often poor conductors of heat and electricity. Chemically, nonmetals have relatively high electronegativity or usually attract electrons in a chemical bond with another element, and their oxides tend to be acidic.';
rdfs:subClassOf matonto:LuminousIntensity.

Answer:

matonto:Identifier a owl:Class;
dcterms:title 'identifier';
dcterms:description 'An identifier is a name that identifies either a unique object or a unique class of objects, where the "object" or class may be an idea, person, physical countable object, or physical noncountable substance. The abbreviation ID often refers to identity, identification, or an identifier. An identifier may be a word, number, letter, symbol, or any combination of those.'.

