matonto:Temperature a owl:Class;
dcterms:title 'temperature';
dcterms:description 'Temperature is a physical quantity that quantitatively expresses the attribute of hotness or coldness. Temperature is measured with a thermometer. It reflects the average kinetic energy of the vibrating and colliding atoms making up a substance.'.

matonto:Hardness a owl:Class;
dcterms:title 'Hardness';
dcterms:description 'In materials science, hardness is a measure of the resistance to localized plastic deformation, such as an indentation or a scratch (linear), induced mechanically either by pressing or abrasion. In general, different materials differ in their hardness; for example hard metals such as titanium and beryllium are harder than soft metals such as sodium and metallic tin, or wood and common plastics. Macroscopic hardness is generally characterized by strong intermolecular bonds, but the behavior of solid materials under force is complex; therefore, hardness can be measured in different ways, such as scratch hardness, indentation hardness, and rebound hardness. Hardness is dependent on ductility, elastic stiffness, plasticity, strain, strength, toughness, viscoelasticity, and viscosity. Common examples of hard matter are ceramics, concrete, certain metals, and superhard materials, which can be contrasted with soft matter.';
rdfs:subClassOf matonto:Temperature.

Answer:

matonto:IonicBond a owl:Class;
dcterms:title 'ionic bond';
dcterms:description 'Ionic bonding is a type of chemical bonding that involves the electrostatic attraction between oppositely charged ions, or between two atoms with sharply different electronegativities, and is the primary interaction occurring in ionic compounds. It is one of the main types of bonding, along with covalent bonding and metallic bonding. Ions are atoms with an electrostatic charge. Atoms that gain electrons make negatively charged ions. Atoms that lose electrons make positively charged ions. This transfer of electrons is known as electrovalence in contrast to covalence. In the simplest case, the cation is a metal atom and the anion is a nonmetal atom, but these ions can be more complex, e.g. polyatomic ions like NH+4 or SO2−4. In simpler words, an ionic bond results from the transfer of electrons from a metal to a non-metal to obtain a full valence shell for both atoms.'.

matonto:Fullerene a owl:Class;
dcterms:title 'fullerene';
dcterms:description 'A fullerene is an allotrope of carbon whose molecules consist of carbon atoms connected by single and double bonds so as to form a closed or partially closed mesh, with fused rings of five to six atoms. The molecules may have hollow sphere- and ellipsoid-like forms, tubes, or other shapes.';
rdfs:subClassOf matonto:IonicBond.

