dcterms:description 'Oxygen is a chemical element; it has symbol O and atomic number 8. It is a member of the chalcogen group in the periodic table, a highly reactive nonmetal, and a potent oxidizing agent that readily forms oxides with most elements as well as with other compounds. Oxygen is the most abundant element in Earth’s crust, making up almost half of the Earth’s crust in the form of various oxides such as water, carbon dioxide, iron oxides and silicates. It is the third-most abundant element in the universe after hydrogen and helium.'.

matonto:FractureToughness a owl:Class;
dcterms:title 'fracture toughness';
dcterms:description 'In materials science, fracture toughness is the critical stress intensity factor of a sharp crack where propagation of the crack suddenly becomes rapid and unlimited. It is a material property that quantifies its ability to resist crack propagation and failure under applied stress. A component’s thickness affects the constraint conditions at the tip of a crack with thin components having plane stress conditions, leading to ductile behavior and thick components having plane strain conditions, where the constraint increases, leading to brittle failure. Plane strain conditions give the lowest fracture toughness value which is a material property. The critical value of stress intensity factor in mode I loading measured under plane strain conditions is known as the plane strain fracture toughness, denoted . When a test fails to meet the thickness and other test requirements that are in place to ensure plane strain conditions, the fracture toughness value produced is given the designation .';
rdfs:subClassOf matonto:Oxygen.

Answer:

matonto:Name a owl:Class;
dcterms:title 'name';
dcterms:description 'A name is a term used for identification by an external observer. They can identify a class or category of things, or a single thing, either uniquely, or within a given context. The entity identified by a name is called its referent. A personal name identifies, not necessarily uniquely, a specific individual human. The name of a specific entity is sometimes called a proper name and is, when consisting of only one word, a proper noun. Other nouns are sometimes called "common names" or (obsolete) "general names". A name can be given to a person, place, or thing; for example, parents can give their child a name or a scientist can give an element a name.'.

matonto:ChemicalReaction a owl:Class;
dcterms:title 'chemical reaction';
dcterms:description 'A chemical reaction is a process that leads to the chemical transformation of one set of chemical substances to another. When chemical reactions occur, the atoms are rearranged and the reaction is accompanied by an energy change as new products are generated. Classically, chemical reactions encompass changes that only involve the positions of electrons in the forming and breaking of chemical bonds between atoms, with no change to the nuclei, and can often be described by a chemical equation. Nuclear chemistry is a sub-discipline of chemistry that involves the chemical reactions of unstable and radioactive elements where both electronic and nuclear changes can occur.';
rdfs:subClassOf matonto:Name.

