matonto:Frequency a owl:Class;
dcterms:title 'frequency';
dcterms:description 'Frequency, most often measured in hertz, is the number of occurrences of a repeating event per unit of time. It is also occasionally referred to as temporal frequency for clarity and to distinguish it from spatial frequency. Ordinary frequency is related to angular frequency by a factor of 2π.'.

matonto:CarbonylCompound a owl:Class;
dcterms:title 'carbonyl compound';
dcterms:description 'In organic chemistry, a carbonyl group is a functional group with the formula C=O, composed of a carbon atom double-bonded to an oxygen atom, and it is divalent at the C atom. It is common to several classes of organic compounds, as part of many larger functional groups. A compound containing a carbonyl group is often referred to as a carbonyl compound.';
