matonto:SolidPhase a owl:Class;
dcterms:title 'solid phase';
dcterms:description 'In the physical sciences, a phase is a region of material that is chemically uniform, physically distinct, and (often) mechanically separable. In a system consisting of ice and water in a glass jar, the ice cubes are one phase, the water is a second phase, and the humid air is a third phase over the ice and water. The glass of the jar is a different material, in its own separate phase.';
rdfs:subClassOf matonto:CommonChemicalPhase.

Answer:

matonto:MeltingPoint a owl:Class;
dcterms:title 'Melting Point';
dcterms:description 'The melting point of a substance is the temperature at which it changes state from solid to liquid. At the melting point the solid and liquid phase exist in equilibrium. The melting point of a substance depends on pressure and is usually specified at a standard pressure such as 1 atmosphere or 100 kPa.'.

matonto:Material a owl:Class;
dcterms:title 'material';
dcterms:description 'A material is a substance or mixture of substances that constitutes an object. Materials can be pure or impure, living or non-living matter. Materials can be classified on the basis of their physical and chemical properties, or on their geological origin or biological function. Materials science is the study of materials, their properties and their applications.';
rdfs:subClassOf matonto:MeltingPoint.

Answer:

matonto:GroupElement a owl:Class;
dcterms:title 'group element';
dcterms:description 'Group 3 is the first group of transition metals in the periodic table. This group is closely related to the rare-earth elements. It contains the four elements scandium (Sc), yttrium (Y), lutetium (Lu), and lawrencium (Lr). The group is also called the scandium group or scandium family after its lightest member.'.

matonto:Anion a owl:Class;
