matonto:Volume a owl:Class;
dcterms:title 'volume';
dcterms:description 'Volume is a measure of regions in three-dimensional space. It is often quantified numerically using SI derived units or by various imperial or US customary units. The definition of length and height (cubed) is interrelated with volume. The volume of a container is generally understood to be the capacity of the container; i.e., the amount of fluid that the container could hold, rather than the amount of space the container itself displaces. 
By metonymy, the term "volume" sometimes is used to refer to the corresponding region.'.

matonto:AngularVelocity a owl:Class;
dcterms:title 'angular velocity';
dcterms:description 'In physics, angular velocity, also known as the angular frequency vector, is a pseudovector representation of how the angular position or orientation of an object changes with time, i.e. how quickly an object rotates around an axis of rotation and how fast the axis itself changes direction.';
rdfs:subClassOf matonto:Volume.

Answer:

matonto:RedoxReaction a owl:Class;
dcterms:title 'redox reaction';
dcterms:description 'Redox is a type of chemical reaction in which the oxidation states of the reactants change. Oxidation is the loss of electrons or an increase in the oxidation state, while reduction is the gain of electrons or a decrease in the oxidation state. The oxidation and reduction processes occur simultaneously in the chemical reaction.'.

matonto:MolarMass a owl:Class;
dcterms:title 'molar mass';
dcterms:description 'In chemistry, the molar mass of a chemical substance is defined as the ratio between the mass and the amount of substance of any sample of the substance: . The molar mass is a bulk, not molecular, property of a substance. The molar mass is an average of many instances of the element or compound, which often vary in mass due to the presence of isotopes. Most commonly, the molar mass is computed from the standard atomic weights and is thus a terrestrial average and a function of the relative abundance of the isotopes of the constituent atoms on Earth.';
rdfs:subClassOf matonto:RedoxReaction.

Answer:

matonto:Density a owl:Class;
dcterms:title 'density';
dcterms:description 'Density is the ratio of a substance’s mass to its volume. The symbol most often used for density is ρ, although the Latin letter D can also be used: 

where ρ is the density, m is the mass, and V is the volume. In some cases, density is loosely defined as its weight per unit volume, although this is scientifically inaccurate – this quantity is more specifically called specific weight.'.

