matonto:Molybdenum a owl:Class;
dcterms:title 'Molybdenum';
dcterms:description 'Molybdenum is a chemical element; it has symbol Mo and atomic number 42. The name derived from Ancient Greek Μόλυβδος molybdos, meaning lead, since its ores were confused with lead ores. Molybdenum minerals have been known throughout history, but the element was discovered in 1778 by Carl Wilhelm Scheele. The metal was first isolated in 1781 by Peter Jacob Hjelm.';
rdfs:subClassOf matonto:RhodiumAtom.

Answer:

matonto:Lanthanide a owl:Class;
dcterms:title 'lanthanide';
dcterms:description 'The lanthanide or lanthanoid series of chemical elements comprises at least the 14 metallic chemical elements with atomic numbers 57–70, from lanthanum through ytterbium. In the periodic table, they fill the 4f orbitals. Lutetium is also sometimes considered a lanthanide, despite being a d-block element and a transition metal.'.

matonto:IntermolecularInteraction a owl:Class;
dcterms:title 'intermolecular interaction';
dcterms:description 'An intermolecular force is the force that mediates interaction between molecules, including the electromagnetic forces of attraction
or repulsion which act between atoms and other types of neighbouring particles. Intermolecular forces are weak relative to intramolecular forces – the forces which hold a molecule together. For example, the covalent bond, involving sharing electron pairs between atoms, is much stronger than the forces present between neighboring molecules. Both sets of forces are essential parts of force fields frequently used in molecular mechanics.';
rdfs:subClassOf matonto:Lanthanide.

Answer:

matonto:Glasses a owl:Class;
dcterms:title 'glasses';
dcterms:description 'Glasses, also known as eyeglasses, spectacles, or colloquially as specs, are vision eyewear with clear or tinted lenses mounted in a frame that holds them in front of a person’s eyes, typically utilizing a bridge over the nose and hinged arms, known as temples or temple pieces, that rest over the ears for support.'.

matonto:Rutherfordium a owl:Class;
dcterms:title 'Rutherfordium';
dcterms:description 'Rutherfordium is a synthetic chemical element; it has symbol Rf and atomic number 104. It is named after physicist Ernest Rutherford. As a synthetic element, it is not found in nature and can only be made in a particle accelerator. It is radioactive; the most stable known isotope, 267Rf, has a half-life of about 48 minutes.';
rdfs:subClassOf matonto:Glasses.

Answer:

matonto:PeriodElement a owl:Class;
dcterms:title 'period element';
dcterms:description ''.

matonto:Period6Element a owl:Class;
dcterms:title 'period 6 element';
dcterms:description 'A period 6 element is one of the chemical elements in the sixth row (or period) of the periodic table of the chemical elements, including the lanthanides. The periodic table is laid out in rows to illustrate recurring (periodic) trends in the chemical behaviour of the elements as their atomic number increases: a new row is begun when chemical behaviour begins to repeat, meaning that elements with similar behaviour fall into the same vertical columns. The sixth period contains 32 elements, tied for the most with period 7, beginning with caesium and ending with radon. Lead is currently the last stable element; all subsequent elements are radioactive. For bismuth, however, its only primordial isotope, 209Bi, has a half-life of more than 1019 years, over a billion times longer than the current age of the universe. As a rule, period 6 elements fill their 6s shells first, then their 4f, 5d, and 6p shells, in that order; however, there are exceptions, such as gold.';
rdfs:subClassOf matonto:PeriodElement.

Answer:

