matonto:AntiConformation a owl:Class;
dcterms:title 'anti conformation';
dcterms:description 'In chemistry, rotamers are chemical species that differ from one another primarily due to rotations about one or more single bonds. Various arrangements of atoms in a molecule that differ by rotation about single bonds can also be referred to as conformations. Conformers/rotamers differ little in their energies, so they are almost never separable in a practical sense. Rotations about single bonds are subject to small energy barriers. When the time scale for interconversion is long enough for isolation of individual rotamers, the species are termed atropisomers. The ring-flip of substituted cyclohexanes constitutes a common form of conformers.';
rdfs:subClassOf matonto:ThermalConductionUnit.

Answer:

matonto:Dipole-dipoleInteraction a owl:Class;
dcterms:title 'dipole-dipole interaction';
dcterms:description 'An intermolecular force is the force that mediates interaction between molecules, including the electromagnetic forces of attraction
or repulsion which act between atoms and other types of neighbouring particles. Intermolecular forces are weak relative to intramolecular forces – the forces which hold a molecule together. For example, the covalent bond, involving sharing electron pairs between atoms, is much stronger than the forces present between neighboring molecules. Both sets of forces are essential parts of force fields frequently used in molecular mechanics.'.

matonto:Reagent a owl:Class;
dcterms:title 'Reagent';
dcterms:description 'In chemistry, a reagent or analytical reagent is a substance or compound added to a system to cause a chemical reaction, or test if one occurs. The terms reactant and reagent are often used interchangeably, but reactant specifies a substance consumed in the course of a chemical reaction. Solvents, though involved in the reaction mechanism, are usually not called reactants. Similarly, catalysts are not consumed by the reaction, so they are not reactants. In biochemistry, especially in connection with enzyme-catalyzed reactions, the reactants are commonly called substrates.';
rdfs:subClassOf matonto:Dipole-dipoleInteraction.

Answer:

matonto:UltimateTensileStrength a owl:Class;
dcterms:title 'ultimate tensile strength';
dcterms:description 'Ultimate tensile strength is the maximum stress that a material can withstand while being stretched or pulled before breaking. In brittle materials, the ultimate tensile strength is close to the yield point, whereas in ductile materials, the ultimate tensile strength can be higher.'.

matonto:Catalyst a owl:Class;
dcterms:title 'catalyst';
dcterms:description 'Catalysis is the increase in rate of a chemical reaction due to an added substance known as a catalyst. Catalysts are not consumed by the reaction and remain unchanged after it. If the reaction is rapid and the catalyst recycles quickly, very small amounts of catalyst often suffice; mixing, surface area, and temperature are important factors in reaction rate. Catalysts generally react with one or more reactants to form intermediates that subsequently give the final reaction product, in the process of regenerating the catalyst.';
rdfs:subClassOf matonto:UltimateTensileStrength.

Answer:

