matonto:Enthalpy a owl:Class;
dcterms:title 'enthalpy';
dcterms:description 'Enthalpy is the sum of a thermodynamic system’s internal energy and the product of its pressure and volume. It is a state function in thermodynamics used in many measurements in chemical, biological, and physical systems at a constant external pressure, which is conveniently provided by the large ambient atmosphere. The pressure–volume term expresses the work  that was done against constant external pressure  to establish the system’s physical dimensions from  to some final volume , i.e. to make room for it by displacing its surroundings.
The pressure-volume term is very small for solids and liquids at common conditions, and fairly small for gases. Therefore, enthalpy is a stand-in for energy in chemical systems; bond, lattice, solvation, and other chemical "energies" are actually enthalpy differences. As a state function, enthalpy depends only on the final configuration of internal energy, pressure, and volume, not on the path taken to achieve it.';
rdfs:subClassOf matonto:TautomerCount.

