matonto:Group7Element a owl:Class;
dcterms:title 'group 7 element';
dcterms:description 'Group 7, numbered by IUPAC nomenclature, is a group of elements in the periodic table. It contains manganese (Mn), technetium (Tc), rhenium (Re) and bohrium (Bh). This group lies in the d-block of the periodic table, and are hence transition metals. This group is sometimes called the manganese group or manganese family after its lightest member; however, the group itself has not acquired a trivial name because it belongs to the broader grouping of the transition metals.'.

matonto:HelmholtzFreeEnergy a owl:Class;
dcterms:title 'Helmholtz free energy';
dcterms:description 'In thermodynamics, the Helmholtz free energy is a thermodynamic potential that measures the useful work obtainable from a closed thermodynamic system at a constant temperature (isothermal). The change in the Helmholtz energy during a process is equal to the maximum amount of work that the system can perform in a thermodynamic process in which temperature is held constant. At constant temperature, the Helmholtz free energy is minimized at equilibrium.';
rdfs:subClassOf matonto:Group7Element.

