matonto:HeliumAtom a owl:Class;
dcterms:title 'Helium Atom';
dcterms:description 'A helium atom is an atom of the chemical element helium. Helium is composed of two electrons bound by the electromagnetic force to a nucleus containing two protons along with two neutrons, depending on the isotope, held together by the strong force. Unlike for hydrogen, a closed-form solution to the Schrödinger equation for the helium atom has not been found. However, various approximations, such as the Hartree–Fock method, can be used to estimate the ground state energy and wavefunction of the atom.';
rdfs:subClassOf matonto:CarbonGroup.

