matonto:Ununtrium a owl:Class;
dcterms:title 'Ununtrium';
dcterms:description 'Nihonium is a synthetic chemical element; it has symbol Nh and atomic number 113. It is extremely radioactive: its most stable known isotope, nihonium-286, has a half-life of about 10 seconds. In the periodic table, nihonium is a transactinide element in the p-block. It is a member of period 7 and group 13.'.

matonto:Ununnilium a owl:Class;
dcterms:title 'Ununnilium';
dcterms:description 'Darmstadtium is a synthetic chemical element; it has symbol Ds and atomic number 110. It is extremely radioactive: the most stable known isotope, darmstadtium-281, has a half-life of approximately 14 seconds. Darmstadtium was first created in November 1994 by the GSI Helmholtz Centre for Heavy Ion Research in the city of Darmstadt, Germany, after which it was named.';
rdfs:subClassOf matonto:Ununtrium.

