matonto:Promethium a owl:Class;
dcterms:title 'Promethium';
dcterms:description 'Promethium is a chemical element; it has symbol Pm and atomic number 61. All of its isotopes are radioactive; it is extremely rare, with only about 500–600 grams naturally occurring in the Earth’s crust at any given time. Promethium is one of the only two radioactive elements that are both preceded and followed in the periodic table by elements with stable forms, the other being technetium. Chemically, promethium is a lanthanide. Promethium shows only one stable oxidation state of +3.'.

