matonto:ChemicalReaction a owl:Class;
dcterms:title 'chemical reaction';
dcterms:description 'A chemical reaction is a process that leads to the chemical transformation of one set of chemical substances to another. When chemical reactions occur, the atoms are rearranged and the reaction is accompanied by an energy change as new products are generated. Classically, chemical reactions encompass changes that only involve the positions of electrons in the forming and breaking of chemical bonds between atoms, with no change to the nuclei, and can often be described by a chemical equation. Nuclear chemistry is a sub-discipline of chemistry that involves the chemical reactions of unstable and radioactive elements where both electronic and nuclear changes can occur.'.

matonto:Acid-baseReaction a owl:Class;
dcterms:title 'acid-base reaction';
dcterms:description 'In chemistry, an acid–base reaction is a chemical reaction that occurs between an acid and a base. It can be used to determine pH via titration. Several theoretical frameworks provide alternative conceptions of the reaction mechanisms and their application in solving related problems; these are called the acid–base theories, for example, Brønsted–Lowry acid–base theory.';
rdfs:subClassOf matonto:ChemicalReaction.

Answer:

matonto:Gold a owl:Class;
dcterms:title 'Gold';
dcterms:description 'Gold is a chemical element; it has chemical symbol Au and atomic number 79. In its pure form, it is a bright, slightly orange-yellow, dense, soft, malleable, and ductile metal. Chemically, gold is a transition metal, a group 11 element, and one of the noble metals. It is one of the least reactive chemical elements, being the second-lowest in the reactivity series. It is solid under standard conditions.'.

matonto:CrystalSystem a owl:Class;
dcterms:title 'crystal system';
dcterms:description 'In crystallography, a crystal system is a set of point groups. A lattice system is a set of Bravais lattices. Space groups are classified into crystal systems according to their point groups, and into lattice systems according to their Bravais lattices. Crystal systems that have space groups assigned to a common lattice system are combined into a crystal family.';
rdfs:subClassOf matonto:Gold.

