matonto:ElectricCharge a owl:Class;
dcterms:title 'electric charge';
dcterms:description 'Electric charge is a physical property of matter that causes it to experience a force when placed in an electromagnetic field. Electric charge can be positive or negative. Like charges repel each other and unlike charges attract each other. An object with no net charge is referred to as electrically neutral. Early knowledge of how charged substances interact is now called classical electrodynamics, and is still accurate for problems that do not require consideration of quantum effects.'.

matonto:Californium a owl:Class;
dcterms:title 'Californium';
dcterms:description 'Californium is a synthetic chemical element; it has symbol Cf and atomic number 98. It was first synthesized in 1950 at Lawrence Berkeley National Laboratory by bombarding curium with alpha particles. It is an actinide element, the sixth transuranium element to be synthesized, and has the second-highest atomic mass of all elements that have been produced in amounts large enough to see with the naked eye. It was named after the university and the U.S. state of California.';
rdfs:subClassOf matonto:ElectricCharge.

Answer:

matonto:Entity a owl:Class;
dcterms:title 'entity';
dcterms:description 'An entity is something that exists as itself. It does not need to be of material existence. In particular, abstractions and legal fictions are usually regarded as entities. In general, there is also no presumption that an entity is animate, or present. The verb tense of this form is to ’entitise’ - meaning one or oneself to replenish their entity completely into a fresh, fluorescent entity and has therefore entitised their soul.'.

matonto:Aromatic a owl:Class;
dcterms:title 'aromatic';
dcterms:description 'In organic chemistry, aromaticity is a chemical property describing the way in which a conjugated ring of unsaturated bonds, lone pairs, or empty orbitals exhibits a stabilization stronger than would be expected from conjugation alone. The earliest use of the term was in an article by August Wilhelm Hofmann in 1855. There is no general relationship between aromaticity as a chemical property and the olfactory properties of such compounds.';
rdfs:subClassOf matonto:Entity.

Answer:

matonto:MagneticFlux a owl:Class;
dcterms:title 'magnetic flux';
dcterms:description 'In physics, specifically electromagnetism, the magnetic flux through a surface is the surface integral of the normal component of the magnetic field B over that surface. It is usually denoted Φ or ΦB. The SI unit of magnetic flux is the weber, and the CGS unit is the maxwell. Magnetic flux is usually measured with a fluxmeter, which contains measuring coils, and it calculates the magnetic flux from the change of voltage on the coils.'.

matonto:AngularVelocity a owl:Class;
dcterms:title 'angular velocity';
dcterms:description 'In physics, angular velocity, also known as the angular frequency vector, is a pseudovector representation of how the angular position or orientation of an object changes with time, i.e. how quickly an object rotates around an axis of rotation and how fast the axis itself changes direction.';
rdfs:subClassOf matonto:MagneticFlux.

