matonto:Dipole-dipoleInteraction a owl:Class;
dcterms:title 'dipole-dipole interaction';
dcterms:description 'An intermolecular force is the force that mediates interaction between molecules, including the electromagnetic forces of attraction
or repulsion which act between atoms and other types of neighbouring particles. Intermolecular forces are weak relative to intramolecular forces – the forces which hold a molecule together. For example, the covalent bond, involving sharing electron pairs between atoms, is much stronger than the forces present between neighboring molecules. Both sets of forces are essential parts of force fields frequently used in molecular mechanics.'.

matonto:Phosphorus a owl:Class;
dcterms:title 'Phosphorus';
dcterms:description 'Phosphorus is a chemical element; it has symbol P and atomic number 15. All elemental forms of phosphorus are highly reactive and are therefore never found in nature. They can nevertheless be prepared artificially, the two most common allotropes being white phosphorus and red phosphorus. With 31P as its only stable isotope, phosphorus has an occurrence in Earth’s crust of about 0.1%, generally as phosphate rock. A member of the pnictogen family, phosphorus readily forms a wide variety of organic and inorganic compounds, with as its main oxidation states +5, +3 and −3.';
rdfs:subClassOf matonto:Dipole-dipoleInteraction.

Answer:

matonto:PartitionCoefficient a owl:Class;
dcterms:title 'partition coefficient';
dcterms:description '
In the physical sciences, a partition coefficient (P) or distribution coefficient (D) is the ratio of concentrations of a compound in a mixture of two immiscible solvents at equilibrium. This ratio is therefore a comparison of the solubilities of the solute in these two liquids. The partition coefficient generally refers to the concentration ratio of un-ionized species of compound, whereas the distribution coefficient refers to the concentration ratio of all species of the compound.'.

