matonto:MethylGroup a owl:Class;
dcterms:title 'methyl group';
dcterms:description 'In organic chemistry, a methyl group is an alkyl derived from methane, containing one carbon atom bonded to three hydrogen atoms, having chemical formula CH3. In formulas, the group is often abbreviated as Me. This hydrocarbon group occurs in many organic compounds. It is a very stable group in most molecules. While the methyl group is usually part of a larger molecule, bonded to the rest of the molecule by a single covalent bond, it can be found on its own in any of three forms: methanide anion, methylium cation or methyl radical. The anion has eight valence electrons, the radical seven and the cation six. All three forms are highly reactive and rarely observed.'.

matonto:Conformer a owl:Class;
dcterms:title 'conformer';
dcterms:description 'A conformer is a clear acrylic shell fitted after an enucleation of the eye if the final artificial eye is not available at the time of surgery, to hold the shape of the eye socket and allow the eyelids to blink over the shell without rubbing the suture line.
The conformer shell holds the shape ready for the artificial eye, and is worn for six to eight weeks after surgery.
Some ocularists will make a temporary artificial eye which can be worn as the conformer shell.';
rdfs:subClassOf matonto:MethylGroup.

Answer:

matonto:ChemicalFormula a owl:Class;
dcterms:title 'Chemical Formula';
dcterms:description 'A chemical formula is a way of presenting information about the chemical proportions of atoms that constitute a particular chemical compound or molecule, using chemical element symbols, numbers, and sometimes also other symbols, such as parentheses, dashes, brackets, commas and plus (+) and minus (−) signs. These are limited to a single typographic line of symbols, which may include subscripts and superscripts. A chemical formula is not a chemical name since it does not contain any words. Although a chemical formula may imply certain simple chemical structures, it is not the same as a full chemical structural formula. Chemical formulae can fully specify the structure of only the simplest of molecules and chemical substances, and are generally more limited in power than chemical names and structural formulae.'.

matonto:EmpiricalFormula a owl:Class;
dcterms:title 'Empirical Formula';
dcterms:description 'In chemistry, the empirical formula of a chemical compound is the simplest whole number ratio of atoms present in a compound. A simple example of this concept is that the empirical formula of sulfur monoxide, or SO, is simply SO, as is the empirical formula of disulfur dioxide, S2O2. Thus, sulfur monoxide and disulfur dioxide, both compounds of sulfur and oxygen, have the same empirical formula. However, their molecular formulas, which express the number of atoms in each molecule of a chemical compound, are not the same.';
rdfs:subClassOf matonto:ChemicalFormula.

