dcterms:description 'In chemistry, a reagent or analytical reagent is a substance or compound added to a system to cause a chemical reaction, or test if one occurs. The terms reactant and reagent are often used interchangeably, but reactant specifies a substance consumed in the course of a chemical reaction. Solvents, though involved in the reaction mechanism, are usually not called reactants. Similarly, catalysts are not consumed by the reaction, so they are not reactants. In biochemistry, especially in connection with enzyme-catalyzed reactions, the reactants are commonly called substrates.'.

matonto:PartitionCoefficient a owl:Class;
dcterms:title 'partition coefficient';
dcterms:description '
In the physical sciences, a partition coefficient (P) or distribution coefficient (D) is the ratio of concentrations of a compound in a mixture of two immiscible solvents at equilibrium. This ratio is therefore a comparison of the solubilities of the solute in these two liquids. The partition coefficient generally refers to the concentration ratio of un-ionized species of compound, whereas the distribution coefficient refers to the concentration ratio of all species of the compound.';
rdfs:subClassOf matonto:Reagent.

Answer:

matonto:HomogeneousMixture a owl:Class;
dcterms:title 'homogeneous mixture';
dcterms:description '
In chemistry, a mixture is a material made up of two or more different chemical substances which can be separated by physical method. It is an impure substance made up of 2 or more elements or compounds mechanically mixed together in any proportion. A mixture is the physical combination of two or more substances in which the identities are retained and are mixed in the form of solutions, suspensions or colloids.'.

matonto:CarbonAllotrope a owl:Class;
dcterms:title 'carbon allotrope';
dcterms:description 'Carbon is capable of forming many allotropes due to its valency (tetravalent). Well-known forms of carbon include diamond and graphite. In recent decades, many more allotropes have been discovered and researched, including ball shapes such as buckminsterfullerene and sheets such as graphene. Larger-scale structures of carbon include nanotubes, nanobuds and nanoribbons. Other unusual forms of carbon exist at very high temperatures or extreme pressures. Around 500 hypothetical 3‑periodic allotropes of carbon are known at the present time, according to the Samara Carbon Allotrope Database (SACADA).';
rdfs:subClassOf matonto:HomogeneousMixture.

Answer:

matonto:Atom a owl:Class;
dcterms:title 'atom';
dcterms:description 'Atoms are the basic particles of the chemical elements. An atom consists of a nucleus of protons and generally neutrons, surrounded by an electromagnetically bound swarm of electrons. The chemical elements are distinguished from each other by the number of protons that are in their atoms. For example, any atom that contains 11 protons is sodium, and any atom that contains 29 protons is copper. Atoms with the same number of protons but a different number of neutrons are called isotopes of the same element.'.

