matonto:PlasmaPhase a owl:Class;
dcterms:title 'plasma phase';
dcterms:description 'In the physical sciences, a phase is a region of material that is chemically uniform, physically distinct, and (often) mechanically separable. In a system consisting of ice and water in a glass jar, the ice cubes are one phase, the water is a second phase, and the humid air is a third phase over the ice and water. The glass of the jar is a different material, in its own separate phase.'.

matonto:Permittivity a owl:Class;
dcterms:title 'permittivity';
dcterms:description 'In electromagnetism, the absolute permittivity, often simply called permittivity and denoted by the Greek letter ε (epsilon), is a measure of the electric polarizability of a dielectric material. A material with high permittivity polarizes more in response to an applied electric field than a material with low permittivity, thereby storing more energy in the material. In electrostatics, the permittivity plays an important role in determining the capacitance of a capacitor.';
rdfs:subClassOf matonto:PlasmaPhase.

Answer:

matonto:Frequency a owl:Class;
dcterms:title 'frequency';
dcterms:description 'Frequency, most often measured in hertz, is the number of occurrences of a repeating event per unit of time. It is also occasionally referred to as temporal frequency for clarity and to distinguish it from spatial frequency. Ordinary frequency is related to angular frequency by a factor of 2π.'.

matonto:AcylChloride a owl:Class;
dcterms:title 'acyl chloride';
dcterms:description 'In organic chemistry, an acyl chloride is an organic compound with the functional group −C(=O)Cl. Their formula is usually written R−COCl, where R is a side chain. They are reactive derivatives of carboxylic acids. A specific example of an acyl chloride is acetyl chloride, CH3COCl. Acyl chlorides are the most important subset of acyl halides.';
rdfs:subClassOf matonto:Frequency.

