matonto:BandGap a owl:Class;
dcterms:title 'band gap';
dcterms:description 'In solid-state physics and solid-state chemistry, a band gap, also called a bandgap or energy gap, is an energy range in a solid where no electronic states exist. In graphs of the electronic band structure of solids, the band gap refers to the energy difference between the top of the valence band and the bottom of the conduction band in insulators and semiconductors. It is the energy required to promote an electron from the valence band to the conduction band. The resulting conduction-band electron are free to move within the crystal lattice and serve as charge carriers to conduct electric current. It is closely related to the HOMO/LUMO gap in chemistry. If the valence band is completely full and the conduction band is completely empty, then electrons cannot move within the solid because there are no available states. If the electrons are not free to move within the crystal lattice, then there is no generated current due to no net charge carrier mobility. However, if some electrons transfer from the valence band to the conduction band, then current can flow. Therefore, the band gap is a major factor determining the electrical conductivity of a solid. Substances having large band gaps are generally insulators, those with small band gaps are semiconductors, and conductors either have very small band gaps or none, because the valence and conduction bands overlap to form a continuous band.';
rdfs:subClassOf matonto:Three_dimensional_region.

