matonto:Identifier a owl:Class;
dcterms:title 'identifier';
dcterms:description 'An identifier is a name that identifies either a unique object or a unique class of objects, where the "object" or class may be an idea, person, physical countable object, or physical noncountable substance. The abbreviation ID often refers to identity, identification, or an identifier. An identifier may be a word, number, letter, symbol, or any combination of those.'.

matonto:MolecularFormula a owl:Class;
dcterms:title 'molecular formula';
dcterms:description 'A chemical formula is a way of presenting information about the chemical proportions of atoms that constitute a particular chemical compound or molecule, using chemical element symbols, numbers, and sometimes also other symbols, such as parentheses, dashes, brackets, commas and plus (+) and minus (−) signs. These are limited to a single typographic line of symbols, which may include subscripts and superscripts. A chemical formula is not a chemical name since it does not contain any words. Although a chemical formula may imply certain simple chemical structures, it is not the same as a full chemical structural formula. Chemical formulae can fully specify the structure of only the simplest of molecules and chemical substances, and are generally more limited in power than chemical names and structural formulae.';
rdfs:subClassOf matonto:Identifier.

Answer:

matonto:AntiConformation a owl:Class;
dcterms:title 'anti conformation';
dcterms:description 'In chemistry, rotamers are chemical species that differ from one another primarily due to rotations about one or more single bonds. Various arrangements of atoms in a molecule that differ by rotation about single bonds can also be referred to as conformations. Conformers/rotamers differ little in their energies, so they are almost never separable in a practical sense. Rotations about single bonds are subject to small energy barriers. When the time scale for interconversion is long enough for isolation of individual rotamers, the species are termed atropisomers. The ring-flip of substituted cyclohexanes constitutes a common form of conformers.'.

matonto:CarbonylCompound a owl:Class;
dcterms:title 'carbonyl compound';
dcterms:description 'In organic chemistry, a carbonyl group is a functional group with the formula C=O, composed of a carbon atom double-bonded to an oxygen atom, and it is divalent at the C atom. It is common to several classes of organic compounds, as part of many larger functional groups. A compound containing a carbonyl group is often referred to as a carbonyl compound.';
rdfs:subClassOf matonto:AntiConformation.

