matonto:BinaryCompound a owl:Class;
dcterms:title 'binary compound';
dcterms:description 'In materials chemistry, a binary phase or binary compound is a chemical compound containing two different elements. Some binary phase compounds are molecular, e.g. carbon tetrachloride (CCl4). More typically binary phase refers to extended solids. Famous examples zinc sulfide, which contains zinc and sulfur, and tungsten carbide, which contains tungsten and carbon.'.

matonto:IonicCompound a owl:Class;
