matonto:Name a owl:Class;
dcterms:title 'name';
dcterms:description 'A name is a term used for identification by an external observer. They can identify a class or category of things, or a single thing, either uniquely, or within a given context. The entity identified by a name is called its referent. A personal name identifies, not necessarily uniquely, a specific individual human. The name of a specific entity is sometimes called a proper name and is, when consisting of only one word, a proper noun. Other nouns are sometimes called "common names" or (obsolete) "general names". A name can be given to a person, place, or thing; for example, parents can give their child a name or a scientist can give an element a name.'.

matonto:Radon a owl:Class;
dcterms:title 'Radon';
dcterms:description 'Radon is a chemical element; it has symbol Rn and atomic number 86. It is a radioactive noble gas and is colorless and odorless. Of the three naturally occurring radon isotopes, only 222Rn has a sufficiently long half-life for it to be released from the soil and rock where it is generated. Radon isotopes are the immediate decay products of radium isotopes. The instability of 222Rn, its most stable isotope, makes radon one of the rarest elements. Radon will be present on Earth for several billion more years despite its short half-life, because it is constantly being produced as a step in the decay chains of 238U and 232Th, both of which are abundant radioactive nuclides with half-lives of at least several billion years. The decay of radon produces many other short-lived nuclides, known as "radon daughters", ending at stable isotopes of lead. 222Rn occurs in significant quantities as a step in the normal radioactive decay chain of 238U, also known as the uranium series, which slowly decays into a variety of radioactive nuclides and eventually decays into stable 206Pb. 220Rn occurs in minute quantities as an intermediate step in the decay chain of 232Th, also known as the thorium series, which eventually decays into stable 208Pb.';
rdfs:subClassOf matonto:Name.

Answer:

