matonto:Strontium a owl:Class;
dcterms:title 'Strontium';
dcterms:description 'Strontium is a chemical element; it has symbol Sr and atomic number 38. An alkaline earth metal, it is a soft silver-white yellowish metallic element that is highly chemically reactive. The metal forms a dark oxide layer when it is exposed to air. Strontium has physical and chemical properties similar to those of its two vertical neighbors in the periodic table, calcium and barium. It occurs naturally mainly in the minerals celestine and strontianite, and is mostly mined from these.'.

matonto:Curium a owl:Class;
dcterms:title 'Curium';
dcterms:description 'Curium is a synthetic chemical element; it has symbol Cm and atomic number 96. This transuranic actinide element was named after eminent scientists Marie and Pierre Curie, both known for their research on radioactivity. Curium was first intentionally made by the team of Glenn T. Seaborg, Ralph A. James, and Albert Ghiorso in 1944, using the cyclotron at Berkeley. They bombarded the newly discovered element plutonium with alpha particles. This was then sent to the Metallurgical Laboratory at University of Chicago where a tiny sample of curium was eventually separated and identified. The discovery was kept secret until after the end of World War II. The news was released to the public in November 1947. Most curium is produced by bombarding uranium or plutonium with neutrons in nuclear reactors – one tonne of spent nuclear fuel contains ~20 grams of curium.';
rdfs:subClassOf matonto:Strontium.

Answer:

matonto:CarbonGroup a owl:Class;
dcterms:title 'carbon group';
dcterms:description 'The carbon group is a periodic table group consisting of carbon (C), silicon (Si), germanium (Ge), tin (Sn), lead (Pb), and flerovium (Fl). It lies within the p-block.'.

matonto:MethylGroup a owl:Class;
dcterms:title 'methyl group';
dcterms:description 'In organic chemistry, a methyl group is an alkyl derived from methane, containing one carbon atom bonded to three hydrogen atoms, having chemical formula CH3. In formulas, the group is often abbreviated as Me. This hydrocarbon group occurs in many organic compounds. It is a very stable group in most molecules. While the methyl group is usually part of a larger molecule, bonded to the rest of the molecule by a single covalent bond, it can be found on its own in any of three forms: methanide anion, methylium cation or methyl radical. The anion has eight valence electrons, the radical seven and the cation six. All three forms are highly reactive and rarely observed.';
rdfs:subClassOf matonto:CarbonGroup.

Answer:

matonto:IntermolecularInteraction a owl:Class;
dcterms:title 'intermolecular interaction';
dcterms:description 'An intermolecular force is the force that mediates interaction between molecules, including the electromagnetic forces of attraction
or repulsion which act between atoms and other types of neighbouring particles. Intermolecular forces are weak relative to intramolecular forces – the forces which hold a molecule together. For example, the covalent bond, involving sharing electron pairs between atoms, is much stronger than the forces present between neighboring molecules. Both sets of forces are essential parts of force fields frequently used in molecular mechanics.'.

