matonto:Acceleration a owl:Class;
dcterms:title 'acceleration';
dcterms:description 'In mechanics, acceleration is the rate of change of the velocity of an object with respect to time. Acceleration is one of several components of kinematics, the study of motion. Accelerations are vector quantities. The orientation of an object’s acceleration is given by the orientation of the net force acting on that object. The magnitude of an object’s acceleration, as described by Newton’s second law, is the combined effect of two causes:the net balance of all external forces acting onto that object — magnitude is directly proportional to this net resulting force;
that object’s mass, depending on the materials out of which it is made — magnitude is inversely proportional to the object’s mass.'.

matonto:Phosphorus a owl:Class;
dcterms:title 'Phosphorus';
dcterms:description 'Phosphorus is a chemical element; it has symbol P and atomic number 15. All elemental forms of phosphorus are highly reactive and are therefore never found in nature. They can nevertheless be prepared artificially, the two most common allotropes being white phosphorus and red phosphorus. With 31P as its only stable isotope, phosphorus has an occurrence in Earth’s crust of about 0.1%, generally as phosphate rock. A member of the pnictogen family, phosphorus readily forms a wide variety of organic and inorganic compounds, with as its main oxidation states +5, +3 and −3.';
rdfs:subClassOf matonto:Acceleration.

