matonto:ElectricResistance a owl:Class;
dcterms:title 'electric resistance';
dcterms:description 'The electrical resistance of an object is a measure of its opposition to the flow of electric current. Its reciprocal quantity is electrical conductance, measuring the ease with which an electric current passes. Electrical resistance shares some conceptual parallels with mechanical friction. The SI unit of electrical resistance is the ohm, while electrical conductance is measured in siemens (S).'.

matonto:Holmium a owl:Class;
dcterms:title 'Holmium';
dcterms:description 'Holmium is a chemical element; it has symbol Ho and atomic number 67. It is a rare-earth element and the eleventh member of the lanthanide series. It is a relatively soft, silvery, fairly corrosion-resistant and malleable metal. Like many other lanthanides, holmium is too reactive to be found in native form, as pure holmium slowly forms a yellowish oxide coating when exposed to air. When isolated, holmium is relatively stable in dry air at room temperature. However, it reacts with water and corrodes readily, and also burns in air when heated.';
rdfs:subClassOf matonto:ElectricResistance.

Answer:

matonto:Force a owl:Class;
dcterms:title 'force';
dcterms:description 'In physics, a force is an influence that can cause an object to change its velocity unless counterbalanced by other forces. In mechanics, force makes ideas like ’pushing’ or ’pulling’ mathematically precise. Because the magnitude and direction of a force are both important, force is a vector quantity. The SI unit of force is the newton (N), and force is often represented by the symbol F.'.

