matonto:IntensiveProperty a owl:Class;
dcterms:title 'intensive property';
dcterms:description 'Physical or chemical properties of materials and systems can often be categorized as being either intensive or extensive, according to how the property changes when the size of the system changes.
The terms "intensive and extensive quantities" were introduced into physics by German mathematician Georg Helm in 1898, and by American physicist and chemist Richard C. Tolman in 1917.'.

matonto:Material a owl:Class;
dcterms:title 'material';
dcterms:description 'A material is a substance or mixture of substances that constitutes an object. Materials can be pure or impure, living or non-living matter. Materials can be classified on the basis of their physical and chemical properties, or on their geological origin or biological function. Materials science is the study of materials, their properties and their applications.';
rdfs:subClassOf matonto:IntensiveProperty.

