matonto:Hafnium a owl:Class;
dcterms:title 'Hafnium';
dcterms:description 'Hafnium is a chemical element; it has symbol Hf and atomic number 72. A lustrous, silvery gray, tetravalent transition metal, hafnium chemically resembles zirconium and is found in many zirconium minerals. Its existence was predicted by Dmitri Mendeleev in 1869, though it was not identified until 1922, by Dirk Coster and George de Hevesy. Hafnium is named after Hafnia, the Latin name for Copenhagen, where it was discovered.';
rdfs:subClassOf matonto:Site.

Answer:

matonto:Conformer a owl:Class;
dcterms:title 'conformer';
dcterms:description 'A conformer is a clear acrylic shell fitted after an enucleation of the eye if the final artificial eye is not available at the time of surgery, to hold the shape of the eye socket and allow the eyelids to blink over the shell without rubbing the suture line.
The conformer shell holds the shape ready for the artificial eye, and is worn for six to eight weeks after surgery.
Some ocularists will make a temporary artificial eye which can be worn as the conformer shell.'.

matonto:Aryl a owl:Class;
dcterms:title 'aryl';
dcterms:description 'In organic chemistry, an aryl is any functional group or substituent derived from an aromatic ring, usually an aromatic hydrocarbon, such as phenyl and naphthyl. "Aryl" is used for the sake of abbreviation or generalization, and "Ar" is used as a placeholder for the aryl group in chemical structure diagrams, analogous to “R” used for any organic substituent. “Ar” is not to be confused with the elemental symbol for argon.';
rdfs:subClassOf matonto:Conformer.

Answer:

