matonto:AdditionReaction a owl:Class;
dcterms:title 'addition reaction';
dcterms:description 'In organic chemistry, an addition reaction is an organic reaction in which two or more molecules combine to form a larger molecule called the adduct.'.

matonto:Acid-baseReaction a owl:Class;
dcterms:title 'acid-base reaction';
dcterms:description 'In chemistry, an acid–base reaction is a chemical reaction that occurs between an acid and a base. It can be used to determine pH via titration. Several theoretical frameworks provide alternative conceptions of the reaction mechanisms and their application in solving related problems; these are called the acid–base theories, for example, Brønsted–Lowry acid–base theory.';
rdfs:subClassOf matonto:AdditionReaction.

Answer:

matonto:Ketone a owl:Class;
dcterms:title 'ketone';
dcterms:description 'In organic chemistry, a ketone is an organic compound with the structure R−C(=O)−R’, where R and R’ can be a variety of carbon-containing substituents. Ketones contain a carbonyl group −C(=O)−. The simplest ketone is acetone, with the formula (CH3)2CO. Many ketones are of great importance in biology and industry. Examples include many sugars (ketoses), many steroids and the solvent acetone.'.

matonto:AmideGroup a owl:Class;
dcterms:title 'amide group';
dcterms:description 'In organic chemistry, an amide, also known as an organic amide or a carboxamide, is a compound with the general formula R−C(=O)−NR′R″, where R, R’, and R″ represent any group, typically organyl groups or hydrogen atoms. The amide group is called a peptide bond when it is part of the main chain of a protein, and an isopeptide bond when it occurs in a side chain, as in asparagine and glutamine. It can be viewed as a derivative of a carboxylic acid with the hydroxyl group replaced by an amino group ; or, equivalently, an acyl (alkanoyl) group joined to an amino group.';
rdfs:subClassOf matonto:Ketone.

Answer:
